INSERT INTO `face_flow_instructions` (`id`, `face_flow`, `face_config_id`, `text`, `updated_time`, `user_id`) VALUES
	(1, 'RAVA', 13, '<page master="rava_third_page">\r\n        <date-printed>$!date_long</date-printed>\r\n        <first-name>$!ufFirstName</first-name>\r\n        <value>\r\n            <font size="11px" family="TrebuchetMS" line-height="5mm">\r\n<p margin-top="12px">Thank you for using the Overseas Vote Foundation (OVF) Voter Registration/Ballot Request form process. Please follow the 5 steps below to complete the application process.</p>\r\n\r\n<p margin-top="12px"><b>1. Check your documents:</b></p>\r\n<p margin-top="12px">Verify your information</p>\r\n<p margin-top="12px"><span>If corrections are needed, return to the OVF website,</span> <a href="http://www.overseasvotefoundation.org">http://www.overseasvotefoundation.org</a> to correct and download new forms.</p>\r\n\r\n<p margin-top="12px"><b>2. Print, sign and check the date on your forms:</b></p>\r\n\r\n<p margin-top="12px">Sign your Voter Registration/Ballot Request form and addendum page. Your election official requires your <b><i>ORIGINAL SIGNATURE</i></b> on the forms.</p>\r\n\r\n<p margin-top="12px"><b>Address your envelope to your local election office:</b></p>\r\n<p margin-top="12px" margin-left="20px">$!envelope_address</p>\r\n\r\n<p margin-top="12px"><b>3. Send in your Signed, Dated Original Form:</b></p>\r\n\r\n<p margin-top="12px"><b>Postal Mail (Snail Mail):</b> OVF recommends regular postal mail as the most secure method for transmitting your confidential election materials to your local election official. Mail them from a post office instead of a mailbox and, if possible, get the envelope legibly postmarked with the date of mailing.</p>\r\n\r\n<p margin-top="12px"><b>Fax or Email + Post  the original:</b> Some states allow you to fax or email the form  to speed processing; however, it must be followed by a posted hardcopy form with your original signature by mail in order to be a valid application. In addition, electronic transmission is not considered a secure transmission for your confidential personal information. Consult the OVF State-Specific Voter Information Directory for options for sending in your application.</p>\r\n\r\n<p margin-top="12px"><b>4. Confirm that you are on the voter rolls and will receive your ballots.</b></p>\r\n<p margin-top="12px">OVF recommends that you contact your local election official after sending in your application to confirm that it has been received and approved, and that you will receive your ballots throughout the year.</p>\r\n\r\n\r\n#if (!$leo.lovc.empty)\r\n	<p margin-bottom="5px" margin-top="10px"><b>Overseas Voting Contact:</b></p>\r\n 	<p margin-bottom="2px">$!leo.lovc.firstName $!leo.lovc.lastName</p>\r\n	#if(!$leo.lovcPhone.equals(""))<p margin-bottom="2px">phone: $!leo.lovcPhone</p>#end\r\n	#if(!$leo.lovcFax.equals(""))<p margin-bottom="2px">fax: $!leo.lovcFax</p>#end\r\n    #if(!$leo.lovcEmail.equals(""))<p margin-bottom="2px">email: <a href="mailto:$!leo.lovcEmail">$!leo.lovcEmail</a></p>#end\r\n#end\r\n\r\n#if (!$leo.leo.empty)\r\n    <p margin-bottom="5px" margin-top="10px"><b>Local Election Official:</b></p>\r\n    <p margin-bottom="2px">$!leo.leo.firstName $!leo.leo.lastName</p>\r\n	#if(!$leo.leoPhone.equals(""))<p margin-bottom="2px">phone: $!leo.leoPhone</p>#end\r\n	#if(!$leo.leoFax.equals(""))<p margin-bottom="2px">fax: $!leo.leoFax</p>#end\r\n	#if(!$leo.leoEmail.equals(""))<p margin-bottom="2px">email: <a href="mailto:$!leo.leoEmail">$!leo.leoEmail</a></p>#end\r\n#end\r\n\r\n<p margin-top="12px">Never assume that your ballot will simply arrive for the next election. Contact your election official and avoid surprises.</p>\r\n\r\n<p margin-top="12px">Online Registration Confirmation: Consult the OVF State-Specific Voter Information Directory for your state\'s voter registration confirmation service.</p>\r\n\r\n<p margin-top="12px"><b>5. Mark Your Calendar and Be Prepared to Use a Back-Up Ballot</b></p>\r\n\r\n<p margin-top="12px">Sometimes ballots arrive late. If you haven\'t received your official ballot from your local election office <b>30 days</b> before the election, return to the OVF website and use the Federal Write-In Absentee Ballot.</p>\r\n\r\n<p margin-top="12px"><b>Thank you!</b></p>\r\n\r\n<p margin-top="12px">Overseas Vote Foundation is a nonprofit, nonpartisan public charity dedicated to facilitating overseas citizens and voters in federal elections. \r\n<b>Please consider making a <a href="https://www.overseasvotefoundation.org/donation">donation</a> to help keep OVF going!</b></p>\r\n\r\n<p margin-top="12px">We wish you a positive voting experience in the coming election,</p>\r\n<p margin-top="12px">Overseas Vote Foundation</p>\r\n<p margin-top="12px"><a href="https://www.overseasvotefoundation.org">www.overseasvotefoundation.org</a></p>\r\n</font>\r\n        </value>\r\n    </page>', '2012-02-27 21:18:02', 2),
	(3, 'FWAB', 13, '<page master="rava_third_page">\r\n        <date-printed>$!date_long</date-printed>\r\n        <first-name>$!ufFirstName</first-name>\r\n        <value>\r\n            <font size="11px" family="TrebuchetMS" line-height="5mm">\r\n\r\n\r\n               <p margin-top="16px">\r\n 					IMPORTANT Instructions and Information\r\n                </p>\r\n                <p margin-top="14px">\r\n                    <b>Federal Write-In Absentee Ballot (FWAB) - Final Steps for Submission to your U.S. Election Office</b>\r\n                </p>\r\n                <p margin-top="12px">\r\n					You have used the OVF Vote-Print-Mail Ballot system to generate a Federal Write-In Absentee Ballot (FWAB).  Please follow these instructions to complete the process and submit the ballot to your U.S. Election Office.\r\n                </p>\r\n                <p margin-top="12px">\r\n                    <b>The file you downloaded should contain the following documents:</b>\r\n                    <ol margin-left="10px">\r\n                        <li margin-top="10px"><b>Important Instructions and Information</b> - (5 pages)( Please note: You do not need to submit the instructions  to your U.S. Election Office.</li>\r\n                        <li margin-top="10px">The FWAB cover page which is titled: \'<b>Voter\'s Declaration/Affirmation</b> - Federal Write-In Absentee Ballot (FWAB)\' You must sign and date the cover page and submit it to your U.S. Election Office with your ballot and the addendum page if applicable.\r\n                       	</li>\r\n                        <li margin-top="10px"><b>Addendum page</b> - to accompany the cover page.  Sign, date and submit the addendum page only if it contains information such as a note to your election official or state-specific information.  You do not need to submit a blank Addendum page.</li>\r\n                        <li margin-top="10px">Your <b>BALLOT</b> which is titled: \'Official Federal Write-In Absentee Ballot\'\r\n							<p margin-top="12px">You will submit the ballot in a blank security envelope to your U.S. Election Office.  Further instructions below.</p></li>\r\n                        <li margin-top="10px">For your reference only: The official <b>Privacy Act Statement</b> from the Federal Voting Assistance Program. You do not need to submit the Privacy Act Statement.</li>\r\n                        <li margin-top="10px"><b>Fax Cover Sheet</b>: Fax Cover Sheet: You have been provided with a completed fax cover sheet if you wish to fax your FWAB cover page and the addendum page together with your ballot in advance of mailing. Please note: In nearly every case, even if faxed in advance, ballots must be posted to arrive at your Election Office as hard copy, signed/dated originals to be valid.</li>\r\n                    </ol>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Signatures/Dates:</b>\r\n                    <p margin-top="5px">\r\n                        Remember to sign and date the Voter\'s Declaration/Affirmation cover page. Sign and date the Addendum page only if it contains information and you will be submitting it in with the cover page. \r\n					</p>\r\n                </p>\r\n\r\n\r\n                <p margin-top="12px">\r\n                    <b>Vote: </b>\r\n                   	<p margin-top="5px">\r\n						OVF\'s new Vote-Print-Mail Ballot system will have presented you with federal level candidate lists based on your voting jurisdiction.  Please confirm that your ballot was properly completed with the candidate choices you intended to make.\r\n					</p>\r\n					<p margin-top="5px">\r\n						If you chose the option to write-in the name of the candidates or their political party, it will have printed blank and you may complete it by hand.\r\n                    </p>\r\n 					<p margin-top="5px">\r\n						OVF has provided candidate lists for voting at the federal level only. If you would like to vote for state-level offices, you will need to indicate the candidates and parties without our assistance. There are extra blank lines on the ballot page for this purpose. Note: Voters who are "indefinitely" living abroad and no longer paying state taxes should vote only at the federal level.\r\n					</p>\r\n                   <p margin-top="12px"> </p>\r\n                    <p margin-top="12px"><b>President/Vice President </b>- enter names of candidates or name of party</p>\r\n                    <p margin-top="12px"><b>US Senate </b>- enter name of candidate, or name of party</p>\r\n                    <p margin-top="12px"><b>House of Representatives </b>- enter name of candidate, or name of party</p>\r\n                    <p margin-top="12px"> </p>\r\n 				</p>\r\n				<p margin-top="12px">\r\n               		To reference online candidate information, please refer to the www.overseasvotefoundation.org websites, and choose "Candidate Information" from the left sidebar menu.\r\n				</p>\r\n				<p margin-top="12px">\r\n					It is possible that there is no Senate race in your state this year our system will not have provided you the opportunity to choose a candidate and the ballot will print with this line blank.\r\n				</p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Errors/Modifications and Re-printing Options:</b>\r\n					<p margin-top="5px">\r\n						Ballots are generated on demand only by you, and are not saved by the OVF system.  You can certainly correct any mistakes prior to submission.\r\n					</p>\r\n					<p margin-top="5px">\r\n						To redo/change/modify any part of the cover page or your ballot:\r\n					</p>\r\n					 <ol margin-left="10px">\r\n					 	<li margin-top="10px">If you saved your data in a Voter Account, login and choose to reprint your FWAB. You will be able to make any necessary changes prior to reprinting. Certain data will need to be reentered.</li>\r\n						<li margin-top="10px">You can start the FWAB process over again.  Repeat these steps as often as you need. Your ballot is only valid and used when submitted to your election office.</li>\r\n					</ol>\r\n					</p>\r\n                <p margin-top="12px">\r\n                    <b>IMPORTANT Note</b> - you will need to provide 2 envelopes:\r\n                    <ol margin-left="10px">\r\n                        <li margin-top="10px">\r\n                        	<p margin-top="12px">A <b>"Ballot Security Envelope"</b> to hold your ballot page</p>\r\n                        	<p margin-top="5px"> Using a blank envelope, print <b>only</b> the words "Security Envelope" on the outside to make your ballot security envelope for your "Official Federal Write-In Absentee Ballot" page.  Make sure to seal your completed ballot page within it.  Do <b>NOT</b> put your name or any other markings or information on this envelope.</p>\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                        	<p margin-top="12px">A larger <b>Mailing Envelope</b> for the forms and the Ballot Security Envelope</p>\r\n                        	<p margin-top="5px">Your mailing envelope should be large enough to contain the Cover page, Addendum page and your sealed Ballot Security Envelope containing your completed ballot.</p>\r\n                        </li>\r\n                    </ol>\r\n                </p>\r\n\r\n\r\n                #if( $ufAdditionalInstruction && $ufAdditionalInstruction != "" )\r\n                <p margin-top="12px">\r\n                    <b>$!ufVotingState\'s Additional Requirements: </b>\r\n                    <p margin-top="12px">\r\n                        $!ufAdditionalInstruction\r\n                    </p>\r\n                </p>\r\n                #end\r\n\r\n                <p margin-top="12px">\r\n                    <b>Ballot Transmission Options: </b>\r\n                    <p margin-top="12px">Ballot transmission options vary by state.  Many states allow a combination of fax, email and mail transmission. You have been provided with a completed fax cover sheet if you wish to fax your ballot in advance of sending it in. <b>In nearly every case, even if faxed in advance, ballots must arrive as hard copy, signed/dated originals to be valid.</b></p>\r\n\r\n                   <p margin-top="12px">Please check the online <a href="https://www.overseasvotefoundation.org/state-voter-information-directory">State-specific Voter Information Directory</a> - Voting Materials Transmission Options for your state. If you are voting in AL, AK, VA or WI - do not forget to check your witness requirements.</p>\r\n\r\n                   <p margin-top="12px">Ballots can always be mailed by postal mail, and all states and territories (except Alabama) allow FedEx Express delivery.</p>\r\n\r\n                   <p margin-top="12px">Postal Mail: if you plan to use regular postal mail for your FWAB, please send it to the local election office at the following address:</p>\r\n                </p>\r\n\r\n                <p margin-top="12px" margin-left="20px">$!envelope_address</p>\r\n\r\n				<p margin-top="12px" margin-left="20px">Your election official can be reached as follows:</p>\r\n				<p margin-left="20px">\r\n					#if(!$leo.lovc.firstName.equals(""))<b>$!leo.lovc.firstName $!leo.lovc.lastName</b>#end\r\n                   	#if($leo.lovc.firstName.equals("") && !$leo.leo.firstName.equals(""))<b>$!leo.leo.firstName $!leo.leo.lastName</b>#end\r\n                </p>\r\n				<p margin-left="20px">\r\n					#if(!$leo.lovcEmail.equals(""))Email: <b><a href="mailto:$!leo.lovcEmail">$!leo.lovcEmail</a></b>#end\r\n                   	#if($leo.lovcEmail.equals("") && !$leo.leoEmail.equals(""))Email: <b><a href="mailto:$!leo.leoEmail">$!leo.leoEmail</a></b>#end\r\n                </p>\r\n                <p margin-left="20px">\r\n                	#if(!$leo.lovcPhone.equals(""))Phone <b>$!leo.lovcPhone</b>#end\r\n                    #if($leo.lovcPhone.equals("") && !$leo.leoPhone.equals(""))Phone <b>$!leo.leoPhone</b>#end\r\n                </p>\r\n                <p margin-left="20px">\r\n                	#if(!$leo.lovcFax.equals(""))Fax: <b>$!leo.lovcFax</b>#end\r\n                    #if($leo.lovcFax.equals("") && !$leo.leoFax.equals(""))Fax: <b>$!leo.leoFax</b>#end\r\n               </p>\r\n                <p margin-top="12px">\r\n                    <p margin-top="12px"><b>Return address: </b>Remember to put your return address on the outside of the envelope. This should be your address overseas; or if you are in the military, your current address whether within or outside of the U.S.</p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Postage:</b>\r\n                    <p margin-top="5px"><b>Overseas Citizens: </b>Take your FWAB to the local overseas post office to obtain the correct international airmail postage and to have your envelope postmarked from outside the US.</p>\r\n                    <p margin-top="12px"><b>Uniformed Services: </b>If you are mailing your FWAB from within the APO/FPO system, a Diplomatic Pouch, or U.S. Mail, please confirm and affix the correct postage.</p>\r\n                </p>\r\n				\r\n				<!-- Express Your Vote disabled\r\n                <p margin-top="12px"><b>EXPRESS YOUR VOTE</b></p>\r\n                <p margin-top="12px"><b>Special Ballot Shipping Offers for Election $!electionYear </b></p>\r\n                <p margin-top="12px">Overseas Vote Foundation (OVF) is proud to introduce <a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> - an innovative initiative supported by FedEx Express.  Through Express Your Vote, you gain access to special OVF rates for world-class FedEx service, speed and reliability when shipping your ballot back to your election office for the $!electionYear  General (Presidential) Election.</p>\r\n                <p margin-top="12px">The <a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> program starts on September 15, $!electionYear  and runs in more than 80 countries through October 29, $!electionYear *.  You will be able to conveniently generate your Air Waybill through the <a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> section of the <a href="https://www.overseasvotefoundation.org/overseas/">OVF</a> website for country-specific details.</p>\r\n                <p margin-top="12px">With <a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> the latest in shipment tracking technology and automatic delivery notification will be available to you. </p>\r\n                <p margin-top="12px"><a href="https://www.overseasvotefoundation.org/ExpressYourVote">Special shipping rates</a> are available to you, ranging from highly-discounted to absolutely free, depending on the country of operation. Please <a href="https://www.overseasvotefoundation.org/ExpressYourVote">check the lists</a> of participating states and countries.</p>\r\n                <p margin-top="12px"><a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> and be confident it will be there in time to be counted!</p>\r\n                <p margin-top="12px">* Verify exact shipping dates and country eligibility at</p>\r\n                <p margin-top="12px"><a href="http://www.overseasvotefoundation.org/ExpressYourVote">http://www.overseasvotefoundation.org/ExpressYourVote</a></p>\r\n               	<p margin-top="12px">The FedEx Express Money-Back Guarantee does not apply to any shipment sent using the Overseas Vote Foundation discount for the "<a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a>" promotion. Please see <a href="http://www.fedex.com">http://www.fedex.com</a> for terms and conditions of carriage.</p>\r\n				-->\r\n				\r\n                <p margin-top="24px">\r\n                    <b><i>Thank you</i></b>\r\n                </p>\r\n\r\n				<p margin-top="12px">Overseas Vote Foundation is a nonprofit, nonpartisan public charity dedicated to facilitating overseas citizen and uniformed services voter participation in Federal elections. Please consider making a <a href="https://www.overseasvotefoundation.org/donation">donation</a> to help keep OVF going!</p>\r\n\r\n				<p margin-top="12px">We hope that you have had a positive voting experience in this coming election, and that we have been able to assist you with our services,</p>\r\n\r\n				<p margin-top="12px">Overseas Vote Foundation</p>\r\n				<p margin-top="12px"><a href="https://www.overseasvotefoundation.org">www.overseasvotefoundation.org</a></p>\r\n</font>\r\n        </value>\r\n    </page>', '2012-10-11 17:13:34', 2),
	(4, 'RAVA', 23, '<page master="rava_third_page">\r\n        <date-printed>$!date_long</date-printed>\r\n        <first-name>$!ufFirstName</first-name>\r\n        <value>\r\n            <font size="11px" family="TrebuchetMS" line-height="5mm">\r\n                <p margin-top="12px">\r\n                    Please follow the instructions below to complete the application process.\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    Fields left blank on your form are not required for your state.  The OVF registration system has prompted you for the information that your state requires.\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Please check your documents:</b>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">Verify that the data you entered is correct on your Voter Registration/Ballot Request form and the accompanying Addendum page.</li>\r\n                        <li margin-top="10px">\r\n                            <span>If corrections are needed, return to the OVF hosted website,</span>\r\n                            <a href="http://obama.overseasvotefoundation.org">http://obama.overseasvotefoundation.org</a>\r\n                            <span>to either: 1) access your Voter Account and regenerate the form with corrections or; 2) if your browser is still open with the same session running, go back and make changes, then reprint or; 3) run through the registration program again and reprint your form.</span>\r\n                        </li>\r\n                    </ul>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Print, sign and date the forms:</b>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">Sign and date your Voter Registration/Ballot Request form and addendum page.</li>\r\n                        <li margin-top="10px">Make sure to date the forms in U.S. format - Month-Day-Year.</li>\r\n                        <li margin-top="10px">Your election office needs your <i>original signature</i> in order to process and approve it.</li>\r\n                    </ul>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Address your envelope to:</b>\r\n                    <p margin-top="12px" margin-left="20px">$!envelope_address</p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Sending your documents:</b>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">\r\n                            The completed form contains your personal identity information and should be carefully transmitted to your local election office.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Mail:</b>\r\n                            OVF recommends regular postal mail as the number one method for confidential voter materials transmission.  Postal mail is the most secure method of transmitting these highly confidential documents.  It is best to mail it from the post office instead of a mail box.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Fax + Mail the original: </b>\r\n                            Some states allow you to fax the form ahead to speed processing; however, it must be followed by a posted form with your original signature by mail in order to be a valid application.\r\n                            <p margin-top="12px">#if(!$leo.lovcFax.equals(""))The fax number for your region is <b>$!leo.lovcFax</b>#end \r\n                            #if($leo.lovcFax.equals("") && !$leo.leoFax.equals(""))The fax number for your region is <b>$!leo.leoFax</b>#end \r\n                           	#if($leo.lovcFax.equals("") && $leo.leoFax.equals(""))You can look up your region\'s fax number at: <a href="https://www.overseasvotefoundation.org/overseas/eod.htm">www.overseasvotefoundation.org/overseas/eod.htm</a>#end \r\n                           	</p>\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Email:</b>\r\n                            The open Internet is not secure.  Some states and government organizations offer an email option for your signed, scanned forms, but it is not guaranteed as a secure transmission method and must be followed by a posted form with your original signature by mail in order to be a valid application.\r\n                            <p margin-top="12px">#if(!$leo.lovcEmail.equals(""))The email address for your region is  <b><a href="mailto:$!leo.lovcEmail">$!leo.lovcEmail</a></b>#end \r\n                            #if($leo.lovcEmail.equals("") && !$leo.leoEmail.equals(""))The email address for your region is <b><a href="mailto:$!leo.leoEmail">$!leo.leoEmail</a></b>#end \r\n                           	#if($leo.lovcEmail.equals("") && $leo.leoEmail.equals(""))You can look up your region\'s email address at: <a href="https://www.overseasvotefoundation.org/overseas/eod.htm">www.overseasvotefoundation.org/overseas/eod.htm</a>#end \r\n                        	</p>\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            Consult the OVF State-Specific Voter Information Directory online for the various options for sending your Voter Registration/Ballot Request form\r\n                        </li>\r\n                    </ul>\r\n                </p>\r\n\r\n                #if( $ufAdditionalInstruction && $ufAdditionalInstruction != "" )\r\n                <p margin-top="12px">\r\n                    <b>$!ufVotingState\'s Additional Requirements:</b>\r\n                    <p margin-top="12px">\r\n                        $!ufAdditionalInstruction\r\n                    </p>\r\n                </p>\r\n                #end\r\n\r\n                <p margin-top="12px"></p>\r\n                <p margin-top="12px">\r\n                    <b>Further information and resources:</b>\r\n                    <p margin-top="12px">The OVF website provides many services that may be useful to you over the course of this election period including:</p>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">\r\n                            <b>My Voter Account&#x2122;</b>\r\n                             - take advantage of this new service which makes it possible to keep an up-to-date voter profile on hand, maintain your mailing list profile, generate a new ballot request form or a write-in ballot with the click of a button\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Federal Write-in Absentee Ballot wizard</b>\r\n                            - the Federal Write-in Absentee Ballot finally made easy! This is a blank ballot for registered voters to use in the event that your ballot is late in arriving to you.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Voter Help Desk&#x2122;</b>\r\n                             - consult the knowledgebase for answers to your voting questions\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Election Official Directory&#x2122;</b>\r\n                            - comprehensive listing of election office contact information\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>State-specific Voter Information Directory&#x2122;</b>\r\n                            - state-by-state information bank providing details on deadlines, voter materials transmission options and state contact information\r\n                        </li>\r\n                    </ul>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Your next steps:</b>\r\n                    <ol margin-left="10px">\r\n                        <li margin-top="10px"><b>Send</b> in your signed, dated, original form by regular mail.</li>\r\n                        <li margin-top="10px">\r\n                            <b>Confirm</b> that you are on the voter rolls and will receive your $!electionYear  ballots:\r\n                            <p margin-top="12px"> </p>\r\n                            <p margin-top="12px">\r\n                                <a href="https://obama.overseasvotefoundation.org/overseas/eod.htm">Contact your election official</a> after sending your registration/ballot request form to confirm that you are on the rolls and will receive your ballots through the $!electionYear  election year.\r\n	 							#if ( !$leo.lovc.empty )\r\n								    <p margin-top="12px"><b>Overseas Voting Contact:</b></p>\r\n								    <p margin-top="12px">$!leo.lovc.firstName $!leo.lovc.lastName</p>\r\n								   	#if(!$leo.lovcPhone.equals(""))<p margin-top="12px">phone: $!leo.lovcPhone</p>#end\r\n								   	#if(!$leo.lovcFax.equals(""))<p margin-top="12px">fax: $!leo.lovcFax</p>#end\r\n								   	#if(!$leo.lovcEmail.equals(""))<p margin-top="12px">email: <a href="mailto:$!leo.lovcEmail">$!leo.lovcEmail</a></p>#end\r\n								#end\r\n								\r\n								#if ( !$leo.leo.empty )\r\n								    <p margin-top="12px"><b>Local Election Official:</b></p>\r\n								    <p margin-top="12px">$!leo.leo.firstName $!leo.leo.lastName</p>\r\n								   	#if(!$leo.leoPhone.equals(""))<p margin-top="12px">phone: $!leo.leoPhone</p>#end\r\n								   	#if(!$leo.leoFax.equals(""))<p margin-top="12px">fax: $!leo.leoFax</p>#end\r\n								   	#if(!$leo.leoEmail.equals(""))<p margin-top="12px">email: <a href="mailto:$!leo.leoEmail">$!leo.leoEmail</a></p>#end\r\n								#end\r\n								\r\n								#if ( $leo.leo.empty && $leo.lovc.empty )\r\n								<p margin-top="12px">Look up contact information in the Election Official Directory: <a href="https://obama.overseasvotefoundation.org/overseas/eod.htm">obama.overseasvotefoundation.org/overseas/eod.htm</a></p>\r\n								#end\r\n                            </p>\r\n                            <p margin-top="12px"> </p>\r\n                            <p margin-top="12px">\r\n                                Never take for granted that your ballot will simply arrive for the next election without confirming it.  Contact your election official and avoid surprises.\r\n                            </p>\r\n                        </li>\r\n                    </ol>\r\n                </p>\r\n\r\n                <p margin-top="12px"></p>\r\n                <p margin-top="12px">\r\n                    <b>Ballot Back-up Plan</b>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px">\r\n                        Sometimes ballots arrive late.  Or not at all.  We hope that does not occur in your case.\r\n                        If you don\'t receive your requested ballot from your election office by <b>30 days</b> before the election,\r\n                        please visit our site to access the Federal Write-in Absentee Ballot.\r\n                    </p>\r\n                </p>\r\n				\r\n				<!-- Express Your Vote disabled\r\n                <p margin-top="12px"><b>EXPRESS YOUR VOTE</b></p>\r\n                <p margin-top="12px"><b>Special Ballot Shipping Offers for Election $!electionYear </b></p>\r\n                <p margin-top="12px">Overseas Vote Foundation (OVF) is proud to introduce <a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> - an innovative initiative supported by FedEx Express.  Through Express Your Vote, you gain access to special OVF rates for world-class FedEx service, speed and reliability when shipping your ballot back to your election office for the $!electionYear  General (Presidential) Election.</p>\r\n                <p margin-top="12px">The <a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> program starts on September 15, $!electionYear  and runs in more than 80 countries through October 29, $!electionYear *.  You will be able to conveniently generate your Air Waybill through the <a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> section of the <a href="https://www.overseasvotefoundation.org/overseas/">OVF</a> website for country-specific details.</p>\r\n                <p margin-top="12px">With <a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> the latest in shipment tracking technology and automatic delivery notification will be available to you. </p>\r\n                <p margin-top="12px"><a href="https://www.overseasvotefoundation.org/ExpressYourVote">Special shipping rates</a> are available to you, ranging from highly-discounted to absolutely free, depending on the country of operation. Please <a href="https://www.overseasvotefoundation.org/ExpressYourVote">check the lists</a> of participating states and countries.</p>\r\n                <p margin-top="12px"><a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> and be confident it will be there in time to be counted!</p>\r\n                <p margin-top="12px">* Verify exact shipping dates and country eligibility at</p>\r\n                <p margin-top="12px"><a href="http://www.overseasvotefoundation.org/ExpressYourVote">http://www.overseasvotefoundation.org/ExpressYourVote</a></p>\r\n               	<p margin-top="12px">The FedEx Express Money-Back Guarantee does not apply to any shipment sent using the Overseas Vote Foundation discount for the "<a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a>" promotion. Please see <a href="http://www.fedex.com">http://www.fedex.com</a> for terms and conditions of carriage.</p>\r\n				-->\r\n				\r\n                <p margin-top="12px">\r\n                    <b>Thank you</b>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px">\r\n                        Overseas Vote Foundation is a nonprofit, nonpartisan public charity dedicated to facilitating overseas citizen\r\n                        and uniformed services voter participation in Federal elections.\r\n                        <b>Please consider making a <a href="https://www.overseasvotefoundation.org/donation">donation</a> to help keep OVF going!</b>\r\n                    </p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    We wish you a positive voting experience in the coming election,\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    Overseas Vote Foundation\r\n                </p>\r\n                <p margin-top="12px">\r\n                    <a href="https://www.overseasvotefoundation.org">www.overseasvotefoundation.org</a>\r\n                </p>\r\n            </font>\r\n        </value>\r\n    </page>', '2011-12-20 14:31:06', 2),
	(5, 'RAVA', 14, '<page master="rava_third_page">\r\n        <date-printed>$!date_long</date-printed>\r\n        <first-name>$!ufFirstName</first-name>\r\n        <value>\r\n            <font size="11px" family="TrebuchetMS" line-height="5mm">\r\n                <p margin-top="12px">\r\n					Thank you for using the online voter tools through the ExxonMobil Citizen Action Team (CAT) Website to generate your Voter Registration/Absentee Ballot Request form for the $!electionYear  General Election.\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    Please follow the instructions below to complete the application process.\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    Fields left blank on your form are not required for your state.  Our registration system has prompted you only for the information that your specific state requires.\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Please print and check all your documents:</b>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">Verify that the data you entered is correct on your Voter Registration/Absentee Ballot Request form and the accompanying Addendum page.</li>\r\n                        <li margin-top="10px">\r\n 							To make corrections, return to <a href="http://www.exxonmobilcat.com/citizensabroad">ExxonMobilCAT.com/citizensabroad</a>  to either: 1) access your Voter Account and regenerate the form with corrections or; 2) if your browser is still open with the same session running, go back and make changes and then reprint or; 3) run through the registration program again and reprint your form. 							\r\n                        </li>\r\n                    </ul>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Print, sign and date the forms:</b>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">Sign and date your Voter Registration/Absentee Ballot Request form and Addendum page.</li>\r\n                        <li margin-top="10px">Make sure to date the forms in U.S. format - Month/Day/Year.</li>\r\n                        <li margin-top="10px">The state election office must receive the original form with your signature in order to process and approve it.</li>\r\n                    </ul>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Address your mailing envelope to:</b>\r\n                    <p margin-top="12px" margin-left="20px">$!envelope_address</p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Sending your documents:</b>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">\r\n                            The completed Voter Registration/Absentee Ballot Request form contains personal identity information and should be carefully transmitted to your local election office.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Mail:</b>\r\n                            Postal mail is the most secure method of transmitting these highly confidential documents.  It is best to mail from the post office instead of a mail box.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Fax &amp; Mail the original: </b>\r\n                            Some states allow you to fax the form ahead to speed processing; however, it must be followed by a posted form with your original signature by mail in order to be a valid application.\r\n                            <p margin-top="12px">#if(!$leo.lovcFax.equals(""))The fax number for your region is <b>$!leo.lovcFax</b>#end \r\n                            #if($leo.lovcFax.equals("") && !$leo.leoFax.equals(""))The fax number for your region is <b>$!leo.leoFax</b>#end \r\n                           	#if($leo.lovcFax.equals("") && $leo.leoFax.equals(""))You can look up your region\'s fax number at: <a href="https://exxonmobilcat.overseasvotefoundation.org/overseas/eod.htm">exxonmobilcat.overseasvotefoundation.org/overseas/eod.htm</a>#end \r\n                           	</p>\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Email:</b>\r\n                            Some states and government organizations offer an email option for your signed, scanned forms, but it is not guaranteed as a secure transmission method and must be followed by a posted form with your original signature by mail in order to be a valid application.\r\n                            <p margin-top="12px">#if(!$leo.lovcEmail.equals(""))The email address for your region is  <b><a href="mailto:$!leo.lovcEmail">$!leo.lovcEmail</a></b>#end \r\n                            #if($leo.lovcEmail.equals("") && !$leo.leoEmail.equals(""))The email address for your region is <b><a href="mailto:$!leo.leoEmail">$!leo.leoEmail</a></b>#end \r\n                           	#if($leo.lovcEmail.equals("") && $leo.leoEmail.equals(""))You can look up your region\'s email address at: <a href="https://exxonmobilcat.overseasvotefoundation.org/overseas/eod.htm">exxonmobilcat.overseasvotefoundation.org/overseas/eod.htm</a>#end \r\n                        	</p>\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            Consult the <a href="https://exxonmobilcat.overseasvotefoundation.org/state-voter-information-directory">State-Specific Voter Information Directory</a> on <a href="http://exxonmobilcat.com/citizensabroad">ExxonMobilCAT.com/citizensabroad</a> for the various options for sending your Voter Registration/Absentee Ballot Request form.\r\n                        </li>\r\n                    </ul>\r\n                </p>\r\n\r\n                #if( $ufAdditionalInstruction && $ufAdditionalInstruction != "" )\r\n                <p margin-top="12px">\r\n                    <b>$!ufVotingState\'s additional requirements:</b>\r\n                    <p margin-top="12px">\r\n                        $!ufAdditionalInstruction\r\n                    </p>\r\n                </p>\r\n                #end\r\n\r\n                <p margin-top="12px"></p>\r\n                <p margin-top="12px">\r\n                    <b>Further information and resources:</b>\r\n                    <p margin-top="12px">The <a href="http://exxonmobilcat.com/">ExxonMobilCAT Website</a> provides many services that may be useful to you over the course of this election period. Visit ExxonMobilCAT.com/citizensabroad for:</p>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">\r\n                            <b>My Voter Account&#x2122;</b>\r\n                             - This feature which makes it possible to keep an up-to-date voter profile on hand, maintain your mailing list profile, generate a new ballot request form, or a write-in ballot with the click of a button.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Federal Write-in Absentee Ballot wizard</b>\r\n                            - The Federal Write-in Absentee Ballot finally made easy! This is a blank ballot for registered voters to use in the event that your ballot is late in arriving to you.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Voter Help Desk&#x2122;</b>\r\n                             - Fast and friendly answers to your voting questions.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Election Official Directory&#x2122;</b>\r\n                            - The most comprehensive listing of election office contact information available anywhere.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>State-specific Voter Information Directory&#x2122;</b>\r\n                            - State-by-state database  provides details on deadlines, voter requirements, and state contact information.\r\n                         </li>\r\n                    </ul>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Your next steps:</b>\r\n                    <ol margin-left="10px">\r\n                        <li margin-top="10px"><b>Send</b> in your signed, dated, original voter registration form via regular mail.</li>\r\n                        <li margin-top="10px">\r\n                            <b>Confirm</b> that you are on the voter rolls and will receive your $!electionYear  ballots by:\r\n                            <p margin-top="12px"> </p>\r\n                            <p margin-top="12px">\r\n                                Contacting your election official approximately 30 days after mailing your forms.\r\n                                #if ( !$leo.lovc.empty )\r\n								    <p margin-top="12px"><b>Your overseas voting contact:</b></p>\r\n								    <p margin-top="12px">$!leo.lovc.firstName $!leo.lovc.lastName</p>\r\n								   	#if(!$leo.lovcPhone.equals(""))<p margin-top="12px">phone: $!leo.lovcPhone</p>#end\r\n								   	#if(!$leo.lovcFax.equals(""))<p margin-top="12px">fax: $!leo.lovcFax</p>#end\r\n								   	#if(!$leo.lovcEmail.equals(""))<p margin-top="12px">email: <a href="mailto:$!leo.lovcEmail">$!leo.lovcEmail</a></p>#end\r\n								#end\r\n								\r\n								#if ( !$leo.leo.empty )\r\n								    <p margin-top="12px"><b>Your local election official:</b></p>\r\n								    <p margin-top="12px">$!leo.leo.firstName $!leo.leo.lastName</p>\r\n								   	#if(!$leo.leoPhone.equals(""))<p margin-top="12px">phone: $!leo.leoPhone</p>#end\r\n								   	#if(!$leo.leoFax.equals(""))<p margin-top="12px">fax: $!leo.leoFax</p>#end\r\n								   	#if(!$leo.leoEmail.equals(""))<p margin-top="12px">email: <a href="mailto:$!leo.leoEmail">$!leo.leoEmail</a></p>#end\r\n								#end\r\n								\r\n								#if ( $leo.leo.empty && $leo.lovc.empty )\r\n								<p margin-top="12px">Look up contact information in the Election Official Directory available through <a href="http://ExxonMobilCAT.com/citizensabroad">ExxonMobilCAT.com/citizensabroad</a>.</p>\r\n								#end\r\n                            </p>\r\n                            <p margin-top="12px"> </p>\r\n                            <p margin-top="12px">\r\n                                Never take for granted that your ballot will simply arrive for the next election without confirming it!  Contact your election official and avoid surprises.\r\n                            </p>\r\n                        </li>\r\n                     </ol>\r\n                </p>\r\n\r\n                <p margin-top="12px"></p>\r\n                <p margin-top="12px">\r\n                    <b>Ballot back-up plan:</b>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px">\r\n                        Sometimes ballots arrive late, or not at all.  If you don\'t receive your requested ballot from your election office at least <b>30 days</b> before the election, please visit <a href="http://www.exxonmobilcat.com/citizensabroad">ExxonMobilCAT.com/citizensabroad</a> to access the Federal Write-in Absentee Ballot wizard.\r\n                    </p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Thank you:</b>\r\n                    <p margin-top="12px">\r\n                    	We hope you find these new tools valuable in aiding your participation in the upcoming election! \r\n                    </p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <p margin-top="12px">Sincerely,</p>\r\n                    <p margin-top="12px">\r\n                    	ExxonMobil Citizen Action Team\r\n                    </p>\r\n                </p>\r\n            </font>\r\n        </value>\r\n    </page>', '2011-12-20 14:28:12', 2),
	(6, 'FWAB', 14, '<page master="rava_third_page">\r\n        <date-printed>$!date_long</date-printed>\r\n        <first-name>$!ufFirstName</first-name>\r\n        <value>\r\n            <font size="11px" family="TrebuchetMS" line-height="5mm">\r\n\r\n                <p margin-top="12px">\r\n                    Thank you for using the online voter tools through the ExxonMobil Citizen Action Team (CAT) Website to generate your Voter\'s Declaration/Affirmation - Federal Write-In Absentee Ballot (FWAB) request form for the $!electionYear  General Election. \r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    Please follow the instructions below to complete the application process.\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    Fields left blank on your form are not required for your state.  Our registration system has prompted you only for the information that your specific state requires.\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Please print and check all your documents including:</b>\r\n                    <ol margin-left="10px">\r\n                        <li margin-top="10px">The FWAB cover page which is titled: \'Voter\'s Declaration/Affirmation - Federal Write-In Absentee Ballot (FWAB)\'</li>\r\n                        <li margin-top="10px">Addendum page</li>\r\n                        <li margin-top="10px">Your Write-In Ballot which is titled: \'Official Federal Write-In Absentee Ballot\'</li>\r\n                        <li margin-top="10px">For your reference: The official Privacy Act Statement and FWAB completion information from the Federal Voting Assistance Program</li>\r\n                    </ol>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Signatures/Dates:</b>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px">\r\n                        Remember to <b>sign and date</b> the Voter\'s Declaration/Affirmation - Federal Write-In Absentee Ballot (FWAB) form and the Addendum page.\r\n                    </p>\r\n                </p>\r\n\r\n\r\n                <p margin-top="12px">\r\n                    <b>Vote - write-in your choices:</b>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px">\r\n                        Enter either the name of the candidates or the political party for each office you are voting for on your Official Federal Write-In Absentee Ballot.\r\n                    </p>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px"><b>President </b>---enter name of candidate, or name of party---</p>\r\n                    <p margin-top="12px"><b>Vice President </b>---enter name of candidate, or name of party---</p>\r\n                    <p margin-top="12px"><b>U.S. Senate </b>---enter name of candidate, or name of party---</p>\r\n                    <p margin-top="12px"><b>U.S. House of Representatives </b>---enter name of candidate, or name of party---</p>\r\n                    <p margin-top="12px"> </p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>IMPORTANT Note</b> - you will need to provide 2 envelopes:\r\n                    <ol margin-left="10px">\r\n                        <li margin-top="10px">A <b>Ballot Security Envelope</b> to hold your voted ballot - Print <u>only</u> the words <b>"Security Envelope"</b> on the outside of the Ballot Security Envelope containing your Official Federal Write-In Absentee Ballot.  Make sure to seal your voted ballot within it.  Do <b><u>NOT</u></b> put your name or any other information on this envelope.</li>\r\n                        <li margin-top="10px">A larger <b>Mailing Envelope</b> for the forms and the Ballot Security Envelope - Your mailing envelope should be large enough to contain the Cover Page and Addendum and your sealed Ballot Security Envelope containing your completed ballot.</li>\r\n                    </ol>\r\n                </p>\r\n\r\n\r\n                #if( $ufAdditionalInstruction && $ufAdditionalInstruction != "" )\r\n                <p margin-top="12px">\r\n                    <b>$!ufVotingState\'s Additional Requirements: </b>\r\n                    <p margin-top="12px">\r\n                        $!ufAdditionalInstruction\r\n                    </p>\r\n                </p>\r\n                #end\r\n\r\n                <p margin-top="12px">\r\n                    <b>Mailing address: </b>Mail your FWAB to your local election office at the following address:\r\n                    <p margin-top="12px" margin-left="20px">$!envelope_address</p>\r\n                </p>\r\n				<p margin-top="12px" margin-left="20px">Your election official can be reached as follows:</p>\r\n				<p margin-left="20px">\r\n					#if(!$leo.lovc.firstName.equals(""))<b>$!leo.lovc.firstName $!leo.lovc.lastName</b>#end \r\n                   	#if($leo.lovc.firstName.equals("") && !$leo.leo.firstName.equals(""))<b>$!leo.leo.firstName $!leo.leo.lastName</b>#end \r\n                </p>\r\n				<p margin-left="20px">\r\n					#if(!$leo.lovcEmail.equals(""))Email: <b><a href="mailto:$!leo.lovcEmail">$!leo.lovcEmail</a></b>#end \r\n                   	#if($leo.lovcEmail.equals("") && !$leo.leoEmail.equals(""))Email: <b><a href="mailto:$!leo.leoEmail">$!leo.leoEmail</a></b>#end \r\n                </p>\r\n                <p margin-left="20px">\r\n                	#if(!$leo.lovcPhone.equals(""))Phone <b>$!leo.lovcPhone</b>#end \r\n                    #if($leo.lovcPhone.equals("") && !$leo.leoPhone.equals(""))Phone <b>$!leo.leoPhone</b>#end \r\n                </p>\r\n                <p margin-left="20px">\r\n                	#if(!$leo.lovcFax.equals(""))Fax: <b>$!leo.lovcFax</b>#end \r\n                    #if($leo.lovcFax.equals("") && !$leo.leoFax.equals(""))Fax: <b>$!leo.leoFax</b>#end \r\n               </p>\r\n\r\n                <p margin-top="12px">\r\n                    <p margin-top="12px"><b>Return address: </b>Remember to put your return address on the outside of the mailing envelope. </p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Postage:</b> \r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px">Take your FWAB mailing envelope to the local overseas post office to obtain the correct international airmail postage and to have your envelope postmarked from outside the U.S.</p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b><i>Thank you for using ExxonMobil\'s Citizen Action Team overseas voter tools!</i></b>\r\n                </p>\r\n\r\n\r\n            </font>\r\n        </value>\r\n    </page>', '2012-03-09 20:10:22', 2),
	(7, 'RAVA', 11, '<page master="rava_third_page">\r\n        <date-printed>$!date_long</date-printed>\r\n        <first-name>$!ufFirstName</first-name>\r\n        <value>\r\n            <font size="11px" family="TrebuchetMS" line-height="5mm">\r\n                <p margin-top="12px">\r\n                    Thank you for using the FAWCO (FAWCO) voter services to generate your Voter Registration/Ballot Request form.  Please follow the instructions below to complete the application process.\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    Fields left blank on your form are not required for your state.  The FAWCO registration system has prompted you for the information that your state requires.\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Please check your documents:</b>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">Verify that the data you entered is correct on your Voter Registration/Ballot Request form and the accompanying Addendum page.</li>\r\n                        <li margin-top="10px">\r\n                            <span>If corrections are needed, return to the FAWCO website,</span>\r\n                            <a href="http://fawco.overseasvotefoundation.org">http://fawco.overseasvotefoundation.org</a>\r\n                            <span>to either: 1) access your Voter Account and regenerate the form with corrections or; 2) if your browser is still open with the same session running, go back and make changes, then reprint or; 3) run through the registration program again and reprint your form.</span>\r\n                        </li>\r\n                    </ul>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Print, sign and date the forms:</b>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">Sign and date your Voter Registration/Ballot Request form and addendum page.</li>\r\n                        <li margin-top="10px">Make sure to date the forms in U.S. format - Month-Day-Year.</li>\r\n                        <li margin-top="10px">Your election office needs your <i>original signature</i> in order to process and approve it.</li>\r\n                    </ul>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Address your envelope to:</b>\r\n                    <p margin-top="12px" margin-left="20px">$!envelope_address</p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Sending your documents:</b>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">\r\n                            The completed form contains your personal identity information and should be carefully transmitted to your local election office.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Mail:</b>\r\n                            FAWCO recommends regular postal mail as the number one method for confidential voter materials transmission.  Postal mail is the most secure method of transmitting these highly confidential documents.  It is best to mail it from the post office instead of a mail box.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Fax + Mail the original: </b>\r\n                            Some states allow you to fax the form ahead to speed processing; however, it must be followed by a posted form with your original signature by mail in order to be a valid application.\r\n                            <p margin-top="12px">#if(!$leo.lovcFax.equals(""))The fax number for your region is <b>$!leo.lovcFax</b>#end \r\n                            #if($leo.lovcFax.equals("") && !$leo.leoFax.equals(""))The fax number for your region is <b>$!leo.leoFax</b>#end \r\n                           	#if($leo.lovcFax.equals("") && $leo.leoFax.equals(""))You can look up your region\'s fax number at: <a href="https://fawco.overseasvotefoundation.org/overseas/eod.htm">fawco.overseasvotefoundation.org/overseas/eod.htm</a>#end \r\n                           	</p>\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Email:</b>\r\n                            The open Internet is not secure.  Some states and government organizations offer an email option for your signed, scanned forms, but it is not guaranteed as a secure transmission method and must be followed by a posted form with your original signature by mail in order to be a valid application.\r\n                            <p margin-top="12px">#if(!$leo.lovcEmail.equals(""))The email address for your region is  <b><a href="mailto:$!leo.lovcEmail">$!leo.lovcEmail</a></b>#end \r\n                            #if($leo.lovcEmail.equals("") && !$leo.leoEmail.equals(""))The email address for your region is <b><a href="mailto:$!leo.leoEmail">$!leo.leoEmail</a></b>#end \r\n                           	#if($leo.lovcEmail.equals("") && $leo.leoEmail.equals(""))You can look up your region\'s email address at: <a href="https://fawco.overseasvotefoundation.org/overseas/eod.htm">fawco.overseasvotefoundation.org/overseas/eod.htm</a>#end \r\n                        	</p>\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            Consult the FAWCO State-Specific Voter Information Directory online for the various options for sending your Voter Registration/Ballot Request form\r\n                        </li>\r\n                    </ul>\r\n                </p>\r\n\r\n                #if( $ufAdditionalInstruction && $ufAdditionalInstruction != "" )\r\n                <p margin-top="12px">\r\n                    <b>$!ufVotingState\'s Additional Requirements:</b>\r\n                    <p margin-top="12px">\r\n                        $!ufAdditionalInstruction\r\n                    </p>\r\n                </p>\r\n                #end\r\n\r\n                <p margin-top="12px"></p>\r\n                <p margin-top="12px">\r\n                    <b>Further information and resources:</b>\r\n                    <p margin-top="12px">The FAWCO website provides many services that may be useful to you over the course of this election period including:</p>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">\r\n                            <b>My Voter Account&#x2122;</b>\r\n                             - take advantage of this new service which makes it possible to keep an up-to-date voter profile on hand, maintain your mailing list profile, generate a new ballot request form or a write-in ballot with the click of a button\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Federal Write-in Absentee Ballot wizard</b>\r\n                            - the Federal Write-in Absentee Ballot finally made easy! This is a blank ballot for registered voters to use in the event that your ballot is late in arriving to you.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>FAWCO Voter Help Desk&#x2122;</b>\r\n                             - fast and friendly answers to your voting questions\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>FAWCO Election Official Directory&#x2122;</b>\r\n                            - the most comprehensive listing of election office contact information available anywhere\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>	FAWCO State-specific Voter Information Directory&#x2122;</b>\r\n                            - state-by-state information bank providing details on deadlines, voter materials transmission options and state contact information\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Links to nonpartisan candidate information sites</b>\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>FAWCO news</b>\r\n                             - check the latest stories on overseas and military voting\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>FAWCO Mailing List</b>\r\n                             - help us to keep you informed through online communications\r\n                        </li>\r\n                    </ul>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Your next steps:</b>\r\n                    <ol margin-left="10px">\r\n                        <li margin-top="10px"><b>Send</b> in your signed, dated, original form by regular mail.</li>\r\n                        <li margin-top="10px">\r\n                            <b>Confirm</b> that you are on the voter rolls and will receive your $!electionYear  ballots:\r\n                            <p margin-top="12px"> </p>\r\n                            <p margin-top="12px">\r\n                                FAWCO recommends that you <a href="https://fawco.overseasvotefoundation.org/overseas/eod.htm">contact your election official</a> after sending your registration/ballot request form to confirm that you are on the rolls and will receive your ballots through the $!electionYear  election year.\r\n	 							#if ( !$leo.lovc.empty )\r\n								    <p margin-top="12px"><b>Overseas Voting Contact:</b></p>\r\n								    <p margin-top="12px">$!leo.lovc.firstName $!leo.lovc.lastName</p>\r\n								   	#if(!$leo.lovcPhone.equals(""))<p margin-top="12px">phone: $!leo.lovcPhone</p>#end\r\n								   	#if(!$leo.lovcFax.equals(""))<p margin-top="12px">fax: $!leo.lovcFax</p>#end\r\n								   	#if(!$leo.lovcEmail.equals(""))<p margin-top="12px">email: <a href="mailto:$!leo.lovcEmail">$!leo.lovcEmail</a></p>#end\r\n								#end\r\n								\r\n								#if ( !$leo.leo.empty )\r\n								    <p margin-top="12px"><b>Local Election Official:</b></p>\r\n								    <p margin-top="12px">$!leo.leo.firstName $!leo.leo.lastName</p>\r\n								   	#if(!$leo.leoPhone.equals(""))<p margin-top="12px">phone: $!leo.leoPhone</p>#end\r\n								   	#if(!$leo.leoFax.equals(""))<p margin-top="12px">fax: $!leo.leoFax</p>#end\r\n								   	#if(!$leo.leoEmail.equals(""))<p margin-top="12px">email: <a href="mailto:$!leo.leoEmail">$!leo.leoEmail</a></p>#end\r\n								#end\r\n								\r\n								#if ( $leo.leo.empty && $leo.lovc.empty )\r\n								<p margin-top="12px">Look up contact information in the Election Official Directory: <a href="https://fawco.overseasvotefoundation.org/overseas/eod.htm">fawco.overseasvotefoundation.org/overseas/eod.htm</a></p>\r\n								#end\r\n                            </p>\r\n                            <p margin-top="12px"> </p>\r\n                            <p margin-top="12px">\r\n                                Never take for granted that your ballot will simply arrive for the next election without confirming it.  Contact your election official and avoid surprises.\r\n                            </p>\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Check</b> your email account to make sure FAWCO can reach you:\r\n                            <p margin-top="12px"> </p>\r\n                            <p margin-top="12px">FAWCO sends notices to voters very infrequently.  We keep the volume way down, so that you know the emails we do send are for a good reason.</p>\r\n                            <p margin-top="12px"> </p>\r\n                            <p margin-top="12px">If you send us a note and don\'t get a reply, it would be because your email account, or your email provider, is blocking ours.  If you never get any email from FAWCO, it would also be due to this.</p>\r\n                            <p margin-top="12px"> </p>\r\n                            <p margin-top="12px">Please make sure that:</p>\r\n                            <p margin-top="12px"> </p>\r\n                            <ul margin-left="10px">\r\n                                <li margin-top="10px">The FAWCO domain ...@overseasvotefoundation.org is approved by your email filtering/spam program; or<p margin-top="12px"> </p></li>\r\n                                <li margin-top="10px">\r\n                                    Approve these three email addresses as "safe senders:"\r\n                                    <a href="mailto:info@overseasvotefoundation.org">info@overseasvotefoundation.org</a>,\r\n                                    <a href="mailto:support@overseasvotefoundation.org">support@overseasvotefoundation.org</a>\r\n                                    and\r\n                                    <a href="announce@overseasvotefoundation.org">announce@overseasvotefoundation.org</a><p margin-top="12px"> </p>\r\n                                </li>\r\n                                <li margin-top="10px">Look for a thank you note in your mailbox today!</li>\r\n                            </ul>\r\n                            <p margin-top="12px"> </p>\r\n                        </li>\r\n                    </ol>\r\n                </p>\r\n\r\n                <p margin-top="12px"></p>\r\n                <p margin-top="12px">\r\n                    <b>Ballot Back-up Plan</b>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px">\r\n                        Sometimes ballots arrive late.  Or not at all.  We hope that does not occur in your case.\r\n                        If you don\'t receive your requested ballot from your election office by <b>30 days</b> before the election,\r\n                        please visit our site to access the Federal Write-in Absentee Ballot wizard.\r\n                    </p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Thank you</b>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px">\r\n                        FAWCO is grateful to Overseas Vote Foundation for providing this service. OVF is a nonprofit, nonpartisan public \r\n                        charity dedicated to facilitating overseas and military voter participation in federal elections. \r\n                        <b>Please consider making a <a href="https://fawco.overseasvotefoundation.org/donation">donation</a> to help keep OVF going!</b>\r\n                    </p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    We wish you a positive voting experience in the coming election,\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    FAWCO\r\n                </p>\r\n                <p margin-top="12px">\r\n                    <a href="https://fawco.overseasvotefoundation.org">fawco.overseasvotefoundation.org</a>\r\n                </p>\r\n            </font>\r\n        </value>\r\n    </page>', '2011-12-20 14:27:06', 2),
	(8, 'FWAB', 11, '<page master="rava_third_page">\r\n        <date-printed>$!date_long</date-printed>\r\n        <first-name>$!ufFirstName</first-name>\r\n        <value>\r\n            <font size="11px" family="TrebuchetMS" line-height="5mm">\r\n\r\n                <p margin-top="12px">\r\n                    <b>Federal Write-In Absentee Ballot - Instructions for Ballot Completion and Mailing</b>\r\n                </p>\r\n                <p margin-top="12px">\r\n                    You have completed the Federal Write-In Absentee Ballot (FWAB) Voter\'s Declaration/Affirmation form process.\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Print the downloaded documents:</b>\r\n                    <ol margin-left="10px">\r\n                        <li margin-top="10px">Instructions from FAWCO - this page.</li>\r\n                        <li margin-top="10px">The FWAB cover page which is titled: \'Voter\'s Declaration/Affirmation - Federal Write-In Absentee Ballot (FWAB)\'</li>\r\n                        <li margin-top="10px">Addendum page - to accompany the cover page.</li>\r\n                        <li margin-top="10px">Your Write-In Ballot which is titled: \'Official Federal Write-In Absentee Ballot\'</li>\r\n                        <li margin-top="10px">As reference: The official Privacy Act Statement and FWAB completion information from the Federal Voting Assistance Program</li>\r\n                    </ol>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Signatures/Dates:</b>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px">\r\n                        Remember to <b>sign and date</b> the Voter\'s Declaration/Affirmation cover page and the Addendum page.\r\n                    </p>\r\n                </p>\r\n\r\n\r\n                <p margin-top="12px">\r\n                    <b>Vote - write-in your choices:</b>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px">\r\n                        Enter either the name of the candidates or their political party for each office you are voting for on your Official Federal Write-In Absentee Ballot.\r\n                    </p>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px"><b>President </b>---enter name of candidate, or name of party---</p>\r\n                    <p margin-top="12px"><b>Vice President </b>---enter name of candidate, or name of party---</p>\r\n                    <p margin-top="12px"><b>US Senate </b>---enter name of candidate, or name of party---</p>\r\n                    <p margin-top="12px"><b>House of Representatives </b>---enter name of candidate, or name of party---</p>\r\n                    <p margin-top="12px"> </p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>IMPORTANT Note</b> - you will need to provide 2 envelopes:\r\n                    <ol margin-left="10px">\r\n                        <li margin-top="10px"><b>A Ballot Security Envelope</b> to hold your voted ballot - Print <b>only</b> the words <b>"Security Envelope"</b> on the outside of the Ballot Security Envelope containing your Official Federal Write-In Absentee Ballot.  Make sure to seal your voted ballot within it.  Do <b>NOT</b> put your name or any other information on this envelope.</li>\r\n                        <li margin-top="10px">A larger <b>Mailing Envelope</b> for the forms and the Ballot Security Envelope - Your mailing envelope should be large enough to contain the Cover Page and Addendum and your sealed Ballot Security Envelope containing your completed ballot.</li>\r\n                    </ol>\r\n                </p>\r\n\r\n\r\n                #if( $ufAdditionalInstruction && $ufAdditionalInstruction != "" )\r\n                <p margin-top="12px">\r\n                    <b>$!ufVotingState\'s Additional Requirements: </b>\r\n                    <p margin-top="12px">\r\n                        $!ufAdditionalInstruction\r\n                    </p>\r\n                </p>\r\n                #end\r\n\r\n                <p margin-top="12px">\r\n                    <b>Mailing address: </b>Mail your FWAB to your local election office at the following address:\r\n                    <p margin-top="12px" margin-left="20px">$!envelope_address</p>\r\n                </p>\r\n				<p margin-top="12px" margin-left="20px">Your election official can be reached as follows:</p>\r\n				<p margin-left="20px">\r\n					#if(!$leo.lovc.firstName.equals(""))<b>$!leo.lovc.firstName $!leo.lovc.lastName</b>#end \r\n                   	#if($leo.lovc.firstName.equals("") && !$leo.leo.firstName.equals(""))<b>$!leo.leo.firstName $!leo.leo.lastName</b>#end \r\n                </p>\r\n				<p margin-left="20px">\r\n					#if(!$leo.lovcEmail.equals(""))Email: <b><a href="mailto:$!leo.lovcEmail">$!leo.lovcEmail</a></b>#end \r\n                   	#if($leo.lovcEmail.equals("") && !$leo.leoEmail.equals(""))Email: <b><a href="mailto:$!leo.leoEmail">$!leo.leoEmail</a></b>#end \r\n                </p>\r\n                <p margin-left="20px">\r\n                	#if(!$leo.lovcPhone.equals(""))Phone <b>$!leo.lovcPhone</b>#end \r\n                    #if($leo.lovcPhone.equals("") && !$leo.leoPhone.equals(""))Phone <b>$!leo.leoPhone</b>#end \r\n                </p>\r\n                <p margin-left="20px">\r\n                	#if(!$leo.lovcFax.equals(""))Fax: <b>$!leo.lovcFax</b>#end \r\n                    #if($leo.lovcFax.equals("") && !$leo.leoFax.equals(""))Fax: <b>$!leo.leoFax</b>#end \r\n               </p>\r\n\r\n                <p margin-top="12px">\r\n                    <p margin-top="12px"><b>Return address: </b>Remember to put your return address on the outside of the envelope/</p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Postage:</b>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px"><b>Overseas Citizens: </b>Take your FWAB to the local overseas post office to obtain the correct international airmail postage and to have your envelope postmarked from outside the US.</p>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px"><b>Uniformed Services: </b>If you are mailing your FWAB from within the APO/FPO system, a Diplomatic Pouch, or U.S. Mail, please confirm and affix the correct postage.</p>\r\n                </p>\r\n\r\n\r\n                <p margin-top="12px">\r\n                    <b><i>Thank you for using FAWCO\'s voter services!</i></b>\r\n                </p>\r\n\r\n\r\n            </font>\r\n        </value>\r\n    </page>', '2012-03-09 20:09:40', 2),
	(9, 'RAVA', 16, '<page master="rava_third_page">\r\n        <date-printed>$!date_long</date-printed>\r\n        <first-name>$!ufFirstName</first-name>\r\n        <value>\r\n            <font size="11px" family="TrebuchetMS" line-height="5mm">\r\n                <p margin-top="12px">\r\n                    Thank you for using the Kentucky military and overseas citizens voter registration and absentee ballot request online wizard to generate your Voter Registration/Ballot Request form. Please follow the instructions below to complete the application process.\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    The online wizard has prompted you for the information that Kentucky requires.\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Please check your documents:</b>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">Verify that the data you entered is correct on your Voter Registration/Ballot Request form and the accompanying Addendum page.</li>\r\n                        <li margin-top="10px">\r\n                        	To make corrections, <a href="https://kentucky.overseasvotefoundation.org">return to the website</a>, to either: 1) access your Voter Account and regenerate the form with corrections or; 2) if your browser is still open with the same session running, go back and make changes and then reprint or; 3) run through the registration program again and reprint your form.\r\n                        </li>\r\n                    </ul>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Print, sign and date the forms:</b>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">Sign and date your Voter Registration/Ballot Request form and addendum page.</li>\r\n                        <li margin-top="10px">Make sure to date the forms in U.S. format - Month-Day-Year.</li>\r\n                    </ul>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Address your envelope to:</b>\r\n                    <p margin-top="12px" margin-left="20px">$!envelope_address</p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Sending your documents:</b>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">\r\n                            The completed form contains your personal identity information and should be carefully transmitted to your county clerk office. \r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Mail:</b>\r\n                            We recommend regular postal mail as the number one method for confidential voter materials transmission.  Postal mail is the most secure method of transmitting these highly confidential documents.  It is best to mail it from the post office instead of a mail box.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Email:</b>\r\n                            You may email the material to the county clerk, <a href="mailto:#if(!$!leo.lovcEmail.equals(""))$!leo.lovcEmail#else$!leo.leoEmail#end">#if(!$!leo.lovcEmail.equals(""))$!leo.lovcEmail#else$!leo.leoEmail#end</a>.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Fax:</b>\r\n                            You may fax the materials to the county clerk, <b>#if(!$!leo.lovcPhone.equals(""))$!leo.lovcPhone#else$!leo.leoPhone#end</b>, or you may use the Federal Voting Assistance Program\'s toll free fax transmittal number if you wish to fax your application: 800/368-8683.\r\n                        </li>\r\n                    </ul>\r\n                </p>\r\n\r\n                #if( $ufAdditionalInstruction && $ufAdditionalInstruction != "" )\r\n                <p margin-top="12px">\r\n                    <b>$!ufVotingState\'s Additional Requirements:</b>\r\n                    <p margin-top="12px">\r\n                        $!ufAdditionalInstruction\r\n                    </p>\r\n                </p>\r\n                #end\r\n\r\n                <p margin-top="12px"></p>\r\n                <p margin-top="12px">\r\n                    <b>Further information and resources:</b>\r\n                    <p margin-top="12px">Our website provides many services that may be useful to you over the course of this election period including:</p>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">\r\n                            <b>My Voter Account&#x2122;</b>\r\n                             - take advantage of this new service which makes it possible to keep an up-to-date voter profile on hand, maintain your mailing list profile, generate a new ballot request form or a write-in ballot with the click of a button.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Federal Write-in Absentee Ballot wizard</b>\r\n                            - the Federal Write-in Absentee Ballot finally made easy! This is a blank ballot for registered voters to use in the event that your ballot is late in arriving to you.  This ballot is valid for use in any primary, regular, or special election for federal office.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Voter Help Desk&#x2122;</b>\r\n                             - fast and friendly answers to your voting questions.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Election Official Directory&#x2122;</b>\r\n                            - the most comprehensive listing of election office contact information available anywhere.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>OVF State-specific Voter Information Directory&#x2122;</b>\r\n                            - information bank providing details on deadlines, voter materials transmission options and state contact information.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>OVF News&#x2122;</b>\r\n                            - check the latest stories on overseas and military voting.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Mailing List&#x2122;</b>\r\n                            - help us to keep you informed through online communications.\r\n                        </li>\r\n                    </ul>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Your next steps:</b>\r\n                    <ol margin-left="10px">\r\n                        <li margin-top="10px"><b>Send</b> in your signed, dated, original form by regular mail, email, or by fax.</li>\r\n                        <li margin-top="10px">\r\n                            <b>Confirm</b> that you are on the voter rolls and will receive your $!electionYear  ballots:\r\n                            <p margin-top="12px"> </p>\r\n                            <p margin-top="12px">\r\n                                We recommend that you use our "Voter Information Center", <a href="http://www.elect.ky.gov/vic">www.elect.ky.gov/vic</a>, or contact your county clerk after sending your registration/ballot request form to confirm that you are on the rolls and will receive your ballots through the $!electionYear  election year.\r\n	 							#if ( !$!leo.lovc.empty )\r\n								    <p margin-top="12px"><b>Overseas Voting Contact:</b></p>\r\n								    <p margin-top="12px">$!leo.lovc.firstName $!leo.lovc.lastName</p>\r\n								   	#if(!$!leo.lovcPhone.equals(""))<p margin-top="12px">phone: $!leo.lovcPhone</p>#end\r\n								   	#if(!$!leo.lovcFax.equals(""))<p margin-top="12px">fax: $!leo.lovcFax</p>#end\r\n								   	#if(!$!leo.lovcEmail.equals(""))<p margin-top="12px">email: <a href="mailto:$!leo.lovcEmail">$!leo.lovcEmail</a></p>#end\r\n								#end\r\n								\r\n								#if ( !$!leo.leo.empty )\r\n								    <p margin-top="12px"><b>County Clerk:</b></p>\r\n								    <p margin-top="12px">$!leo.leo.firstName $!leo.leo.lastName</p>\r\n								   	#if(!$!leo.leoPhone.equals(""))<p margin-top="12px">phone: $!leo.leoPhone</p>#end\r\n								   	#if(!$!leo.leoFax.equals(""))<p margin-top="12px">fax: $!leo.leoFax</p>#end\r\n								   	#if(!$!leo.leoEmail.equals(""))<p margin-top="12px">email: <a href="mailto:$!leo.leoEmail">$!leo.leoEmail</a></p>#end\r\n								#end\r\n								\r\n								#if ( $!leo.leo.empty && $!leo.lovc.empty )\r\n								<p margin-top="12px">Look up contact information in the Election Official Directory: <a href="https://kentucky.overseasvotefoundation.org/overseas/eod.htm">kentucky.overseasvotefoundation.org/overseas/eod.htm</a></p>\r\n								#end\r\n                            </p>\r\n                            <p margin-top="12px"> </p>\r\n                            <p margin-top="12px">\r\n                                Never take for granted that your ballot will simply arrive for the next election without confirming it.  Contact your county clerk and avoid surprises.\r\n                            </p>\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Confirm</b> the status of your absentee ballot:\r\n                            <p margin-top="12px"> </p>\r\n                            <p margin-top="12px">We recommend that you use our Absente Ballot Status Inquiry, <a href="https://cdcbps.ky.gov/ABD2Web/">www.elect.ky.gov/registrationinfo/military_overseas.htm</a>, or contact your county clerk to learn the date the county clerk sent the absentee ballot to you, and to learn the date the county clerk received your absentee ballot.</p>\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Check</b> your email account to make sure that Overseas Vote Foundation can reach you:\r\n                            <p margin-top="12px"> </p>\r\n                            <p margin-top="12px">OVF sends notices to voters very infrequently.  We keep the volume way down, so that you know the emails we do send are for a good reason.</p>\r\n                            <p margin-top="12px"> </p>\r\n                            <p margin-top="12px">If you send us a note and don\'t get a reply, it would be because your email account, or your email provider, is blocking ours.  If you never get any email from OVF, it would also be due to this.</p>\r\n                            <p margin-top="12px"> </p>\r\n                            <p margin-top="12px">Please make sure that:</p>\r\n                            <p margin-top="12px"> </p>\r\n                            <ul margin-left="10px">\r\n                                <li margin-top="10px">The OVF domains ...@overseasvotefoundation.org and @mail.vresp.com are approved by your email filtering/spam program and<p margin-top="12px"> </p></li>\r\n                                <li margin-top="10px">\r\n                                    Approve these four email addresses as "safe senders:"\r\n                                    <a href="mailto:info@overseasvotefoundation.org">info@overseasvotefoundation.org</a>,\r\n                                    <a href="mailto:support@overseasvotefoundation.org">support@overseasvotefoundation.org</a>\r\n                                    <a href="mailto:announce@overseasvotefoundation.org">announce@overseasvotefoundation.org</a>\r\n                                    and\r\n                                    <a href="Overseas_Vote_Foundation@mail.vresp.com">Overseas_Vote_Foundation@mail.vresp.com</a><p margin-top="12px"> </p>\r\n                                </li>\r\n                                <li margin-top="10px">Look for a thank you note in your mailbox today!</li>\r\n                            </ul>\r\n                            <p margin-top="12px"> </p>\r\n                        </li>\r\n                    </ol>\r\n                </p>\r\n\r\n                <p margin-top="12px"></p>\r\n                <p margin-top="12px">\r\n                    <b>Ballot Back-up Plan</b>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px">\r\n                        Sometimes ballots arrive late.  Or not at all.  We hope that does not occur in your case.  \r\n                        If you don\'t receive your requested ballot from your election office by <b>30 days</b> days before the election, \r\n                        please visit our site to access the Federal Write-in Absentee Ballot wizard.  \r\n                        Kentucky allows the Federal Write-in Absentee Ballot in any primary, regular, or special election for federal office.\r\n                     </p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Thank you</b>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px">\r\n                        The Kentucky Military and Overseas Citizen\'s voter registration and absentee ballot request online wizard has been provided in partnership with \r\n                        Overseas Vote Foundation. Overseas Vote Foundation is a nonprofit, nonpartisan public charity dedicated \r\n                        to facilitating overseas citizen and uniformed services voter participation in Federal elections.</p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    We wish you a positive voting experience in the coming election,\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    Sincerely,\r\n                </p>\r\n                <p margin-top="12px">Alison Lundergan Grimes, Secretary of State</p>\r\n                <p margin-top="12px">Chairman</p>\r\n				<p margin-top="12px">State Board of Elections</p>\r\n				<p margin-top="12px"><a href="http://www.elect.ky.gov">www.elect.ky.gov</a></p>\r\n				\r\n                <p margin-top="12px">Overseas Vote Foundation</p>\r\n                <p margin-top="12px"><a href="https://www.overseasvotefoundation.org">www.overseasvotefoundation.org</a></p>\r\n            </font>\r\n        </value>\r\n    </page>', '2012-10-01 15:20:23', 2),
	(10, 'FWAB', 16, '<page master="rava_third_page">\r\n        <date-printed>$!date_long</date-printed>\r\n        <first-name>$!ufFirstName</first-name>\r\n        <value>\r\n            <font size="11px" family="TrebuchetMS" line-height="5mm">\r\n\r\n                <p margin-top="12px">\r\n                    <b>Federal Write-In Absentee Ballot - Instructions for Ballot Completion and Mailing</b>\r\n                </p>\r\n                <p margin-top="12px">\r\n                    You have completed the Federal Write-In Absentee Ballot (FWAB) Voter\'s Declaration/Affirmation form process.\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Print the downloaded documents:</b>\r\n                    <ol margin-left="10px">\r\n                        <li margin-top="10px">Instructions from Kentucky Secretary of State - this page</li>\r\n                        <li margin-top="10px">The FWAB cover page which is titled: \'Voter\'s Declaration/Affirmation - Federal Write-In Absentee Ballot (FWAB)\'</li>\r\n                        <li margin-top="10px">Addendum page - to accompany the cover page.</li>\r\n                        <li margin-top="10px">Your Write-In Ballot which is titled: \'Official Federal Write-In Absentee Ballot\'</li>\r\n                        <li margin-top="10px">As reference: The official Privacy Act Statement and FWAB completion information from the Federal Voting Assistance Program</li>\r\n                    </ol>\r\n                </p>\r\n\r\n\r\n                <p margin-top="12px">\r\n                    <p margin-top="12px">\r\n                   		Consult the Kentucky Secretary of State Military and Overseas Voter Services if you have questions regarding your ballot.  \r\n                    </p>\r\n                </p>\r\n\r\n\r\n                <p margin-top="12px">\r\n                    <b>Signatures/Dates:</b>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px">\r\n                        Remember to <b>sign and date</b> the Voter\'s Declaration/Affirmation cover page and the Addendum page.\r\n                    </p>\r\n                </p>\r\n\r\n\r\n                <p margin-top="12px">\r\n                    <b>Vote - write-in your choices:</b>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px">\r\n                        Enter either the name of the candidates or their political party for each office you are voting for on your Official Federal Write-In Absentee Ballot.\r\n                    </p>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px"><b>President </b>---enter name of candidate, or name of party---</p>\r\n                    <p margin-top="12px"><b>Vice President </b>---enter name of candidate, or name of party---</p>\r\n                    <p margin-top="12px"><b>US Senate </b>---enter name of candidate, or name of party---</p>\r\n                    <p margin-top="12px"><b>House of Representatives </b>---enter name of candidate, or name of party---</p>\r\n                    <p margin-top="12px"> </p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>IMPORTANT Note</b> - you will need to provide 2 envelopes:\r\n                    <ol margin-left="10px">\r\n                        <li margin-top="10px"><b>A Ballot Security Envelope</b> to hold your voted ballot - Print <b>only</b> the words <b>"Security Envelope"</b> on the outside of the Ballot Security Envelope containing your Official Federal Write-In Absentee Ballot.  Make sure to seal your voted ballot within it.  Do <b>NOT</b> put your name or any other information on this envelope.</li>\r\n                        <li margin-top="10px">A larger <b>Mailing Envelope</b> for the forms and the Ballot Security Envelope - Your mailing envelope should be large enough to contain the Cover Page and Addendum and your sealed Ballot Security Envelope containing your completed ballot.</li>\r\n                    </ol>\r\n                </p>\r\n\r\n\r\n                #if( $ufAdditionalInstruction && $ufAdditionalInstruction != "" )\r\n                <p margin-top="12px">\r\n                    <b>$!ufVotingState\'s Additional Requirements: </b>\r\n                    <p margin-top="12px">\r\n                        $!ufAdditionalInstruction\r\n                    </p>\r\n                </p>\r\n                #end\r\n\r\n                <p margin-top="12px">\r\n                    <b>Mailing address: </b>mail your FWAB to your Kentucky local election office at the following address:\r\n                    <p margin-top="12px" margin-left="20px">$!envelope_address</p>\r\n                </p>\r\n				<p margin-top="12px" margin-left="20px">Your election official can be reached as follows:</p>\r\n				<p margin-left="20px">\r\n					#if(!$leo.lovc.firstName.equals(""))<b>$!leo.lovc.firstName $!leo.lovc.lastName</b>#end \r\n                   	#if($leo.lovc.firstName.equals("") && !$leo.leo.firstName.equals(""))<b>$!leo.leo.firstName $!leo.leo.lastName</b>#end \r\n                </p>\r\n				<p margin-left="20px">\r\n					#if(!$leo.lovcEmail.equals(""))Email: <b><a href="mailto:$!leo.lovcEmail">$!leo.lovcEmail</a></b>#end \r\n                   	#if($leo.lovcEmail.equals("") && !$leo.leoEmail.equals(""))Email: <b><a href="mailto:$!leo.leoEmail">$!leo.leoEmail</a></b>#end \r\n                </p>\r\n                <p margin-left="20px">\r\n                	#if(!$leo.lovcPhone.equals(""))Phone <b>$!leo.lovcPhone</b>#end \r\n                    #if($leo.lovcPhone.equals("") && !$leo.leoPhone.equals(""))Phone <b>$!leo.leoPhone</b>#end \r\n                </p>\r\n                <p margin-left="20px">\r\n                	#if(!$leo.lovcFax.equals(""))Fax: <b>$!leo.lovcFax</b>#end \r\n                    #if($leo.lovcFax.equals("") && !$leo.leoFax.equals(""))Fax: <b>$!leo.leoFax</b>#end \r\n               </p>\r\n\r\n                <p margin-top="12px">\r\n                    <p margin-top="12px"><b>Return address: </b>Remember to put your return address on the outside of the envelope/</p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Postage:</b>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px"><b>Overseas Citizens: </b>Take your FWAB to the local overseas post office to obtain the correct international airmail postage and to have your envelope postmarked from outside the US.</p>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px"><b>Uniformed Services: </b>If you are mailing your FWAB from within the APO/FPO system, a Diplomatic Pouch, or U.S. Mail, please confirm and affix the correct postage.</p>\r\n                </p>\r\n\r\n\r\n                <p margin-top="12px">\r\n                    <b><i>Thank you for using the Kentucky military and overseas voter services site.</i></b>\r\n                </p>\r\n\r\n\r\n            </font>\r\n        </value>\r\n    </page>', '2011-12-20 14:28:44', 2),
	(11, 'RAVA', 4, '<page master="rava_third_page">\r\n        <date-printed>$!date_long</date-printed>\r\n        <first-name>$!ufFirstName</first-name>\r\n        <value>\r\n            <font size="11px" family="TrebuchetMS" line-height="5mm">\r\n                <p margin-top="12px">\r\n 					Thank you for using the Military and Overseas Voter Service to generate your Voter Registration \r\n 					and Absentee Ballot Request. This service was made possible by the Office of the Minnesota Secretary \r\n 					of State in partnership with the Overseas Vote Foundation (OVF), a nonpartisan, nonprofit \r\n 					organization. For more information about OVF, visit their web site at: \r\n 					<a href="https://www.overseasvotefoundation.org">www.overseasvotefoundation.org</a>.\r\n                 </p>\r\n\r\n                <p margin-top="12px">\r\n 					Please follow the instructions below to complete the application process.\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n			 		The blank sections on your form are not required. This is a federal application that \r\n			 		contains sections that are not required to be completed by Minnesota voters. The web tool \r\n			 		has prompted you only for the information required for Minnesota voters.               \r\n 				</p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Please check your documents:</b>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">Verify that the information on the attached application form and \r\n                        	addendum page is accurate.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <span>If you need to make a correction, do one of the following:</span>\r\n                            <ol margin-left="10px">\r\n                            	<li margin-top="10px">If your browser is still open with the same session running, go back \r\n                            	and make changes, then reprint or;</li>\r\n                            	<li margin-top="10px">Return to <a href="https://minnesota.overseasvotefoundation.org/overseas/home.htm">https://minnesota.overseasvotefoundation.org/overseas/home.htm</a> \r\n                            	to run through the registration program again and reprint your form.</li>\r\n                            </ol>\r\n                        </li>\r\n                    </ul>\r\n                </p>\r\n\r\n                <p margin-top="12px"><b>Important Reminder:</b></p>\r\n\r\n               	<p margin-top="12px">\r\n               		If you have a US Passport Number, Minnesota Driver\'s License number, Minnesota ID card number \r\n               		or the last four digits of your Social Security number, you must provide one of them. Please \r\n               		verify that this information is accurate on your form in the Identification section, field 2f \r\n               		or 2g.  Please remember which number you provide, because you will need to provide the same \r\n               		number when you return your ballot.</p>\r\n               	<p margin-top="12px">\r\n					If you do not have any of the documents or ID numbers available to you, you may still submit \r\n					your application as long as you attest to the truthfulness of the contents of this application under penalty of perjury.\r\n				</p>\r\n \r\n                <p margin-top="12px">\r\n                    <b>Print and sign the forms:</b>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">Sign your Voter Registration / Absentee Ballot Request form and addendum page.</li>\r\n                        <li margin-top="10px">Your election office needs your signature on the form in order to approve \r\n                        and process it. You do not need to submit the addendum page unless it includes additional information \r\n                        for your local election official.</li>\r\n                    </ul>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Sending your documents:</b>\r\n                    The completed form contains your personal identity information and should be transmitted carefully to your County \r\n                    Auditor\'s office. Choose from one of the following:\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">\r\n                            <b>Mail:</b>\r\n                            If you prefer to mail your application, it is best to mail it from the post office instead of a \r\n                            mailbox.\r\n                            <p margin-top="12px">\r\n                    			<b>Address your envelope to:</b>\r\n                    			<p margin-top="12px" margin-left="20px">$!envelope_address</p>\r\n               			 	</p>\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Fax: </b>\r\n                            Minnesota law allows you to fax your signed application form to your County Auditor\'s office.\r\n                            #if(!$leo.lovcFax.equals(""))Your County Auditor\'s Office fax number is <b>$!leo.lovcFax</b>#end \r\n                            #if($leo.lovcFax.equals("") && !$leo.leoFax.equals(""))Your County Auditor\'s Office fax number is <b>$!leo.leoFax</b>#end \r\n                           	#if($leo.lovcFax.equals("") && $leo.leoFax.equals(""))You can look up your County Auditor\'s Office fax number at: <a href="https://minnesota.overseasvotefoundation.org/overseas/eod.htm">minnesota.overseasvotefoundation.org/overseas/eod.htm</a>#end \r\n                            .\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Email:</b>\r\n                            Minnesota law allows you to email a scanned copy of your signed application form to your County Auditor\'s office. \r\n                            #if(!$leo.lovcEmail.equals(""))Email to <b><a href="mailto:$!leo.lovcEmail">$!leo.lovcEmail</a></b>#end \r\n                            #if($leo.lovcEmail.equals("") && !$leo.leoEmail.equals(""))Email to <b><a href="mailto:$!leo.leoEmail">$!leo.leoEmail</a></b>#end \r\n                           	#if($leo.lovcEmail.equals("") && $leo.leoEmail.equals(""))You can look up your County Auditor\'s Office email address at: <a href="https://minnesota.overseasvotefoundation.org/overseas/eod.htm">minnesota.overseasvotefoundation.org/overseas/eod.htm</a>#end \r\n                        </li>\r\n                    </ul>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Your next steps:</b>\r\n                    <ol margin-left="10px">\r\n                        <li margin-top="10px"><b>Send</b> in your signed, dated form.</li>\r\n                        <li margin-top="10px">Wait for your ballots to arrive. Ballots will be sent 46 days before the \r\n                        election to voters who have submitted absentee ballot applications before this time.  Ballots \r\n                        will be sent immediately to voters who submit requests within 46 days of the election.\r\n                        </li>\r\n                    </ol>\r\n                </p>\r\n        \r\n \r\n                <p margin-top="12px"></p>\r\n                <p margin-top="12px">\r\n                    <b>Ballot Back-up Plan</b>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px">\r\n                        If you do not receive \r\n                        your requested ballot from your election office in time to return the voted ballot before \r\n                        the election, please return to the web site <a href="https://minnesota.overseasvotefoundation.org/overseas/home.htm">https://minnesota.overseasvotefoundation.org/overseas/home.htm</a> \r\n                        to access the Federal Write-in Absentee Ballot.\r\n                    </p>\r\n                </p>\r\n\r\n                <p margin-top="12px">We wish you a positive voting experience in the coming election.</p>\r\n\r\n                <p margin-top="12px">\r\n                    <p margin-top="12px">Office of the Minnesota Secretary of State</p>\r\n					<p margin-top="12px"><a href="http://www.sos.state.mn.us">www.sos.state.mn.us</a></p>\r\n				</p>\r\n\r\n            </font>\r\n        </value>\r\n    </page>', '2011-12-20 14:26:39', 2),
	(12, 'FWAB', 4, '<page master="rava_third_page">\r\n        <date-printed>$!date_long</date-printed>\r\n        <first-name>$!ufFirstName</first-name>\r\n        <value>\r\n            <font size="11px" family="TrebuchetMS" line-height="5mm">\r\n\r\n                <p margin-top="12px">\r\n                    <b>Federal Write-In Absentee Ballot - Instructions for Ballot Completion and Mailing</b>\r\n                </p>\r\n                <p margin-top="12px">\r\n                    You have completed the Federal Write-In Absentee Ballot (FWAB) Voter\'s Declaration/Affirmation form process.\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Important Reminders:</b>\r\n                    <ol margin-left="10px">\r\n                        <li margin-top="10px"><p padding="0" margin="0">In order to have your Federal Write-In Absentee Ballot accepted and counted, you must have submitted a voter registration/absentee ballot request form for this election.  If you have not already done so, please go to <a href="https://minnesota.overseasvotefoundation.org">https://minnesota.overseasvotefoundation.org</a>  and click on Register to Vote/Request your Ballot.</p>\r\n                        	<p margin-top="10px">If you have already submitted a voter registration/absentee ballot request form for this election, but are submitting a Federal Write-In Absentee ballot because you believe that you will not receive the official ballot in time to return it before the election, you do not need to submit yet another a voter registration / absentee ballot request form.</p>\r\n                        </li>\r\n                        <li margin-top="10px">The blank sections on your form are not required. This is a federal application that contains sections that are not required to be completed by Minnesota voters. The web tool has prompted you only for the information required for Minnesota voters.</li>\r\n                        <li margin-top="10px">\r\n                        	<p padding="0" margin="0">If you have your US Passport number, Minnesota Driver\'s License number, Minnesota ID card number or the last four digits of your Social Security Number, you must provide one of them.  Please verify that this information is accurate on your form in the Identification section, field 2f or 2g.  Please provide the same number as you provided on your voter registration / absentee ballot request form.</p>\r\n	                        <p margin-top="10px">If you do not have any of the documents or ID numbers available to you, you may still submit your  Federal Write-In Absentee Ballot as long as you attest to the truthfulness of the contents of this document under penalty of perjury.</p>\r\n 						</li>\r\n                    </ol>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Print the downloaded documents:</b>\r\n                    <ol margin-left="10px">\r\n                        <li margin-top="10px">Instructions - this page</li>\r\n                        <li margin-top="10px">The Voter\'s Declaration/Affirmation - Federal Write-In Absentee Ballot (FWAB)</li>\r\n                        <li margin-top="10px">Your Write-In Ballot which is titled: \'Official Federal Write-In Absentee Ballot\'</li>\r\n                        <li margin-top="10px">As reference: The official Privacy Act Statement and FWAB completion information from the Federal Voting Assistance Program</li>\r\n                    </ol>\r\n                </p>\r\n\r\n\r\n                <p margin-top="12px">\r\n                    <b>Signature:</b>\r\n                    <p margin-top="12px">\r\n                        Remember to <b>sign</b> the Voter\'s Declaration/Affirmation cover page.\r\n                    </p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Vote - Complete your Ballot</b>\r\n                    <p margin-top="12px">All voters can vote in federal races. Military voters and voters who are out of the U.S. temporarily may also choose to select candidates in state and local races as well as cast votes for or against proposed constitutional amendments. To find links to additional information about the candidates and questions on your ballot, go to <a href="http://myballotmn.sos.state.mn.us/Default.aspx">http://myballotmn.sos.state.mn.us/Default.aspx.</a></p>\r\n                \r\n                    #if ($ufVoterType == "CITIZEN_OVERSEAS_INDEFINITELY")\r\n                        <p margin-top="12px"><b>Note: Voters who are "indefinitely" living abroad may only vote in federal races. </b></p>\r\n                    #end                    \r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>IMPORTANT Note</b> - you will need to provide 2 envelopes:\r\n                    <ol margin-left="10px">\r\n                        <li margin-top="10px"><b>A Ballot Envelope</b> to hold your voted ballot - Put <b>only</b> your Official Federal Write-In Absentee Ballot in this envelope.  Do <b>NOT</b> put your name or any other information on this envelope.</li>\r\n                        <li margin-top="10px">A larger <b>Mailing Envelope</b>  which is  large enough to contain the Voter\'s Declaration/Affirmation, the Addendum (if you are sending it), and your sealed Ballot Envelope containing your completed ballot.</li>\r\n                    </ol>\r\n                </p>\r\n\r\n                <p margin-top="12px">               		\r\n                    <b>Mail your FWAB to:</b>\r\n                    <p margin-top="12px" margin-left="20px">$!envelope_address</p>\r\n                </p>\r\n				<p margin-top="12px" margin-left="20px">\r\n					<b>Return address:</b> Remember to put your return address on the outside of the envelope\r\n				</p>\r\n\r\n\r\n                <p margin-top="12px">\r\n                    <b>Postage:</b>\r\n                    <p margin-top="12px"><b>Overseas Citizens: </b>Take your Federal Write-In Absentee Ballot to the local overseas post office to obtain the correct international airmail postage and have your envelope postmarked from outside the US. Alternatively, you can send it using a package delivery service.</p>\r\n                    <p margin-top="12px"><b>Uniformed Services: </b>If you are mailing your Federal Write-In Absentee Ballot from within the APO/FPO system, a Diplomatic Pouch, or U.S. Mail, please confirm and affix the correct postage. Alternatively, you can send it using a package delivery service.</p>\r\n                </p>\r\n								\r\n                <p margin-top="12px">We wish you a positive voting experience in the coming election.</p>\r\n\r\n                    <p margin-top="12px">Office of the Minnesota Secretary of State</p>\r\n                    <p margin-top="12px"><a href="http://www.sos.state.mn.us">www.sos.state.mn.us</a></p>\r\n				\r\n				\r\n             \r\n</font>\r\n        </value>\r\n    </page>', '2012-11-05 14:55:14', 2),
	(13, 'RAVA', 26, '<page master="rava_third_page">\r\n        <date-printed>$!date_long</date-printed>\r\n        <first-name>$!ufFirstName</first-name>\r\n        <value>\r\n            <font size="11px" family="TrebuchetMS" line-height="5mm">\r\n                <p margin-top="12px">\r\n                    Thank you for using the New York Overseas and Military Voter Services site to generate your Voter Registration/Ballot Request form. Please follow the instructions below to complete the application process.\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    Please follow the instructions below to complete the application process.\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    Fields left blank on your form are not required. Our registration system has prompted you for the information that New York (NY) state requires only.\r\n                 </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Please print and check all your documents:</b>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">Verify that the data you entered is correct on your Voter Registration/Absentee Ballot Request form and the accompanying Addendum page.</li>\r\n                        <li margin-top="10px">\r\n                            If corrections are needed, return to the NY website, <a href="https://newyork.overseasvotefoundation.org">https://newyork.overseasvotefoundation.org</a> to either: 1) access your Voter Account and regenerate the form with corrections or; 2) if your browser is still open with the same session running, go back and make changes, then reprint or; 3) run through the registration program again and reprint your form.\r\n                        </li>\r\n                    </ul>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Print, sign and date the forms:</b>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">Sign and date your Voter Registration/Absentee Ballot Request form and Addendum page.</li>\r\n                        <li margin-top="10px">Make sure to date the forms in U.S. format - Month/Day/Year.</li>\r\n                        <li margin-top="10px">Your election office needs your original signature in order to process and approve your application.</li>\r\n                    </ul>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Address your mailing envelope to:</b>\r\n                    <p margin-top="12px" margin-left="20px">$!envelope_address</p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Sending your documents:</b>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">\r\n                            The completed form contains your personal identity information and should be carefully transmitted to your local election office.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <p margin-top="12px">#if(!$leo.lovcEmail.equals(""))The email address for your region is  <b><a href="mailto:$!leo.lovcEmail">$!leo.lovcEmail</a></b>#end\r\n                            #if($leo.lovcEmail.equals("") && !$leo.leoEmail.equals(""))The email address for your region is <b><a href="mailto:$!leo.leoEmail">$!leo.leoEmail</a></b>#end\r\n                           	#if($leo.lovcEmail.equals("") && $leo.leoEmail.equals(""))You can look up your region\'s email address at: <a href="https://newyork.overseasvotefoundation.org/overseas/eod.htm">newyork.overseasvotefoundation.org/overseas/eod.htm</a>#end\r\n                        	</p>\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            Consult the <a href="https://newyork.overseasvotefoundation.org/overseas/svid.htm">NY State Voter Information Directory</a> online for the various options for sending your Voter Registration/Ballot Request form (see sidebar of our website).\r\n                         </li>\r\n                    </ul>\r\n                </p>\r\n\r\n                #if( $ufAdditionalInstruction && $ufAdditionalInstruction != "" )\r\n                <p margin-top="12px">\r\n                    <b>$!ufVotingState\'s additional requirements:</b>\r\n                    <p margin-top="12px">\r\n                        $!ufAdditionalInstruction\r\n                    </p>\r\n                </p>\r\n                #end\r\n\r\n                <p margin-top="12px"></p>\r\n                <p margin-top="12px">\r\n                    <b>Further information and resources:</b>\r\n                    <p margin-top="12px">\r\n                        The <a href="https://newyork.overseasvotefoundation.org/overseas/home.htm">New York Overseas and Military Voter Services site</a> provides many services that may be useful to you over the course of this election period including:\r\n                    </p>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">\r\n                            <b>My Voter Account&#x2122;</b>\r\n                             - take advantage of this service, which makes it possible to keep an up-to-date voter profile on hand, maintain your mailing list profile, generate a new ballot request form or a write-in ballot with the click of a button.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Federal Write-in Absentee Ballot wizard</b>\r\n                            - the Federal Write-in Absentee Ballot finally made easy! This is a blank ballot for registered voters to use in the event that your ballot is late in arriving to you.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Voter Help Desk&#x2122;</b>\r\n                             - fast and friendly answers to your voting questions.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Election Official Directory&#x2122;</b>\r\n                            - a comprehensive listing of  NY election office contact information.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>State-specific Voter Information Directory&#x2122;</b>\r\n                            - details on deadlines, voter materials transmission options and state contact information.\r\n                         </li>\r\n                    </ul>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Your next steps:</b>\r\n                    <ol margin-left="10px">\r\n                        <li margin-top="10px"><b>Send</b> in your signed, dated, original form by regular mail.</li>\r\n                        <li margin-top="10px">\r\n                            <b>Confirm</b> that you are on the voter rolls and will receive your $!electionYear ballots:\r\n                            <p margin-top="12px"> </p>\r\n                            <p margin-top="12px">\r\n                                We recommend that you contact your election official after sending your registration/ballot request form to confirm that you are on the rolls and will receive your ballots this election year.\r\n                                #if ( !$leo.lovc.empty )\r\n								    <p margin-top="12px"><b>Your overseas voting contact:</b></p>\r\n								    <p margin-top="12px">$!leo.lovc.firstName $!leo.lovc.lastName</p>\r\n								   	#if(!$leo.lovcPhone.equals(""))<p margin-top="12px">phone: $!leo.lovcPhone</p>#end\r\n								   	#if(!$leo.lovcFax.equals(""))<p margin-top="12px">fax: $!leo.lovcFax</p>#end\r\n								   	#if(!$leo.lovcEmail.equals(""))<p margin-top="12px">email: <a href="mailto:$!leo.lovcEmail">$!leo.lovcEmail</a></p>#end\r\n								#end\r\n								\r\n								#if ( !$leo.leo.empty )\r\n								    <p margin-top="12px"><b>Your local election official:</b></p>\r\n								    <p margin-top="12px">$!leo.leo.firstName $!leo.leo.lastName</p>\r\n								   	#if(!$leo.leoPhone.equals(""))<p margin-top="12px">phone: $!leo.leoPhone</p>#end\r\n								   	#if(!$leo.leoFax.equals(""))<p margin-top="12px">fax: $!leo.leoFax</p>#end\r\n								   	#if(!$leo.leoEmail.equals(""))<p margin-top="12px">email: <a href="mailto:$!leo.leoEmail">$!leo.leoEmail</a></p>#end\r\n								#end\r\n								\r\n								#if ( $leo.leo.empty && $leo.lovc.empty )\r\n								<p margin-top="12px">Look up contact information in the Election Official Directory available through <a href="https://newyork.overseasvotefoundation.org/overseas/eod.htm">newyork.overseasvotefoundation.org</a>.</p>\r\n								#end\r\n                            </p>\r\n                            <p margin-top="12px"> </p>\r\n                            <p margin-top="12px">\r\n                                Never take for granted that your ballot will simply arrive for the next election without confirming it. Contact your election official and avoid surprises.\r\n                            </p>\r\n                        </li>\r\n                     </ol>\r\n                </p>\r\n\r\n                <p margin-top="12px"></p>\r\n                <p margin-top="12px">\r\n                    <b>Ballot back-up plan:</b>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px">\r\n                        Sometimes ballots arrive late. Or not at all. We hope that does not occur in your case. If you don\'t receive your requested ballot from your election office by <b>30 days</b> before the election, please <a href="https://newyork.overseasvotefoundation.org">visit our site</a> to access the Federal Write-in Absentee Ballot wizard.\r\n                    </p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Thank you:</b>\r\n                    <p margin-top="12px">\r\n                    	We wish you a positive voting experience in the coming election,\r\n                    </p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <p margin-top="12px">\r\n                    	New York State Board of Elections\r\n                    </p>\r\n                </p>\r\n            </font>\r\n        </value>\r\n    </page>', '2012-07-31 01:00:52', 2),
	(14, 'FWAB', 26, '<page master="rava_third_page">\r\n        <date-printed>$!date_long</date-printed>\r\n        <first-name>$!ufFirstName</first-name>\r\n        <value>\r\n            <font size="11px" family="TrebuchetMS" line-height="5mm">\r\n\r\n\r\n		   <p margin-top="16px">\r\n				IMPORTANT Instructions and Information\r\n			</p>\r\n			<p margin-top="14px">\r\n				<b>Federal Write-In Absentee Ballot (FWAB) - Final Steps for Submission to your U.S. Election Office</b>\r\n			</p>\r\n			<p margin-top="12px">\r\n				You have used the OVF Vote-Print-Mail Ballot system to generate a Federal Write-In Absentee Ballot (FWAB).  Please follow these instructions to complete the process and submit the ballot to your New York (NY) Election Office.\r\n			</p>\r\n			<p margin-top="12px">\r\n				<b>The file you downloaded should contain the following documents:</b>\r\n				<ol margin-left="10px">\r\n					<li margin-top="10px"><b>Important Instructions and Information</b> - (5 pages)( Please note: You do not need to submit the instructions  to your Election Office.</li>\r\n					<li margin-top="10px">The FWAB cover page which is titled: \'<b>Voter\'s Declaration/Affirmation</b> - Federal Write-In Absentee Ballot (FWAB)\' You must sign and date the cover page and submit it to your Election Office with your ballot and the addendum page if applicable.\r\n					</li>\r\n					<li margin-top="10px"><b>Addendum page</b> - to accompany the cover page.  Sign, date and submit the addendum page only if it contains information such as a note to your election official or state-specific information.  You do not need to submit a blank Addendum page.</li>\r\n					<li margin-top="10px">Your <b>BALLOT</b> which is titled: \'Official Federal Write-In Absentee Ballot\'\r\n						<p margin-top="12px">Submit the ballot in a blank security envelope to your Election Office.  Further instructions below.</p></li>\r\n					<li margin-top="10px">For your reference only: The official <b>Privacy Act Statement</b> from the Federal Voting Assistance Program. You do not need to submit the Privacy Act Statement.</li>\r\n					<li margin-top="10px"><b>Fax Cover Sheet</b>: Fax Cover Sheet: You have been provided with a completed fax cover sheet if you wish to fax your FWAB cover page and the addendum page together with your ballot in advance of mailing. Please note: Even if faxed in advance, ballots must be posted to arrive at your Election Office as hard copy, signed/dated originals to be valid.</li>\r\n				</ol>\r\n			</p>\r\n\r\n			<p margin-top="12px">\r\n				<b>Signature/Date:</b>\r\n				<p margin-top="5px">\r\n					Remember to sign and date the Voter\'s Declaration/Affirmation cover page.\r\n					#if($!ufAddendum ne "")\r\n						Sign and date the Addendum page only if it contains information and you will be submitting it in with the cover page. Please check the notarization and witness requirements list prior to signing your FWAB.\r\n					#end\r\n				</p>\r\n			</p>\r\n\r\n\r\n			<p margin-top="12px">\r\n				<b>Vote: </b>\r\n				<p margin-top="5px">\r\n					This new Vote-Print-Mail Ballot system will have presented you with federal level candidate lists based on your voting jurisdiction.  Please confirm that your ballot was properly completed with the candidate choices you intended to make.\r\n				</p>\r\n				<p margin-top="5px">\r\n					If you chose the option to write-in the name of the candidates or their political party, it will have printed blank and you may complete it by hand.\r\n				</p>\r\n				<p margin-top="5px">\r\n					We have provided candidate lists for voting at the federal level only. If you would like to vote for state-level offices, you will need to indicate the candidates and parties without our assistance. There are extra blank lines on the ballot page for this purpose. Note: Voters who are "indefinitely" living abroad and no longer paying state taxes should vote only at the federal level.\r\n				</p>\r\n			   <p margin-top="12px"> </p>\r\n				<p margin-top="12px"><b>President/Vice President </b>- enter names of candidates or name of party</p>\r\n				<p margin-top="12px"><b>US Senate </b>- enter name of candidate, or name of party</p>\r\n				<p margin-top="12px"><b>House of Representatives </b>- enter name of candidate, or name of party</p>\r\n				<p margin-top="12px"> </p>\r\n			</p>\r\n			<p margin-top="12px">\r\n				If there is no Senate race in NY this year our system will not have provided you the opportunity to choose a candidate and the ballot will print with this line blank. It is always good to double check however on the NY State Board of Elections website.\r\n			</p>\r\n\r\n			<p margin-top="12px">\r\n				<b>Errors/Modifications and Re-printing Options:</b>\r\n				<p margin-top="5px">\r\n					Write-in ballots are generated on demand only by you, and are not saved by our system.  You can certainly correct any mistakes prior to submission.\r\n				</p>\r\n				<p margin-top="5px">\r\n					To redo/change/modify any part of the cover page or your ballot:\r\n				</p>\r\n				 <ol margin-left="10px">\r\n					<li margin-top="10px">If you saved your data in a Voter Account, login and choose to reprint your FWAB. You will be able to make any necessary changes prior to reprinting. Certain data will need to be reentered.</li>\r\n					<li margin-top="10px">You can start the FWAB process over again.  Repeat these steps as often as you need. Your ballot is only valid and used when submitted to your election office.</li>\r\n				</ol>\r\n				</p>\r\n			<p margin-top="12px">\r\n				<b>IMPORTANT NOTE:</b> Please use the ballot security and return envelopes that print with these instructions.\r\n			</p>\r\n\r\n\r\n			#if( $ufAdditionalInstruction && $ufAdditionalInstruction != "" )\r\n			<p margin-top="12px">\r\n				<b>$!ufVotingState\'s Additional Requirements: </b>\r\n				<p margin-top="12px">\r\n					$!ufAdditionalInstruction\r\n				</p>\r\n			</p>\r\n			#end\r\n\r\n			<p margin-top="12px">\r\n				<b>Ballot Transmission Options: </b>\r\n				<p margin-top="12px">You have been provided with a completed fax cover sheet if you wish to fax your ballot in advance of sending it in. <b>Even if faxed in advance, ballots must arrive as hard copy, signed/dated originals to be valid.</b></p>\r\n\r\n			   <p margin-top="12px">Please check the <a href="https://newyork.overseasvotefoundation.org/oversea/svid.htm">NY State Voter Information Directory</a> - Voting Materials Transmission Options page on the New York Overseas and Military Voter Services site.</p>\r\n\r\n\r\n			   <p margin-top="12px">Please send your ballot to the local election office at the following address:</p>\r\n			</p>\r\n\r\n			<p margin-top="12px" margin-left="20px">$!envelope_address</p>\r\n\r\n			<p margin-top="12px" margin-left="20px">Your election official can be reached as follows:</p>\r\n			<p margin-left="20px">\r\n				#if(!$leo.lovc.firstName.equals(""))<b>$!leo.lovc.firstName $!leo.lovc.lastName</b>#end\r\n				#if($leo.lovc.firstName.equals("") && !$leo.leo.firstName.equals(""))<b>$!leo.leo.firstName $!leo.leo.lastName</b>#end\r\n			</p>\r\n			<p margin-left="20px">\r\n				#if(!$leo.lovcEmail.equals(""))Email: <b><a href="mailto:$!leo.lovcEmail">$!leo.lovcEmail</a></b>#end\r\n				#if($leo.lovcEmail.equals("") && !$leo.leoEmail.equals(""))Email: <b><a href="mailto:$!leo.leoEmail">$!leo.leoEmail</a></b>#end\r\n			</p>\r\n			<p margin-left="20px">\r\n				#if(!$leo.lovcPhone.equals(""))Phone <b>$!leo.lovcPhone</b>#end\r\n				#if($leo.lovcPhone.equals("") && !$leo.leoPhone.equals(""))Phone <b>$!leo.leoPhone</b>#end\r\n			</p>\r\n			<p margin-left="20px">\r\n				#if(!$leo.lovcFax.equals(""))Fax: <b>$!leo.lovcFax</b>#end\r\n				#if($leo.lovcFax.equals("") && !$leo.leoFax.equals(""))Fax: <b>$!leo.leoFax</b>#end\r\n		   </p>\r\n			<p margin-top="12px">\r\n				<p margin-top="12px"><b>Return address: </b>Remember to put your return address on the outside of the envelope. This should be your address overseas; or if you are in the military, your current address whether within or outside of the U.S.</p>\r\n			</p>\r\n\r\n			<p margin-top="24px">\r\n				<b><i>Thank you</i></b>\r\n			</p>\r\n\r\n\r\n			<p margin-top="12px">We hope that you have had a positive voting experience in this coming election, and that we have been able to assist you with our services,</p>\r\n\r\n			<p margin-top="12px">New York State Board of Election</p>\r\n\r\n		</font>\r\n        </value>\r\n    </page>', '2012-03-09 20:15:24', 2),
	(15, 'FWAB', 23, '<page master="rava_third_page">\r\n        <date-printed>$!date_long</date-printed>\r\n        <first-name>$!ufFirstName</first-name>\r\n        <value>\r\n            <font size="11px" family="TrebuchetMS" line-height="5mm">\r\n\r\n                <p margin-top="12px">\r\n                    <b>Federal Write-In Absentee Ballot - Instructions for Ballot Completion and Mailing</b>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Print the downloaded documents:</b>\r\n                    <ol margin-left="10px">\r\n                        <li margin-top="10px">Instructions - this page.</li>\r\n                        <li margin-top="10px">The FWAB cover page which is titled: \'Voter\'s Declaration/Affirmation - Federal Write-In Absentee Ballot (FWAB)\'.</li>\r\n                        <li margin-top="10px">Addendum page - to accompany the cover page. Please submit the addendum page only if it contains additional information; it is not required for submission if blank.</li>\r\n                        <li margin-top="10px">Your Write-In Ballot which is titled: \'Official Federal Write-In Absentee Ballot\'</li>\r\n                        <li margin-top="10px">As reference: The official Privacy Act Statement and FWAB completion information from the Federal Voting Assistance Program</li>\r\n                    </ol>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Signatures/Dates:</b>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px">\r\n                        Remember to <b>sign and date</b> the Voter\'s Declaration/Affirmation cover page and the Addendum page.\r\n                    </p>\r\n                </p>\r\n\r\n\r\n                <p margin-top="12px">\r\n                    <b>Vote - write-in your choices:</b>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px">\r\n                        Enter either the name of the candidates or their political party for each office you are voting for on your Official Federal Write-In Absentee Ballot.\r\n                    </p>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px"><b>President/Vice President </b>--- enter names of candidates, or name of party---</p>\r\n                    <p margin-top="12px"><b>Vice President </b>---enter name of candidate, or name of party---</p>\r\n                    <p margin-top="12px"><b>US Senate </b>---enter name of candidate, or name of party---</p>\r\n                    <p margin-top="12px"><b>House of Representatives </b>---enter name of candidate, or name of party---</p>\r\n                    <p margin-top="12px"> </p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>IMPORTANT Note</b> - you will need to provide 2 envelopes:\r\n                    <ol margin-left="10px">\r\n                        <li margin-top="10px"><b>A Ballot Security Envelope</b> to hold your voted ballot - Print <b>only</b> the words <b>"Security Envelope"</b> on the outside of the Ballot Security Envelope containing your Official Federal Write-In Absentee Ballot.  Make sure to seal your voted ballot within it.  Do <b>NOT</b> put your name or any other information on this envelope.</li>\r\n                        <li margin-top="10px">A larger <b>Mailing Envelope</b> for the forms and the Ballot Security Envelope - Your mailing envelope should be large enough to contain the Cover Page and Addendum and your sealed Ballot Security Envelope containing your completed ballot.</li>\r\n                    </ol>\r\n                </p>\r\n\r\n\r\n                #if( $ufAdditionalInstruction && $ufAdditionalInstruction != "" )\r\n                <p margin-top="12px">\r\n                    <b>$!ufVotingState\'s Additional Requirements: </b>\r\n                    <p margin-top="12px">\r\n                        $!ufAdditionalInstruction\r\n                    </p>\r\n                </p>\r\n                #end\r\n\r\n                <p margin-top="12px">\r\n                    <b>Mailing address: </b>Mail your FWAB to your local election office at the following address:\r\n                    <p margin-top="12px" margin-left="20px">$!envelope_address</p>\r\n                </p>\r\n				<p margin-top="12px" margin-left="20px">Your election official can be reached as follows:</p>\r\n				<p margin-left="20px">\r\n					#if(!$leo.lovc.firstName.equals(""))<b>$!leo.lovc.firstName $!leo.lovc.lastName</b>#end \r\n                   	#if($leo.lovc.firstName.equals("") && !$leo.leo.firstName.equals(""))<b>$!leo.leo.firstName $!leo.leo.lastName</b>#end \r\n                </p>\r\n				<p margin-left="20px">\r\n					#if(!$leo.lovcEmail.equals(""))Email: <b><a href="mailto:$!leo.lovcEmail">$!leo.lovcEmail</a></b>#end \r\n                   	#if($leo.lovcEmail.equals("") && !$leo.leoEmail.equals(""))Email: <b><a href="mailto:$!leo.leoEmail">$!leo.leoEmail</a></b>#end \r\n                </p>\r\n                <p margin-left="20px">\r\n                	#if(!$leo.lovcPhone.equals(""))Phone <b>$!leo.lovcPhone</b>#end \r\n                    #if($leo.lovcPhone.equals("") && !$leo.leoPhone.equals(""))Phone <b>$!leo.leoPhone</b>#end \r\n                </p>\r\n                <p margin-left="20px">\r\n                	#if(!$leo.lovcFax.equals(""))Fax: <b>$!leo.lovcFax</b>#end \r\n                    #if($leo.lovcFax.equals("") && !$leo.leoFax.equals(""))Fax: <b>$!leo.leoFax</b>#end \r\n               </p>\r\n\r\n                <p margin-top="12px">\r\n                    <p margin-top="12px"><b>Return address: </b>Remember to put your return address on the outside of the envelope/</p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Postage:</b>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px"><b>Overseas Citizens: </b>Take your FWAB to the local overseas post office to obtain the correct international airmail postage and to have your envelope postmarked from outside the US.</p>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px"><b>Uniformed Services: </b>If you are mailing your FWAB from within the APO/FPO system, a Diplomatic Pouch, or U.S. Mail, please confirm and affix the correct postage.</p>\r\n                </p>\r\n\r\n				<!-- Express Your Vote disabled\r\n                <p margin-top="12px"><b>EXPRESS YOUR VOTE</b></p>\r\n                <p margin-top="12px"><b>Special Ballot Shipping Offers for Election $!electionYear </b></p>\r\n                <p margin-top="12px">Overseas Vote Foundation (OVF) is proud to introduce <a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> - an innovative initiative supported by FedEx Express.  Through Express Your Vote, you gain access to special OVF rates for world-class FedEx service, speed and reliability when shipping your ballot back to your election office for the $!electionYear  General (Presidential) Election.</p>\r\n                <p margin-top="12px">The <a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> program starts on September 15, $!electionYear  and runs in more than 80 countries through October 29, $!electionYear *.  You will be able to conveniently generate your Air Waybill through the <a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> section of the <a href="https://www.overseasvotefoundation.org/overseas/">OVF</a> website for country-specific details.</p>\r\n                <p margin-top="12px">With <a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> the latest in shipment tracking technology and automatic delivery notification will be available to you. </p>\r\n                <p margin-top="12px"><a href="https://www.overseasvotefoundation.org/ExpressYourVote">Special shipping rates</a> are available to you, ranging from highly-discounted to absolutely free, depending on the country of operation. Please <a href="https://www.overseasvotefoundation.org/ExpressYourVote">check the lists</a> of participating states and countries.</p>\r\n                <p margin-top="12px"><a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> and be confident it will be there in time to be counted!</p>\r\n                <p margin-top="12px">* Verify exact shipping dates and country eligibility at</p>\r\n                <p margin-top="12px"><a href="http://www.overseasvotefoundation.org/ExpressYourVote">http://www.overseasvotefoundation.org/ExpressYourVote</a></p>\r\n               	<p margin-top="12px">The FedEx Express Money-Back Guarantee does not apply to any shipment sent using the Overseas Vote Foundation discount for the "<a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a>" promotion. Please see <a href="http://www.fedex.com">http://www.fedex.com</a> for terms and conditions of carriage.</p>\r\n				-->\r\n				\r\n                <p margin-top="12px">\r\n                    <b><i>Thank you for using OVF\'s voter services!</i></b>\r\n                </p>\r\n\r\n\r\n            </font>\r\n        </value>\r\n    </page>', '2012-03-09 20:14:40', 2),
	(16, 'RAVA', 22, '<page master="rava_third_page">\r\n        <date-printed>$!date_long</date-printed>\r\n        <first-name>$!ufFirstName</first-name>\r\n        <value>\r\n            <font size="11px" family="TrebuchetMS" line-height="5mm">\r\n                <p margin-top="12px">\r\n                    Overseas Vote Foundation (OVF) works together with leaders in U.S. voter outreach to bring comprehensive voter services to overseas and military voters.   You have just completed the voter registration program through an OVF hosted system site featuring the full complement of OVF\'s voter services. Please follow the instructions below to complete the application process.\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    Fields left blank on your form are not required for your state.  The OVF registration system has prompted you for the information that your state requires.\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Please check your documents:</b>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">Verify that the data you entered is correct on your Voter Registration/Ballot Request form and the accompanying Addendum page.</li>\r\n                        <li margin-top="10px">\r\n                            <span>If corrections are needed, return to the OVF website,</span>\r\n                            <a href="http://rockthevote.overseasvotefoundation.org">http://rockthevote.overseasvotefoundation.org</a>\r\n                            <span>to either: 1) access your Voter Account and regenerate the form with corrections or; 2) if your browser is still open with the same session running, go back and make changes, then reprint or; 3) run through the registration program again and reprint your form.</span>\r\n                        </li>\r\n                    </ul>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Print, sign and date the forms:</b>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">Sign and date your Voter Registration/Ballot Request form and addendum page.</li>\r\n                        <li margin-top="10px">Make sure to date the forms in U.S. format - Month-Day-Year.</li>\r\n                        <li margin-top="10px">Your election office needs your <i>original signature</i> in order to process and approve it.</li>\r\n                    </ul>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Address your envelope to:</b>\r\n                    <p margin-top="12px" margin-left="20px">$!envelope_address</p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Sending your documents:</b>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">\r\n                            The completed form contains your personal identity information and should be carefully transmitted to your local election office.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Mail:</b>\r\n                            OVF recommends regular postal mail as the number one method for confidential voter materials transmission.  Postal mail is the most secure method of transmitting these highly confidential documents.  It is best to mail it from the post office instead of a mail box.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Fax + Mail the original: </b>\r\n                            Some states allow you to fax the form ahead to speed processing; however, it must be followed by a posted form with your original signature by mail in order to be a valid application.\r\n                            <p margin-top="12px">#if(!$leo.lovcFax.equals(""))The fax number for your region is <b>$!leo.lovcFax</b>#end \r\n                            #if($leo.lovcFax.equals("") && !$leo.leoFax.equals(""))The fax number for your region is <b>$!leo.leoFax</b>#end \r\n                           	#if($leo.lovcFax.equals("") && $leo.leoFax.equals(""))You can look up your region\'s fax number at: <a href="https://www.overseasvotefoundation.org/overseas/eod.htm">www.overseasvotefoundation.org/overseas/eod.htm</a>#end \r\n                           	</p>\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Email:</b>\r\n                            The open Internet is not secure.  Some states and government organizations offer an email option for your signed, scanned forms, but it is not guaranteed as a secure transmission method and must be followed by a posted form with your original signature by mail in order to be a valid application.\r\n                            <p margin-top="12px">#if(!$leo.lovcEmail.equals(""))The email address for your region is  <b><a href="mailto:$!leo.lovcEmail">$!leo.lovcEmail</a></b>#end \r\n                            #if($leo.lovcEmail.equals("") && !$leo.leoEmail.equals(""))The email address for your region is <b><a href="mailto:$!leo.leoEmail">$!leo.leoEmail</a></b>#end \r\n                           	#if($leo.lovcEmail.equals("") && $leo.leoEmail.equals(""))You can look up your region\'s email address at: <a href="https://www.overseasvotefoundation.org/overseas/eod.htm">www.overseasvotefoundation.org/overseas/eod.htm</a>#end \r\n                        	</p>\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            Consult the OVF State-Specific Voter Information Directory online for the various options for sending your Voter Registration/Ballot Request form\r\n                        </li>\r\n                    </ul>\r\n                </p>\r\n\r\n                #if( $ufAdditionalInstruction && $ufAdditionalInstruction != "" )\r\n                <p margin-top="12px">\r\n                    <b>$!ufVotingState\'s Additional Requirements:</b>\r\n                    <p margin-top="12px">\r\n                        $!ufAdditionalInstruction\r\n                    </p>\r\n                </p>\r\n                #end\r\n\r\n                <p margin-top="12px"></p>\r\n                <p margin-top="12px">\r\n                    <b>Further information and resources:</b>\r\n                    <p margin-top="12px">The OVF website provides many services that may be useful to you over the course of this election period including:</p>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">\r\n                            <b>My Voter Account&#x2122;</b>\r\n                             - take advantage of this new service which makes it possible to keep an up-to-date voter profile on hand, maintain your mailing list profile, generate a new ballot request form or a write-in ballot with the click of a button\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Federal Write-in Absentee Ballot wizard</b>\r\n                            - the Federal Write-in Absentee Ballot finally made easy! This is a blank ballot for registered voters to use in the event that your ballot is late in arriving to you.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Voter Help Desk&#x2122;</b>\r\n                             - answers to your voting questions\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Election Official Directory&#x2122;</b>\r\n                            - comprehensive listing of election office contact information\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>State-specific Voter Information Directory&#x2122;</b>\r\n                            - state-by-state information bank providing details on deadlines, voter materials transmission options and state contact information\r\n                        </li>\r\n                    </ul>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Your next steps:</b>\r\n                    <ol margin-left="10px">\r\n                        <li margin-top="10px"><b>Send</b> in your signed, dated, original form by regular mail.</li>\r\n                        <li margin-top="10px">\r\n                            <b>Confirm</b> that you are on the voter rolls and will receive your $!electionYear  ballots:\r\n                            <p margin-top="12px"> </p>\r\n                            <p margin-top="12px">\r\n                                <a href="https://www.overseasvotefoundation.org/overseas/eod.htm">Contact your election official</a> after sending your registration/ballot request form to confirm that you are on the rolls and will receive your ballots through the $!electionYear  election year.\r\n	 							#if ( !$leo.lovc.empty )\r\n								    <p margin-top="12px"><b>Overseas Voting Contact:</b></p>\r\n								    <p margin-top="12px">$!leo.lovc.firstName $!leo.lovc.lastName</p>\r\n								   	#if(!$leo.lovcPhone.equals(""))<p margin-top="12px">phone: $!leo.lovcPhone</p>#end\r\n								   	#if(!$leo.lovcFax.equals(""))<p margin-top="12px">fax: $!leo.lovcFax</p>#end\r\n								   	#if(!$leo.lovcEmail.equals(""))<p margin-top="12px">email: <a href="mailto:$!leo.lovcEmail">$!leo.lovcEmail</a></p>#end\r\n								#end\r\n								\r\n								#if ( !$leo.leo.empty )\r\n								    <p margin-top="12px"><b>Local Election Official:</b></p>\r\n								    <p margin-top="12px">$!leo.leo.firstName $!leo.leo.lastName</p>\r\n								   	#if(!$leo.leoPhone.equals(""))<p margin-top="12px">phone: $!leo.leoPhone</p>#end\r\n								   	#if(!$leo.leoFax.equals(""))<p margin-top="12px">fax: $!leo.leoFax</p>#end\r\n								   	#if(!$leo.leoEmail.equals(""))<p margin-top="12px">email: <a href="mailto:$!leo.leoEmail">$!leo.leoEmail</a></p>#end\r\n								#end\r\n								\r\n								#if ( $leo.leo.empty && $leo.lovc.empty )\r\n								<p margin-top="12px">Look up contact information in the Election Official Directory: <a href="https://rockthevote.overseasvotefoundation.org/overseas/eod.htm">rockthevote.overseasvotefoundation.org/overseas/eod.htm</a></p>\r\n								#end\r\n                            </p>\r\n                            <p margin-top="12px"> </p>\r\n                            <p margin-top="12px">\r\n                                Never take for granted that your ballot will simply arrive for the next election without confirming it.  Contact your election official and avoid surprises.\r\n                            </p>\r\n                        </li>\r\n                    </ol>\r\n                </p>\r\n\r\n                <p margin-top="12px"></p>\r\n                <p margin-top="12px">\r\n                    <b>Ballot Back-up Plan</b>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px">\r\n                        Sometimes ballots arrive late.  Or not at all.  We hope that does not occur in your case.\r\n                        If you don\'t receive your requested ballot from your election office by <b>30 days</b> before the election,\r\n                        please visit our site to access the Federal Write-in Absentee Ballot.\r\n                    </p>\r\n                </p>\r\n\r\n				<!-- Express Your Vote disabled\r\n                <p margin-top="12px"><b>EXPRESS YOUR VOTE</b></p>\r\n                <p margin-top="12px"><b>Special Ballot Shipping Offers for Election $!electionYear </b></p>\r\n                <p margin-top="12px">Overseas Vote Foundation (OVF) is proud to introduce <a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> - an innovative initiative supported by FedEx Express.  Through Express Your Vote, you gain access to special OVF rates for world-class FedEx service, speed and reliability when shipping your ballot back to your election office for the $!electionYear  General (Presidential) Election.</p>\r\n                <p margin-top="12px">The <a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> program starts on September 15, $!electionYear  and runs in more than 80 countries through October 29, $!electionYear *.  You will be able to conveniently generate your Air Waybill through the <a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> section of the <a href="https://www.overseasvotefoundation.org/overseas/">OVF</a> website for country-specific details.</p>\r\n                <p margin-top="12px">With <a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> the latest in shipment tracking technology and automatic delivery notification will be available to you. </p>\r\n                <p margin-top="12px"><a href="https://www.overseasvotefoundation.org/ExpressYourVote">Special shipping rates</a> are available to you, ranging from highly-discounted to absolutely free, depending on the country of operation. Please <a href="https://www.overseasvotefoundation.org/ExpressYourVote">check the lists</a> of participating states and countries.</p>\r\n                <p margin-top="12px"><a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> and be confident it will be there in time to be counted!</p>\r\n                <p margin-top="12px">* Verify exact shipping dates and country eligibility at</p>\r\n                <p margin-top="12px"><a href="http://www.overseasvotefoundation.org/ExpressYourVote">http://www.overseasvotefoundation.org/ExpressYourVote</a></p>\r\n               	<p margin-top="12px">The FedEx Express Money-Back Guarantee does not apply to any shipment sent using the Overseas Vote Foundation discount for the "<a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a>" promotion. Please see <a href="http://www.fedex.com">http://www.fedex.com</a> for terms and conditions of carriage.</p>\r\n				-->\r\n				\r\n                <p margin-top="12px">\r\n                    <b>Thank you</b>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px">\r\n                        Overseas Vote Foundation is a nonprofit, nonpartisan public charity dedicated to facilitating overseas citizen\r\n                        and uniformed services voter participation in Federal elections.\r\n                        <b>Please consider making a <a href="https://www.overseasvotefoundation.org/donation">donation</a> to help keep OVF going!</b>\r\n                    </p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    We wish you a positive voting experience in the coming election,\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    Overseas Vote Foundation\r\n                </p>\r\n                <p margin-top="12px">\r\n                    <a href="https://www.overseasvotefoundation.org">www.overseasvotefoundation.org</a>\r\n                </p>\r\n            </font>\r\n        </value>\r\n    </page>', '2011-12-20 14:30:46', 2),
	(17, 'FWAB', 22, '<page master="rava_third_page">\r\n        <date-printed>$!date_long</date-printed>\r\n        <first-name>$!ufFirstName</first-name>\r\n        <value>\r\n            <font size="11px" family="TrebuchetMS" line-height="5mm">\r\n\r\n			<p margin-top="12px">\r\n				<b>Federal Write-In Absentee Ballot - Instructions for Ballot Completion and Mailing</b>\r\n			</p>\r\n			<p margin-top="12px">\r\n				 Overseas Vote Foundation (OVF) works together with leaders in U.S. voter outreach to bring comprehensive voter services to overseas and military voters.   You have just completed the Federal Write-in Absentee Ballot (FWAB) Voter\'s Declaration/Affirmation process through an OVF hosted system site featuring the full complement of OVF\'s voter services.\r\n			</p>\r\n\r\n			<p margin-top="12px">\r\n				<b>Print the downloaded documents:</b>\r\n				<ol margin-left="10px">\r\n					<li margin-top="10px">Instructions - this page.</li>\r\n					<li margin-top="10px">The FWAB cover page which is titled: \'Voter\'s Declaration/Affirmation - Federal Write-In Absentee Ballot (FWAB)\'</li>\r\n					<li margin-top="10px">Addendum page - to accompany the cover page.</li>\r\n					<li margin-top="10px">Your Write-In Ballot which is titled: \'Official Federal Write-In Absentee Ballot\'</li>\r\n					<li margin-top="10px">As reference: The official Privacy Act Statement and FWAB completion information from the Federal Voting Assistance Program</li>\r\n				</ol>\r\n			</p>\r\n\r\n			<p margin-top="12px">\r\n				<b>Signatures/Dates:</b>\r\n				<p margin-top="12px"> </p>\r\n				<p margin-top="12px">\r\n					Remember to <b>sign and date</b> the Voter\'s Declaration/Affirmation cover page and the Addendum page.\r\n				</p>\r\n			</p>\r\n\r\n\r\n			<p margin-top="12px">\r\n				<b>Vote - write-in your choices:</b>\r\n				<p margin-top="12px"> </p>\r\n				<p margin-top="12px">\r\n					Enter either the name of the candidates or their political party for each office you are voting for on your Official Federal Write-In Absentee Ballot.\r\n				</p>\r\n				<p margin-top="12px"> </p>\r\n				<p margin-top="12px"><b>President </b>---enter name of candidate, or name of party---</p>\r\n				<p margin-top="12px"><b>Vice President </b>---enter name of candidate, or name of party---</p>\r\n				<p margin-top="12px"><b>US Senate </b>---enter name of candidate, or name of party---</p>\r\n				<p margin-top="12px"><b>House of Representatives </b>---enter name of candidate, or name of party---</p>\r\n				<p margin-top="12px"> </p>\r\n			</p>\r\n\r\n			<p margin-top="12px">\r\n				<b>IMPORTANT Note</b> - you will need to provide 2 envelopes:\r\n				<ol margin-left="10px">\r\n					<li margin-top="10px"><b>A Ballot Security Envelope</b> to hold your voted ballot - Print <b>only</b> the words <b>"Security Envelope"</b> on the outside of the Ballot Security Envelope containing your Official Federal Write-In Absentee Ballot.  Make sure to seal your voted ballot within it.  Do <b>NOT</b> put your name or any other information on this envelope.</li>\r\n					<li margin-top="10px">A larger <b>Mailing Envelope</b> for the forms and the Ballot Security Envelope - Your mailing envelope should be large enough to contain the Cover Page and Addendum and your sealed Ballot Security Envelope containing your completed ballot.</li>\r\n				</ol>\r\n			</p>\r\n\r\n\r\n			#if( $ufAdditionalInstruction && $ufAdditionalInstruction != "" )\r\n			<p margin-top="12px">\r\n				<b>$!ufVotingState\'s Additional Requirements: </b>\r\n				<p margin-top="12px">\r\n					$!ufAdditionalInstruction\r\n				</p>\r\n			</p>\r\n			#end\r\n\r\n			<p margin-top="12px">\r\n				<b>Mailing address: </b>Mail your FWAB to your local election office at the following address:\r\n				<p margin-top="12px" margin-left="20px">$!envelope_address</p>\r\n			</p>\r\n			<p margin-top="12px" margin-left="20px">Your election official can be reached as follows:</p>\r\n			<p margin-left="20px">\r\n				#if(!$leo.lovc.firstName.equals(""))<b>$!leo.lovc.firstName $!leo.lovc.lastName</b>#end\r\n				#if($leo.lovc.firstName.equals("") && !$leo.leo.firstName.equals(""))<b>$!leo.leo.firstName $!leo.leo.lastName</b>#end\r\n			</p>\r\n			<p margin-left="20px">\r\n				#if(!$leo.lovcEmail.equals(""))Email: <b><a href="mailto:$!leo.lovcEmail">$!leo.lovcEmail</a></b>#end\r\n				#if($leo.lovcEmail.equals("") && !$leo.leoEmail.equals(""))Email: <b><a href="mailto:$!leo.leoEmail">$!leo.leoEmail</a></b>#end\r\n			</p>\r\n			<p margin-left="20px">\r\n				#if(!$leo.lovcPhone.equals(""))Phone <b>$!leo.lovcPhone</b>#end\r\n				#if($leo.lovcPhone.equals("") && !$leo.leoPhone.equals(""))Phone <b>$!leo.leoPhone</b>#end\r\n			</p>\r\n			<p margin-left="20px">\r\n				#if(!$leo.lovcFax.equals(""))Fax: <b>$!leo.lovcFax</b>#end\r\n				#if($leo.lovcFax.equals("") && !$leo.leoFax.equals(""))Fax: <b>$!leo.leoFax</b>#end\r\n		   </p>\r\n\r\n			<p margin-top="12px">\r\n				<p margin-top="12px"><b>Return address: </b>Remember to put your return address on the outside of the envelope/</p>\r\n			</p>\r\n\r\n			<p margin-top="12px">\r\n				<b>Postage:</b>\r\n				<p margin-top="12px"> </p>\r\n				<p margin-top="12px"><b>Overseas Citizens: </b>Take your FWAB to the local overseas post office to obtain the correct international airmail postage and to have your envelope postmarked from outside the US.</p>\r\n				<p margin-top="12px"> </p>\r\n				<p margin-top="12px"><b>Uniformed Services: </b>If you are mailing your FWAB from within the APO/FPO system, a Diplomatic Pouch, or U.S. Mail, please confirm and affix the correct postage.</p>\r\n			</p>\r\n\r\n			<!-- Express Your Vote disabled\r\n			<p margin-top="12px"><b>EXPRESS YOUR VOTE</b></p>\r\n			<p margin-top="12px"><b>Special Ballot Shipping Offers for Election $!electionYear </b></p>\r\n			<p margin-top="12px">Overseas Vote Foundation (OVF) is proud to introduce <a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> - an innovative initiative supported by FedEx Express.  Through Express Your Vote, you gain access to special OVF rates for world-class FedEx service, speed and reliability when shipping your ballot back to your election office for the $!electionYear  General (Presidential) Election.</p>\r\n			<p margin-top="12px">The <a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> program starts on September 15, $!electionYear  and runs in more than 80 countries through October 29, $!electionYear *.  You will be able to conveniently generate your Air Waybill through the <a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> section of the <a href="https://www.overseasvotefoundation.org/overseas/">OVF</a> website for country-specific details.</p>\r\n			<p margin-top="12px">With <a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> the latest in shipment tracking technology and automatic delivery notification will be available to you. </p>\r\n			<p margin-top="12px"><a href="https://www.overseasvotefoundation.org/ExpressYourVote">Special shipping rates</a> are available to you, ranging from highly-discounted to absolutely free, depending on the country of operation. Please <a href="https://www.overseasvotefoundation.org/ExpressYourVote">check the lists</a> of participating states and countries.</p>\r\n			<p margin-top="12px"><a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> and be confident it will be there in time to be counted!</p>\r\n			<p margin-top="12px">* Verify exact shipping dates and country eligibility at</p>\r\n			<p margin-top="12px"><a href="http://www.overseasvotefoundation.org/ExpressYourVote">http://www.overseasvotefoundation.org/ExpressYourVote</a></p>\r\n			<p margin-top="12px">The FedEx Express Money-Back Guarantee does not apply to any shipment sent using the Overseas Vote Foundation discount for the "<a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a>" promotion. Please see <a href="http://www.fedex.com">http://www.fedex.com</a> for terms and conditions of carriage.</p>\r\n			-->\r\n\r\n			<p margin-top="12px">\r\n				<b><i>Thank you for using OVF\'s voter services!</i></b>\r\n			</p>\r\n\r\n\r\n		</font>\r\n        </value>\r\n    </page>', '2012-03-09 20:14:04', 2),
	(20, 'RAVA', 20, '<page master="rava_third_page">\r\n        <date-printed>$!date_long</date-printed>\r\n        <first-name>$!ufFirstName</first-name>\r\n        <value>\r\n            <font size="11px" family="TrebuchetMS" line-height="5mm">\r\n                <p margin-top="12px">\r\n                    Thank you for using the Vermont Military and Overseas Citizens voter services to generate your Voter Registration/Ballot Request form.  Please follow the instructions below to complete the application process.\r\n                </p>\r\n                <p margin-top="12px">\r\n                    The Vermont registration system has prompted you for the information that Vermont requires.\r\n                </p>\r\n                <p margin-top="12px">\r\n                    <b>Please check your documents:</b>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">Verify that the data you entered is correct on your Voter Registration/Ballot Request form and the accompanying Addendum page.</li>\r\n                        <li margin-top="10px">\r\n                            <span>If corrections are needed, return to the website,</span>\r\n                            <a href="http://vermont.overseasvotefoundation.org">http://vermont.overseasvotefoundation.org</a>\r\n                            <span>to either: 1) access your Voter Account and regenerate the form with corrections or; 2) if your browser is still open with the same session running, go back and make changes, then reprint or; 3) run through the registration program again and reprint your form.</span>\r\n                        </li>\r\n                    </ul>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Print, sign and date the forms:</b>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">Complete the Voter\'s oath box by checking the applicable statement and signing the attestation that you have take the Voter\'s Oath</li>\r\n                        <li margin-top="10px">Sign and date your Voter Registration/Ballot Request form and addendum page.</li>\r\n                        <li margin-top="10px">Make sure to date the forms in U.S. format - Month-Day-Year.</li>\r\n                    </ul>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Address your envelope to:</b>\r\n                    <p margin-top="12px" margin-left="20px">$!envelope_address</p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Sending your documents:</b>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">\r\n                            The completed form contains your personal identity information and should be carefully transmitted to your local election office.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Mail:</b>\r\n                            We recommend regular postal mail as the number one method for confidential voter materials transmission.  Postal mail is the most secure method of transmitting these highly confidential documents.  It is best to mail it from the post office instead of a mail box.\r\n                        </li>\r\n                    </ul>\r\n                </p>\r\n\r\n                #if( $ufAdditionalInstruction && $ufAdditionalInstruction != "" )\r\n                <p margin-top="12px">\r\n                    <b>$!ufVotingState\'s Additional Requirements:</b>\r\n                    <p margin-top="12px">\r\n                        $!ufAdditionalInstruction\r\n                    </p>\r\n                </p>\r\n                #end\r\n\r\n                <p margin-top="12px"></p>\r\n                <p margin-top="12px">\r\n                    <b>Further information and resources:</b>\r\n                    <p margin-top="12px">Our website provides many services that may be useful to you over the course of this election period including:</p>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">\r\n                            <b>My Voter Account&#x2122;</b>\r\n                             - take advantage of this new service which makes it possible to keep an up-to-date voter profile on hand, maintain your mailing list profile, generate a new ballot request form or a write-in ballot with the click of a button.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Federal Write-in Absentee Ballot wizard</b>\r\n                            - the Federal Write-in Absentee Ballot finally made easy! This is a blank ballot for registered voters to use in the event that your ballot is late in arriving to you.  This ballot is valid for federal offices in general elections only.  IF you want to vote a complete ballot, you can email your town clerk and request that the town clerk send you a PDF of the ballot and the certificate for the inside voted ballot envelope which you can print out, complete, and return to the clerk by mail or delivery service.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Voter Help Desk&#x2122;</b>\r\n                             - fast and friendly answers to your voting questions\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Election Official Directory&#x2122;</b>\r\n                            - the most comprehensive listing of election office contact information available anywhere\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>State-specific Voter Information Directory&#x2122;</b>\r\n                            - state-by-state information bank providing details on deadlines, voter materials transmission options and state contact information\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Mailing List</b>\r\n                             - help us to keep you informed through online communications\r\n                        </li>\r\n                    </ul>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Your next steps:</b>\r\n                    <ol margin-left="10px">\r\n                        <li margin-top="10px"><b>Send</b> in your signed, dated, original form by regular mail or by fax to be followed by mailing your original form.</li>\r\n                        <li margin-top="10px">\r\n                            <b>Confirm</b> that you are on the voter rolls and will receive your $!electionYear  ballots:\r\n                            <p margin-top="12px"> </p>\r\n                            <p margin-top="12px">\r\n                                We recommend that you use our Voter Information Center or contact your town clerk  after sending your registration/ballot request form to confirm that you are on the rolls and will receive your ballots through the $!electionYear  election year. Look up contact information in the Election Official Directory.\r\n	 							#if ( !$leo.lovc.empty )\r\n								    <p margin-top="12px"><b>Overseas Voting Contact:</b></p>\r\n								    <p margin-top="12px">$!leo.lovc.firstName $!leo.lovc.lastName</p>\r\n								   	#if(!$leo.lovcPhone.equals(""))<p margin-top="12px">phone: $!leo.lovcPhone</p>#end\r\n								   	#if(!$leo.lovcFax.equals(""))<p margin-top="12px">fax: $!leo.lovcFax</p>#end\r\n								   	#if(!$leo.lovcEmail.equals(""))<p margin-top="12px">email: <a href="mailto:$!leo.lovcEmail">$!leo.lovcEmail</a></p>#end\r\n								#end\r\n								\r\n								#if ( !$leo.leo.empty )\r\n								    <p margin-top="12px"><b>Local Election Official:</b></p>\r\n								    <p margin-top="12px">$!leo.leo.firstName $!leo.leo.lastName</p>\r\n								   	#if(!$leo.leoPhone.equals(""))<p margin-top="12px">phone: $!leo.leoPhone</p>#end\r\n								   	#if(!$leo.leoFax.equals(""))<p margin-top="12px">fax: $!leo.leoFax</p>#end\r\n								   	#if(!$leo.leoEmail.equals(""))<p margin-top="12px">email: <a href="mailto:$!leo.leoEmail">$!leo.leoEmail</a></p>#end\r\n								#end\r\n								\r\n								#if ( $leo.leo.empty && $leo.lovc.empty )\r\n								<p margin-top="12px">Look up contact information in the Election Official Directory: <a href="https://vermont.overseasvotefoundation.org/overseas/eod.htm">vermont.overseasvotefoundation.org/overseas/eod.htm</a></p>\r\n								#end\r\n                            </p>\r\n                            <p margin-top="12px"> </p>\r\n                            <p margin-top="12px">\r\n                                Never take for granted that your ballot will simply arrive for the next election without confirming it.  Contact your election official and avoid surprises.\r\n                            </p>\r\n                        </li>\r\n                    </ol>\r\n                </p>\r\n\r\n                <p margin-top="12px"></p>\r\n                <p margin-top="12px">\r\n                    <b>Ballot Back-up Plan</b>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px">\r\n                        Sometimes ballots arrive late.  Or not at all.  We hope that does not occur in your case.  If you dont receive your requested ballot from your election office by 15 days before the election, please email your town clerk to request a PDF of your ballot along with the certificate for the voted ballot envelope or visit our site to access the Federal Write-in Absentee Ballot wizard.  Vermont allows the Federal Write-in Absentee Ballot for federal offices for general elections only.\r\n                    </p>\r\n                </p>\r\n\r\n                <p margin-top="24px">\r\n                    <b>Thank you</b>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px">\r\n                        The Vermont Military and Overseas Citizens Voter Services website has been provided in partnership with the Overseas Vote Foundation.  Overseas Vote Foundation is a nonprofit, nonpartisan public charity dedicated to facilitating overseas citizen and uniformed services voter participation in Federal elections.\r\n                    </p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    We wish you a positive voting experience in the coming election,\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    Sincerely,\r\n				</p>\r\n				<p margin-top="12px">\r\n					Jim Condos, Vermont Secretary of State\r\n				</p>\r\n				<p margin-top="12px">\r\n					<a href="http://www.sec.state.vt.us/">www.sec.state.vt.us</a>\r\n                </p>\r\n            </font>\r\n        </value>\r\n    </page>', '2011-12-20 14:30:03', 2),
	(21, 'FWAB', 20, '<page master="rava_third_page">\r\n        <date-printed>$!date_long</date-printed>\r\n        <first-name>$!ufFirstName</first-name>\r\n        <value>\r\n            <font size="11px" family="TrebuchetMS" line-height="5mm">\r\n\r\n                <p margin-top="12px">\r\n                    <b>Federal Write-In Absentee Ballot Instructions for Ballot Completion and Delivery to your Vermont Election Office</b>\r\n                </p>\r\n                <p margin-top="12px">\r\n                    You have completed the Federal Write-In Absentee Ballot (FWAB) Voter\'s Declaration/Affirmation form process.\r\n                </p>\r\n                <p margin-top="12px">\r\n                	This is a blank ballot for registered voters to use in the event that your ballot is late in arriving to you.  This ballot is valid for federal offices in general elections only.  IF you want to vote a complete ballot, you can email your town clerk and request that the town clerk send you a PDF of the ballot and the certificate for the inside voted ballot envelope which you can print out, complete, and return to the clerk by mail or delivery service.\r\n				</p>\r\n                <p margin-top="12px">\r\n                    <b>Print the downloaded documents:</b>\r\n                    <ol margin-left="10px">\r\n                        <li margin-top="10px">Instructions from Vermonts Overseas and Military voting system  this page.</li>\r\n                        <li margin-top="10px">The FWAB cover page which is titled: \'Voter\'s Declaration/Affirmation - Federal Write-In Absentee Ballot (FWAB)\'</li>\r\n                        <li margin-top="10px">Addendum page - to accompany the cover page.</li>\r\n                        <li margin-top="10px">Your Write-In Ballot which is titled: \'Official Federal Write-In Absentee Ballot\'</li>\r\n                        <li margin-top="10px">As reference: The official Privacy Act Statement and FWAB completion information from the Federal Voting Assistance Program</li>\r\n                    </ol>\r\n                </p>\r\n                <p margin-top="12px">\r\n                    <b>Voters Oath</b>\r\n                 </p>\r\n                <p margin-top="12px">\r\n                    The Vermont Constitution requires each voter to take the Vermont Voter\'s oath the first time that a person registers to vote in Vermont.  State law now allows a person to attest for him or herself that the oath has been taken by signing an attestation.\r\n                </p>\r\n                <p margin-top="12px">\r\n					Please add to your form:  "I attest that I have taken the Vermont voter\'s oath" and your signature.\r\n                </p>\r\n\r\n\r\n                <p margin-top="12px">\r\n                    <b>Signatures/Dates:</b>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px">\r\n                        Remember to <b>sign and date</b> the Voter\'s Declaration/Affirmation cover page and the Addendum page.\r\n                    </p>\r\n                </p>\r\n\r\n\r\n                <p margin-top="12px">\r\n                    <b>Vote - write-in your choices:</b>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px">\r\n                        Enter either the name of the candidates or their political party for each office you are voting for on your Official Federal Write-In Absentee Ballot.\r\n                    </p>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px"><b>President </b>---enter name of candidate, or name of party---</p>\r\n                    <p margin-top="12px"><b>Vice President </b>---enter name of candidate, or name of party---</p>\r\n                    <p margin-top="12px"><b>US Senate </b>---enter name of candidate, or name of party---</p>\r\n                    <p margin-top="12px"><b>House of Representatives </b>---enter name of candidate, or name of party---</p>\r\n                    <p margin-top="12px"> </p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>IMPORTANT Note</b> - you will need to provide 2 envelopes:\r\n                    <ol margin-left="10px">\r\n                        <li margin-top="10px"><b>A Ballot Security Envelope</b> to hold your voted ballot - Print <b>only</b> the words <b>"Security Envelope"</b> on the outside of the Ballot Security Envelope containing your Official Federal Write-In Absentee Ballot.  Make sure to seal your voted ballot within it.  Do <b>NOT</b> put your name or any other information on this envelope.</li>\r\n                        <li margin-top="10px">A larger <b>Mailing Envelope</b> for the forms and the Ballot Security Envelope - Your mailing envelope should be large enough to contain the Cover Page and Addendum and your sealed Ballot Security Envelope containing your completed ballot.</li>\r\n                    </ol>\r\n                </p>\r\n\r\n\r\n                #if( $ufAdditionalInstruction && $ufAdditionalInstruction != "" )\r\n                <p margin-top="12px">\r\n                    <b>$!ufVotingState\'s Additional Requirements: </b>\r\n                    <p margin-top="12px">\r\n                        $!ufAdditionalInstruction\r\n                    </p>\r\n                </p>\r\n                #end\r\n\r\n                <p margin-top="12px">\r\n                    <b>Mailing address: </b>Mail your FWAB to your local election office at the following address:\r\n                    <p margin-top="12px" margin-left="20px">$!envelope_address</p>\r\n                </p>\r\n				<p margin-top="12px" margin-left="20px">Your election official can be reached as follows:</p>\r\n				<p margin-left="20px">\r\n					#if(!$leo.lovc.firstName.equals(""))<b>$!leo.lovc.firstName $!leo.lovc.lastName</b>#end \r\n                   	#if($leo.lovc.firstName.equals("") && !$leo.leo.firstName.equals(""))<b>$!leo.leo.firstName $!leo.leo.lastName</b>#end \r\n                </p>\r\n				<p margin-left="20px">\r\n					#if(!$leo.lovcEmail.equals(""))Email: <b><a href="mailto:$!leo.lovcEmail">$!leo.lovcEmail</a></b>#end \r\n                   	#if($leo.lovcEmail.equals("") && !$leo.leoEmail.equals(""))Email: <b><a href="mailto:$!leo.leoEmail">$!leo.leoEmail</a></b>#end \r\n                </p>\r\n                <p margin-left="20px">\r\n                	#if(!$leo.lovcPhone.equals(""))Phone <b>$!leo.lovcPhone</b>#end \r\n                    #if($leo.lovcPhone.equals("") && !$leo.leoPhone.equals(""))Phone <b>$!leo.leoPhone</b>#end \r\n                </p>\r\n                <p margin-left="20px">\r\n                	#if(!$leo.lovcFax.equals(""))Fax: <b>$!leo.lovcFax</b>#end \r\n                    #if($leo.lovcFax.equals("") && !$leo.leoFax.equals(""))Fax: <b>$!leo.leoFax</b>#end \r\n               </p>\r\n                <p margin-top="12px">\r\n                    <p margin-top="12px"><b>Return address: </b>Remember to put your return address on the outside of the envelope/</p>\r\n                </p>\r\n                <p margin-top="12px">\r\n                    <b>Postage:</b>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px"><b>Overseas Citizens: </b>Take your FWAB to the local overseas post office to obtain the correct international airmail postage and to have your envelope postmarked from outside the US.</p>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px"><b>Uniformed Services: </b>If you are mailing your FWAB from within the APO/FPO system, a Diplomatic Pouch, or U.S. Mail, please confirm and affix the correct postage.</p>\r\n                </p>\r\n\r\n\r\n                <p margin-top="12px">\r\n                    <b><i>Thank you for using YVO\'s voter services!</i></b>\r\n                </p>\r\n                <p margin-top="12px">\r\n					Jim Condos, Vermont Secretary of State\r\n				</p>\r\n				<p margin-top="12px">\r\n					<a href="http://www.sec.state.vt.us/">www.sec.state.vt.us</a>\r\n                </p></font>\r\n        </value>\r\n    </page>', '2012-03-09 20:12:22', 2),
	(22, 'RAVA', 21, '<page master="rava_third_page">\r\n        <date-printed>$!date_long</date-printed>\r\n        <first-name>$!ufFirstName</first-name>\r\n        <value>\r\n            <font size="11px" family="TrebuchetMS" line-height="5mm">\r\n                <p margin-top="12px">\r\n                    Overseas Vote Foundation (OVF) works together with leaders in U.S. voter outreach to bring comprehensive voter services to overseas and military voters.   You have just completed the voter registration program through an OVF hosted system site featuring the full complement of OVF\'s voter services. Please follow the instructions below to complete the application process.\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    Fields left blank on your form are not required for your state.  The OVF registration system has prompted you for the information that your state requires.\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Please check your documents:</b>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">Verify that the data you entered is correct on your Voter Registration/Ballot Request form and the accompanying Addendum page.</li>\r\n                        <li margin-top="10px">\r\n                            <span>If corrections are needed, return to the OVF website,</span>\r\n                            <a href="http://rockthevote.overseasvotefoundation.org">http://rockthevote.overseasvotefoundation.org</a>\r\n                            <span>to either: 1) access your Voter Account and regenerate the form with corrections or; 2) if your browser is still open with the same session running, go back and make changes, then reprint or; 3) run through the registration program again and reprint your form.</span>\r\n                        </li>\r\n                    </ul>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Print, sign and date the forms:</b>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">Sign and date your Voter Registration/Ballot Request form and addendum page.</li>\r\n                        <li margin-top="10px">Make sure to date the forms in U.S. format - Month-Day-Year.</li>\r\n                        <li margin-top="10px">Your election office needs your <i>original signature</i> in order to process and approve it.</li>\r\n                    </ul>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Address your envelope to:</b>\r\n                    <p margin-top="12px" margin-left="20px">$!envelope_address</p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Sending your documents:</b>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">\r\n                            The completed form contains your personal identity information and should be carefully transmitted to your local election office.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Mail:</b>\r\n                            OVF recommends regular postal mail as the number one method for confidential voter materials transmission.  Postal mail is the most secure method of transmitting these highly confidential documents.  It is best to mail it from the post office instead of a mail box.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Fax + Mail the original: </b>\r\n                            Some states allow you to fax the form ahead to speed processing; however, it must be followed by a posted form with your original signature by mail in order to be a valid application.\r\n                            <p margin-top="12px">#if(!$leo.lovcFax.equals(""))The fax number for your region is <b>$!leo.lovcFax</b>#end \r\n                            #if($leo.lovcFax.equals("") && !$leo.leoFax.equals(""))The fax number for your region is <b>$!leo.leoFax</b>#end \r\n                           	#if($leo.lovcFax.equals("") && $leo.leoFax.equals(""))You can look up your region\'s fax number at: <a href="https://www.overseasvotefoundation.org/overseas/eod.htm">www.overseasvotefoundation.org/overseas/eod.htm</a>#end \r\n                           	</p>\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Email:</b>\r\n                            The open Internet is not secure.  Some states and government organizations offer an email option for your signed, scanned forms, but it is not guaranteed as a secure transmission method and must be followed by a posted form with your original signature by mail in order to be a valid application.\r\n                            <p margin-top="12px">#if(!$leo.lovcEmail.equals(""))The email address for your region is  <b><a href="mailto:$!leo.lovcEmail">$!leo.lovcEmail</a></b>#end \r\n                            #if($leo.lovcEmail.equals("") && !$leo.leoEmail.equals(""))The email address for your region is <b><a href="mailto:$!leo.leoEmail">$!leo.leoEmail</a></b>#end \r\n                           	#if($leo.lovcEmail.equals("") && $leo.leoEmail.equals(""))You can look up your region\'s email address at: <a href="https://www.overseasvotefoundation.org/overseas/eod.htm">www.overseasvotefoundation.org/overseas/eod.htm</a>#end \r\n                        	</p>\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            Consult the OVF State-Specific Voter Information Directory online for the various options for sending your Voter Registration/Ballot Request form\r\n                        </li>\r\n                    </ul>\r\n                </p>\r\n\r\n                #if( $ufAdditionalInstruction && $ufAdditionalInstruction != "" )\r\n                <p margin-top="12px">\r\n                    <b>$!ufVotingState\'s Additional Requirements:</b>\r\n                    <p margin-top="12px">\r\n                        $!ufAdditionalInstruction\r\n                    </p>\r\n                </p>\r\n                #end\r\n\r\n                <p margin-top="12px"></p>\r\n                <p margin-top="12px">\r\n                    <b>Further information and resources:</b>\r\n                    <p margin-top="12px">The OVF website provides many services that may be useful to you over the course of this election period including:</p>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">\r\n                            <b>My Voter Account&#x2122;</b>\r\n                             - take advantage of this new service which makes it possible to keep an up-to-date voter profile on hand, maintain your mailing list profile, generate a new ballot request form or a write-in ballot with the click of a button\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Federal Write-in Absentee Ballot wizard</b>\r\n                            - the Federal Write-in Absentee Ballot finally made easy! This is a blank ballot for registered voters to use in the event that your ballot is late in arriving to you.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Voter Help Desk&#x2122;</b>\r\n                             - answers to your voting questions\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Election Official Directory&#x2122;</b>\r\n                            - comprehensive listing of election office contact information\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>State-specific Voter Information Directory&#x2122;</b>\r\n                            - state-by-state information bank providing details on deadlines, voter materials transmission options and state contact information\r\n                        </li>\r\n                    </ul>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Your next steps:</b>\r\n                    <ol margin-left="10px">\r\n                        <li margin-top="10px"><b>Send</b> in your signed, dated, original form by regular mail.</li>\r\n                        <li margin-top="10px">\r\n                            <b>Confirm</b> that you are on the voter rolls and will receive your $!electionYear  ballots:\r\n                            <p margin-top="12px"> </p>\r\n                            <p margin-top="12px">\r\n                                <a href="https://www.overseasvotefoundation.org/overseas/eod.htm">Contact your election official</a> after sending your registration/ballot request form to confirm that you are on the rolls and will receive your ballots through the $!electionYear  election year.\r\n	 							#if ( !$leo.lovc.empty )\r\n								    <p margin-top="12px"><b>Overseas Voting Contact:</b></p>\r\n								    <p margin-top="12px">$!leo.lovc.firstName $!leo.lovc.lastName</p>\r\n								   	#if(!$leo.lovcPhone.equals(""))<p margin-top="12px">phone: $!leo.lovcPhone</p>#end\r\n								   	#if(!$leo.lovcFax.equals(""))<p margin-top="12px">fax: $!leo.lovcFax</p>#end\r\n								   	#if(!$leo.lovcEmail.equals(""))<p margin-top="12px">email: <a href="mailto:$!leo.lovcEmail">$!leo.lovcEmail</a></p>#end\r\n								#end\r\n								\r\n								#if ( !$leo.leo.empty )\r\n								    <p margin-top="12px"><b>Local Election Official:</b></p>\r\n								    <p margin-top="12px">$!leo.leo.firstName $!leo.leo.lastName</p>\r\n								   	#if(!$leo.leoPhone.equals(""))<p margin-top="12px">phone: $!leo.leoPhone</p>#end\r\n								   	#if(!$leo.leoFax.equals(""))<p margin-top="12px">fax: $!leo.leoFax</p>#end\r\n								   	#if(!$leo.leoEmail.equals(""))<p margin-top="12px">email: <a href="mailto:$!leo.leoEmail">$!leo.leoEmail</a></p>#end\r\n								#end\r\n								\r\n								#if ( $leo.leo.empty && $leo.lovc.empty )\r\n								<p margin-top="12px">Look up contact information in the Election Official Directory: <a href="https://vote411.overseasvotefoundation.org/overseas/eod.htm">vote411.overseasvotefoundation.org/overseas/eod.htm</a></p>\r\n								#end\r\n                            </p>\r\n                            <p margin-top="12px"> </p>\r\n                            <p margin-top="12px">\r\n                                Never take for granted that your ballot will simply arrive for the next election without confirming it.  Contact your election official and avoid surprises.\r\n                            </p>\r\n                        </li>\r\n                    </ol>\r\n                </p>\r\n\r\n                <p margin-top="12px"></p>\r\n                <p margin-top="12px">\r\n                    <b>Ballot Back-up Plan</b>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px">\r\n                        Sometimes ballots arrive late.  Or not at all.  We hope that does not occur in your case.\r\n                        If you don\'t receive your requested ballot from your election office by <b>30 days</b> before the election,\r\n                        please visit our site to access the Federal Write-in Absentee Ballot.\r\n                    </p>\r\n                </p>\r\n\r\n				<!-- Express Your Vote disabled\r\n                <p margin-top="12px"><b>EXPRESS YOUR VOTE</b></p>\r\n                <p margin-top="12px"><b>Special Ballot Shipping Offers for Election $!electionYear </b></p>\r\n                <p margin-top="12px">Overseas Vote Foundation (OVF) is proud to introduce <a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> - an innovative initiative supported by FedEx Express.  Through Express Your Vote, you gain access to special OVF rates for world-class FedEx service, speed and reliability when shipping your ballot back to your election office for the $!electionYear  General (Presidential) Election.</p>\r\n                <p margin-top="12px">The <a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> program starts on September 15, $!electionYear  and runs in more than 80 countries through October 29, $!electionYear *.  You will be able to conveniently generate your Air Waybill through the <a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> section of the <a href="https://www.overseasvotefoundation.org/overseas/">OVF</a> website for country-specific details.</p>\r\n                <p margin-top="12px">With <a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> the latest in shipment tracking technology and automatic delivery notification will be available to you. </p>\r\n                <p margin-top="12px"><a href="https://www.overseasvotefoundation.org/ExpressYourVote">Special shipping rates</a> are available to you, ranging from highly-discounted to absolutely free, depending on the country of operation. Please <a href="https://www.overseasvotefoundation.org/ExpressYourVote">check the lists</a> of participating states and countries.</p>\r\n                <p margin-top="12px"><a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> and be confident it will be there in time to be counted!</p>\r\n                <p margin-top="12px">* Verify exact shipping dates and country eligibility at</p>\r\n                <p margin-top="12px"><a href="http://www.overseasvotefoundation.org/ExpressYourVote">http://www.overseasvotefoundation.org/ExpressYourVote</a></p>\r\n               	<p margin-top="12px">The FedEx Express Money-Back Guarantee does not apply to any shipment sent using the Overseas Vote Foundation discount for the "<a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a>" promotion. Please see <a href="http://www.fedex.com">http://www.fedex.com</a> for terms and conditions of carriage.</p>\r\n				-->\r\n\r\n                <p margin-top="12px">\r\n                    <b>Thank you</b>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px">\r\n                        Overseas Vote Foundation is a nonprofit, nonpartisan public charity dedicated to facilitating overseas citizen\r\n                        and uniformed services voter participation in Federal elections.\r\n                        <b>Please consider making a <a href="https://www.overseasvotefoundation.org/donation">donation</a> to help keep OVF going!</b>\r\n                    </p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    We wish you a positive voting experience in the coming election,\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    Overseas Vote Foundation\r\n                </p>\r\n                <p margin-top="12px">\r\n                    <a href="https://www.overseasvotefoundation.org">www.overseasvotefoundation.org</a>\r\n                </p>\r\n            </font>\r\n        </value>\r\n    </page>', '2011-12-20 14:30:23', 2),
	(23, 'FWAB', 21, '<page master="rava_third_page">\r\n        <date-printed>$!date_long</date-printed>\r\n        <first-name>$!ufFirstName</first-name>\r\n        <value>\r\n            <font size="11px" family="TrebuchetMS" line-height="5mm">\r\n\r\n			<p margin-top="12px">\r\n				<b>Federal Write-In Absentee Ballot - Instructions for Ballot Completion and Mailing</b>\r\n			</p>\r\n			<p margin-top="12px">\r\n				 Overseas Vote Foundation (OVF) works together with leaders in U.S. voter outreach to bring comprehensive voter services to overseas and military voters.   You have just completed the Federal Write-in Absentee Ballot (FWAB) Voter\'s Declaration/Affirmation process through an OVF hosted system site featuring the full complement of OVF\'s voter services.\r\n			</p>\r\n\r\n			<p margin-top="12px">\r\n				<b>Print the downloaded documents:</b>\r\n				<ol margin-left="10px">\r\n					<li margin-top="10px">Instructions - this page.</li>\r\n					<li margin-top="10px">The FWAB cover page which is titled: \'Voter\'s Declaration/Affirmation - Federal Write-In Absentee Ballot (FWAB)\'</li>\r\n					<li margin-top="10px">Addendum page - to accompany the cover page.</li>\r\n					<li margin-top="10px">Your Write-In Ballot which is titled: \'Official Federal Write-In Absentee Ballot\'</li>\r\n					<li margin-top="10px">As reference: The official Privacy Act Statement and FWAB completion information from the Federal Voting Assistance Program</li>\r\n				</ol>\r\n			</p>\r\n\r\n			<p margin-top="12px">\r\n				<b>Signatures/Dates:</b>\r\n				<p margin-top="12px"> </p>\r\n				<p margin-top="12px">\r\n					Remember to <b>sign and date</b> the Voter\'s Declaration/Affirmation cover page and the Addendum page.\r\n				</p>\r\n			</p>\r\n\r\n\r\n			<p margin-top="12px">\r\n				<b>Vote - write-in your choices:</b>\r\n				<p margin-top="12px"> </p>\r\n				<p margin-top="12px">\r\n					Enter either the name of the candidates or their political party for each office you are voting for on your Official Federal Write-In Absentee Ballot.\r\n				</p>\r\n				<p margin-top="12px"> </p>\r\n				<p margin-top="12px"><b>President </b>---enter name of candidate, or name of party---</p>\r\n				<p margin-top="12px"><b>Vice President </b>---enter name of candidate, or name of party---</p>\r\n				<p margin-top="12px"><b>US Senate </b>---enter name of candidate, or name of party---</p>\r\n				<p margin-top="12px"><b>House of Representatives </b>---enter name of candidate, or name of party---</p>\r\n				<p margin-top="12px"> </p>\r\n			</p>\r\n\r\n			<p margin-top="12px">\r\n				<b>IMPORTANT Note</b> - you will need to provide 2 envelopes:\r\n				<ol margin-left="10px">\r\n					<li margin-top="10px"><b>A Ballot Security Envelope</b> to hold your voted ballot - Print <b>only</b> the words <b>"Security Envelope"</b> on the outside of the Ballot Security Envelope containing your Official Federal Write-In Absentee Ballot.  Make sure to seal your voted ballot within it.  Do <b>NOT</b> put your name or any other information on this envelope.</li>\r\n					<li margin-top="10px">A larger <b>Mailing Envelope</b> for the forms and the Ballot Security Envelope - Your mailing envelope should be large enough to contain the Cover Page and Addendum and your sealed Ballot Security Envelope containing your completed ballot.</li>\r\n				</ol>\r\n			</p>\r\n\r\n\r\n			#if( $ufAdditionalInstruction && $ufAdditionalInstruction != "" )\r\n			<p margin-top="12px">\r\n				<b>$!ufVotingState\'s Additional Requirements: </b>\r\n				<p margin-top="12px">\r\n					$!ufAdditionalInstruction\r\n				</p>\r\n			</p>\r\n			#end\r\n\r\n			<p margin-top="12px">\r\n				<b>Mailing address: </b>Mail your FWAB to your local election office at the following address:\r\n				<p margin-top="12px" margin-left="20px">$!envelope_address</p>\r\n			</p>\r\n			<p margin-top="12px" margin-left="20px">Your election official can be reached as follows:</p>\r\n			<p margin-left="20px">\r\n				#if(!$leo.lovc.firstName.equals(""))<b>$!leo.lovc.firstName $!leo.lovc.lastName</b>#end\r\n				#if($leo.lovc.firstName.equals("") && !$leo.leo.firstName.equals(""))<b>$!leo.leo.firstName $!leo.leo.lastName</b>#end\r\n			</p>\r\n			<p margin-left="20px">\r\n				#if(!$leo.lovcEmail.equals(""))Email: <b><a href="mailto:$!leo.lovcEmail">$!leo.lovcEmail</a></b>#end\r\n				#if($leo.lovcEmail.equals("") && !$leo.leoEmail.equals(""))Email: <b><a href="mailto:$!leo.leoEmail">$!leo.leoEmail</a></b>#end\r\n			</p>\r\n			<p margin-left="20px">\r\n				#if(!$leo.lovcPhone.equals(""))Phone <b>$!leo.lovcPhone</b>#end\r\n				#if($leo.lovcPhone.equals("") && !$leo.leoPhone.equals(""))Phone <b>$!leo.leoPhone</b>#end\r\n			</p>\r\n			<p margin-left="20px">\r\n				#if(!$leo.lovcFax.equals(""))Fax: <b>$!leo.lovcFax</b>#end\r\n				#if($leo.lovcFax.equals("") && !$leo.leoFax.equals(""))Fax: <b>$!leo.leoFax</b>#end\r\n		   </p>\r\n\r\n			<p margin-top="12px">\r\n				<p margin-top="12px"><b>Return address: </b>Remember to put your return address on the outside of the envelope/</p>\r\n			</p>\r\n\r\n			<p margin-top="12px">\r\n				<b>Postage:</b>\r\n				<p margin-top="12px"> </p>\r\n				<p margin-top="12px"><b>Overseas Citizens: </b>Take your FWAB to the local overseas post office to obtain the correct international airmail postage and to have your envelope postmarked from outside the US.</p>\r\n				<p margin-top="12px"> </p>\r\n				<p margin-top="12px"><b>Uniformed Services: </b>If you are mailing your FWAB from within the APO/FPO system, a Diplomatic Pouch, or U.S. Mail, please confirm and affix the correct postage.</p>\r\n			</p>\r\n\r\n			<!-- Express Your Vote disabled\r\n			<p margin-top="12px"><b>EXPRESS YOUR VOTE</b></p>\r\n			<p margin-top="12px"><b>Special Ballot Shipping Offers for Election $!electionYear </b></p>\r\n			<p margin-top="12px">Overseas Vote Foundation (OVF) is proud to introduce <a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> - an innovative initiative supported by FedEx Express.  Through Express Your Vote, you gain access to special OVF rates for world-class FedEx service, speed and reliability when shipping your ballot back to your election office for the $!electionYear  General (Presidential) Election.</p>\r\n			<p margin-top="12px">The <a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> program starts on September 15, $!electionYear  and runs in more than 80 countries through October 29, $!electionYear *.  You will be able to conveniently generate your Air Waybill through the <a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> section of the <a href="https://www.overseasvotefoundation.org/overseas/">OVF</a> website for country-specific details.</p>\r\n			<p margin-top="12px">With <a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> the latest in shipment tracking technology and automatic delivery notification will be available to you. </p>\r\n			<p margin-top="12px"><a href="https://www.overseasvotefoundation.org/ExpressYourVote">Special shipping rates</a> are available to you, ranging from highly-discounted to absolutely free, depending on the country of operation. Please <a href="https://www.overseasvotefoundation.org/ExpressYourVote">check the lists</a> of participating states and countries.</p>\r\n			<p margin-top="12px"><a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a> and be confident it will be there in time to be counted!</p>\r\n			<p margin-top="12px">* Verify exact shipping dates and country eligibility at</p>\r\n			<p margin-top="12px"><a href="http://www.overseasvotefoundation.org/ExpressYourVote">http://www.overseasvotefoundation.org/ExpressYourVote</a></p>\r\n			<p margin-top="12px">The FedEx Express Money-Back Guarantee does not apply to any shipment sent using the Overseas Vote Foundation discount for the "<a href="https://www.overseasvotefoundation.org/ExpressYourVote">Express Your Vote</a>" promotion. Please see <a href="http://www.fedex.com">http://www.fedex.com</a> for terms and conditions of carriage.</p>\r\n			-->\r\n\r\n			<p margin-top="12px">\r\n				<b><i>Thank you for using OVF\'s voter services!</i></b>\r\n			</p>\r\n\r\n\r\n		</font>\r\n        </value>\r\n    </page>', '2012-03-09 20:12:55', 2),
	(26, 'RAVA', 18, '<page master="rava_third_page">\r\n        <date-printed>$!date_long</date-printed>\r\n        <first-name>$!ufFirstName</first-name>\r\n        <value>\r\n            <font size="11px" family="TrebuchetMS" line-height="5mm">\r\n                <p margin-top="12px">\r\n                    Thank you for using the Youth Vote Overseas (YVO) voter services to generate your Voter Registration/Ballot Request form.  Please follow the instructions below to complete the application process.\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    Fields left blank on your form are not required for your state.  The YVO registration system has prompted you for the information that your state requires.\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Please check your documents:</b>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">Verify that the data you entered is correct on your Voter Registration/Ballot Request form and the accompanying Addendum page.</li>\r\n                        <li margin-top="10px">\r\n                            <span>If corrections are needed, return to the YVO website,</span>\r\n                            <a href="http://yvo.overseasvotefoundation.org">http://yvo.overseasvotefoundation.org</a>\r\n                            <span>to either: 1) access your Voter Account and regenerate the form with corrections or; 2) if your browser is still open with the same session running, go back and make changes, then reprint or; 3) run through the registration program again and reprint your form.</span>\r\n                        </li>\r\n                    </ul>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Print, sign and date the forms:</b>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">Sign and date your Voter Registration/Ballot Request form and addendum page.</li>\r\n                        <li margin-top="10px">Make sure to date the forms in U.S. format - Month-Day-Year.</li>\r\n                        <li margin-top="10px">Your election office needs your <i>original signature</i> in order to process and approve it.</li>\r\n                    </ul>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Address your envelope to:</b>\r\n                    <p margin-top="12px" margin-left="20px">$!envelope_address</p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Sending your documents:</b>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">\r\n                            The completed form contains your personal identity information and should be carefully transmitted to your local election office.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Mail:</b>\r\n                            YVO recommends regular postal mail as the number one method for confidential voter materials transmission.  Postal mail is the most secure method of transmitting these highly confidential documents.  It is best to mail it from the post office instead of a mail box.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Fax + Mail the original: </b>\r\n                            Some states allow you to fax the form ahead to speed processing; however, it must be followed by a posted form with your original signature by mail in order to be a valid application.\r\n                            <p margin-top="12px">#if(!$leo.lovcFax.equals(""))The fax number for your region is <b>$!leo.lovcFax</b>#end \r\n                            #if($leo.lovcFax.equals("") && !$leo.leoFax.equals(""))The fax number for your region is <b>$!leo.leoFax</b>#end \r\n                           	#if($leo.lovcFax.equals("") && $leo.leoFax.equals(""))You can look up your region\'s fax number at: <a href="https://yvo.overseasvotefoundation.org/overseas/eod.htm">yvo.overseasvotefoundation.org/overseas/eod.htm</a>#end \r\n                           	</p>\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Email:</b>\r\n                            The open Internet is not secure.  Some states and government organizations offer an email option for your signed, scanned forms, but it is not guaranteed as a secure transmission method and must be followed by a posted form with your original signature by mail in order to be a valid application.\r\n                            <p margin-top="12px">#if(!$leo.lovcEmail.equals(""))The email address for your region is  <b><a href="mailto:$!leo.lovcEmail">$!leo.lovcEmail</a></b>#end \r\n                            #if($leo.lovcEmail.equals("") && !$leo.leoEmail.equals(""))The email address for your region is <b><a href="mailto:$!leo.leoEmail">$!leo.leoEmail</a></b>#end \r\n                           	#if($leo.lovcEmail.equals("") && $leo.leoEmail.equals(""))You can look up your region\'s email address at: <a href="https://yvo.overseasvotefoundation.org/overseas/eod.htm">yvo.overseasvotefoundation.org/overseas/eod.htm</a>#end \r\n                        	</p>\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            Consult the YVO State-Specific Voter Information Directory online for the various options for sending your Voter Registration/Ballot Request form\r\n                        </li>\r\n                    </ul>\r\n                </p>\r\n\r\n                #if( $ufAdditionalInstruction && $ufAdditionalInstruction != "" )\r\n                <p margin-top="12px">\r\n                    <b>$!ufVotingState\'s Additional Requirements:</b>\r\n                    <p margin-top="12px">\r\n                        $!ufAdditionalInstruction\r\n                    </p>\r\n                </p>\r\n                #end\r\n\r\n                <p margin-top="12px"></p>\r\n                <p margin-top="12px">\r\n                    <b>Further information and resources:</b>\r\n                    <p margin-top="12px">The YVO website provides many services that may be useful to you over the course of this election period including:</p>\r\n                    <ul margin-left="10px">\r\n                        <li margin-top="10px">\r\n                            <b>My Voter Account&#x2122;</b>\r\n                             - take advantage of this new service which makes it possible to keep an up-to-date voter profile on hand, maintain your mailing list profile, generate a new ballot request form or a write-in ballot with the click of a button\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Federal Write-in Absentee Ballot wizard</b>\r\n                            - the Federal Write-in Absentee Ballot finally made easy! This is a blank ballot for registered voters to use in the event that your ballot is late in arriving to you.\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>YVO Voter Help Desk&#x2122;</b>\r\n                             - fast and friendly answers to your voting questions\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>YVO Election Official Directory&#x2122;</b>\r\n                            - the most comprehensive listing of election office contact information available anywhere\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>	YVO State-specific Voter Information Directory&#x2122;</b>\r\n                            - state-by-state information bank providing details on deadlines, voter materials transmission options and state contact information\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Links to nonpartisan candidate information sites</b>\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>YVO news</b>\r\n                             - check the latest stories on overseas and military voting\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>YVO Mailing List</b>\r\n                             - help us to keep you informed through online communications\r\n                        </li>\r\n                    </ul>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Your next steps:</b>\r\n                    <ol margin-left="10px">\r\n                        <li margin-top="10px"><b>Send</b> in your signed, dated, original form by regular mail.</li>\r\n                        <li margin-top="10px">\r\n                            <b>Confirm</b> that you are on the voter rolls and will receive your $!electionYear  ballots:\r\n                            <p margin-top="12px"> </p>\r\n                            <p margin-top="12px">\r\n                                YVO recommends that you <a href="https://yvo.overseasvotefoundation.org/overseas/eod.htm">contact your election official</a> after sending your registration/ballot request form to confirm that you are on the rolls and will receive your ballots through the $!electionYear  election year.\r\n	 							#if ( !$leo.lovc.empty )\r\n								    <p margin-top="12px"><b>Overseas Voting Contact:</b></p>\r\n								    <p margin-top="12px">$!leo.lovc.firstName $!leo.lovc.lastName</p>\r\n								   	#if(!$leo.lovcPhone.equals(""))<p margin-top="12px">phone: $!leo.lovcPhone</p>#end\r\n								   	#if(!$leo.lovcFax.equals(""))<p margin-top="12px">fax: $!leo.lovcFax</p>#end\r\n								   	#if(!$leo.lovcEmail.equals(""))<p margin-top="12px">email: <a href="mailto:$!leo.lovcEmail">$!leo.lovcEmail</a></p>#end\r\n								#end\r\n								\r\n								#if ( !$leo.leo.empty )\r\n								    <p margin-top="12px"><b>Local Election Official:</b></p>\r\n								    <p margin-top="12px">$!leo.leo.firstName $!leo.leo.lastName</p>\r\n								   	#if(!$leo.leoPhone.equals(""))<p margin-top="12px">phone: $!leo.leoPhone</p>#end\r\n								   	#if(!$leo.leoFax.equals(""))<p margin-top="12px">fax: $!leo.leoFax</p>#end\r\n								   	#if(!$leo.leoEmail.equals(""))<p margin-top="12px">email: <a href="mailto:$!leo.leoEmail">$!leo.leoEmail</a></p>#end\r\n								#end\r\n								\r\n								#if ( $leo.leo.empty && $leo.lovc.empty )\r\n								<p margin-top="12px">Look up contact information in the Election Official Directory: <a href="https://yvo.overseasvotefoundation.org/overseas/eod.htm">yvo.overseasvotefoundation.org/overseas/eod.htm</a></p>\r\n								#end\r\n                            </p>\r\n                            <p margin-top="12px"> </p>\r\n                            <p margin-top="12px">\r\n                                Never take for granted that your ballot will simply arrive for the next election without confirming it.  Contact your election official and avoid surprises.\r\n                            </p>\r\n                        </li>\r\n                        <li margin-top="10px">\r\n                            <b>Check</b> your email account to make sure YVO can reach you:\r\n                            <p margin-top="12px"> </p>\r\n                            <p margin-top="12px">YVO sends notices to voters very infrequently.  We keep the volume way down, so that you know the emails we do send are for a good reason.</p>\r\n                            <p margin-top="12px"> </p>\r\n                            <p margin-top="12px">If you send us a note and don\'t get a reply, it would be because your email account, or your email provider, is blocking ours.  If you never get any email from YVO, it would also be due to this.</p>\r\n                            <p margin-top="12px"> </p>\r\n                            <p margin-top="12px">Please make sure that:</p>\r\n                            <p margin-top="12px"> </p>\r\n                            <ul margin-left="10px">\r\n                                <li margin-top="10px">The YVO domain ...@overseasvotefoundation.org is approved by your email filtering/spam program; or<p margin-top="12px"> </p></li>\r\n                                <li margin-top="10px">\r\n                                    Approve these three email addresses as "safe senders:"\r\n                                    <a href="mailto:info@overseasvotefoundation.org">info@overseasvotefoundation.org</a>,\r\n                                    <a href="mailto:support@overseasvotefoundation.org">support@overseasvotefoundation.org</a>\r\n                                    and\r\n                                    <a href="youth@overseasvotefoundation.org">youth@overseasvotefoundation.org</a><p margin-top="12px"> </p>\r\n                                </li>\r\n                                <li margin-top="10px">Look for a thank you note in your mailbox today!</li>\r\n                            </ul>\r\n                            <p margin-top="12px"> </p>\r\n                        </li>\r\n                    </ol>\r\n                </p>\r\n\r\n                <p margin-top="12px"></p>\r\n                <p margin-top="12px">\r\n                    <b>Ballot Back-up Plan</b>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px">\r\n                        Sometimes ballots arrive late.  Or not at all.  We hope that does not occur in your case.\r\n                        If you don\'t receive your requested ballot from your election office by <b>30 days</b> before the election,\r\n                        please visit our site to access the Federal Write-in Absentee Ballot wizard.\r\n                    </p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    <b>Thank you</b>\r\n                    <p margin-top="12px"> </p>\r\n                    <p margin-top="12px">\r\n                        Youth Vote Overseas is a nonprofit, nonpartisan public charity dedicated to facilitating overseas citizen\r\n                        and uniformed services voter participation in Federal elections.\r\n                        <b>Please consider making a <a href="https://yvo.overseasvotefoundation.org/yvo-donate">donation</a> to help keep YVO going!</b>\r\n                    </p>\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    We wish you a positive voting experience in the coming election,\r\n                </p>\r\n\r\n                <p margin-top="12px">\r\n                    Youth Vote Overseas\r\n                </p>\r\n                <p margin-top="12px">\r\n                    <a href="yvo.overseasvotefoundation.org">yvo.overseasvotefoundation.org</a>\r\n                </p>\r\n            </font>\r\n        </value>\r\n    </page>', '2011-12-20 14:29:18', 2),
	(27, 'FWAB', 18, '<page master="rava_third_page">\r\n        <date-printed>$!date_long</date-printed>\r\n        <first-name>$!ufFirstName</first-name>\r\n        <value>\r\n            <font size="11px" family="TrebuchetMS" line-height="5mm">\r\n\r\n			<p margin-top="12px">\r\n				<b>Federal Write-In Absentee Ballot - Instructions for Ballot Completion and Mailing</b>\r\n			</p>\r\n			<p margin-top="12px">\r\n				You have completed the Federal Write-In Absentee Ballot (FWAB) Voter\'s Declaration/Affirmation form process.\r\n			</p>\r\n\r\n			<p margin-top="12px">\r\n				<b>Print the downloaded documents:</b>\r\n				<ol margin-left="10px">\r\n					<li margin-top="10px">Instructions from Youth Vote Overseas - this page.</li>\r\n					<li margin-top="10px">The FWAB cover page which is titled: \'Voter\'s Declaration/Affirmation - Federal Write-In Absentee Ballot (FWAB)\'</li>\r\n					<li margin-top="10px">Addendum page - to accompany the cover page.</li>\r\n					<li margin-top="10px">Your Write-In Ballot which is titled: \'Official Federal Write-In Absentee Ballot\'</li>\r\n					<li margin-top="10px">As reference: The official Privacy Act Statement and FWAB completion information from the Federal Voting Assistance Program</li>\r\n				</ol>\r\n			</p>\r\n\r\n\r\n			<p margin-top="12px">\r\n				<b>Notarization, Oath and Witness Requirements</b>\r\n				<p margin-top="12px"> </p>\r\n				<p margin-top="12px">\r\n					Consult the YVO Voter Help Desk to confirm any current witness, notary and oath requirements for your state. These will be listed in the question category \'Federal Absentee Write-in Ballot\' as a response to \'What notarization, witness or oath signing requirements are there for my FWAB?\'\r\n				</p>\r\n			</p>\r\n\r\n\r\n			<p margin-top="12px">\r\n				<b>Signatures/Dates:</b>\r\n				<p margin-top="12px"> </p>\r\n				<p margin-top="12px">\r\n					Remember to <b>sign and date</b> the Voter\'s Declaration/Affirmation cover page and the Addendum page.\r\n				</p>\r\n			</p>\r\n\r\n\r\n			<p margin-top="12px">\r\n				<b>Vote - write-in your choices:</b>\r\n				<p margin-top="12px"> </p>\r\n				<p margin-top="12px">\r\n					Enter either the name of the candidates or their political party for each office you are voting for on your Official Federal Write-In Absentee Ballot.\r\n				</p>\r\n				<p margin-top="12px"> </p>\r\n				<p margin-top="12px"><b>President </b>---enter name of candidate, or name of party---</p>\r\n				<p margin-top="12px"><b>Vice President </b>---enter name of candidate, or name of party---</p>\r\n				<p margin-top="12px"><b>US Senate </b>---enter name of candidate, or name of party---</p>\r\n				<p margin-top="12px"><b>House of Representatives </b>---enter name of candidate, or name of party---</p>\r\n				<p margin-top="12px"> </p>\r\n			</p>\r\n\r\n			<p margin-top="12px">\r\n				<b>IMPORTANT Note</b> - you will need to provide 2 envelopes:\r\n				<ol margin-left="10px">\r\n					<li margin-top="10px"><b>A Ballot Security Envelope</b> to hold your voted ballot - Print <b>only</b> the words <b>"Security Envelope"</b> on the outside of the Ballot Security Envelope containing your Official Federal Write-In Absentee Ballot.  Make sure to seal your voted ballot within it.  Do <b>NOT</b> put your name or any other information on this envelope.</li>\r\n					<li margin-top="10px">A larger <b>Mailing Envelope</b> for the forms and the Ballot Security Envelope - Your mailing envelope should be large enough to contain the Cover Page and Addendum and your sealed Ballot Security Envelope containing your completed ballot.</li>\r\n				</ol>\r\n			</p>\r\n\r\n\r\n			#if( $ufAdditionalInstruction && $ufAdditionalInstruction != "" )\r\n			<p margin-top="12px">\r\n				<b>$!ufVotingState\'s Additional Requirements: </b>\r\n				<p margin-top="12px">\r\n					$!ufAdditionalInstruction\r\n				</p>\r\n			</p>\r\n			#end\r\n\r\n			<p margin-top="12px">\r\n				<b>Mailing address: </b>Mail your FWAB to your local election office at the following address:\r\n				<p margin-top="12px" margin-left="20px">$!envelope_address</p>\r\n			</p>\r\n			<p margin-top="12px" margin-left="20px">Your election official can be reached as follows:</p>\r\n			<p margin-left="20px">\r\n				#if(!$leo.lovc.firstName.equals(""))<b>$!leo.lovc.firstName $!leo.lovc.lastName</b>#end\r\n				#if($leo.lovc.firstName.equals("") && !$leo.leo.firstName.equals(""))<b>$!leo.leo.firstName $!leo.leo.lastName</b>#end\r\n			</p>\r\n			<p margin-left="20px">\r\n				#if(!$leo.lovcEmail.equals(""))Email: <b><a href="mailto:$!leo.lovcEmail">$!leo.lovcEmail</a></b>#end\r\n				#if($leo.lovcEmail.equals("") && !$leo.leoEmail.equals(""))Email: <b><a href="mailto:$!leo.leoEmail">$!leo.leoEmail</a></b>#end\r\n			</p>\r\n			<p margin-left="20px">\r\n				#if(!$leo.lovcPhone.equals(""))Phone <b>$!leo.lovcPhone</b>#end\r\n				#if($leo.lovcPhone.equals("") && !$leo.leoPhone.equals(""))Phone <b>$!leo.leoPhone</b>#end\r\n			</p>\r\n			<p margin-left="20px">\r\n				#if(!$leo.lovcFax.equals(""))Fax: <b>$!leo.lovcFax</b>#end\r\n				#if($leo.lovcFax.equals("") && !$leo.leoFax.equals(""))Fax: <b>$!leo.leoFax</b>#end\r\n		   </p>\r\n\r\n			<p margin-top="12px">\r\n				<p margin-top="12px"><b>Return address: </b>Remember to put your return address on the outside of the envelope/</p>\r\n			</p>\r\n\r\n			<p margin-top="12px">\r\n				<b>Postage:</b>\r\n				<p margin-top="12px"> </p>\r\n				<p margin-top="12px"><b>Overseas Citizens: </b>Take your FWAB to the local overseas post office to obtain the correct international airmail postage and to have your envelope postmarked from outside the US.</p>\r\n				<p margin-top="12px"> </p>\r\n				<p margin-top="12px"><b>Uniformed Services: </b>If you are mailing your FWAB from within the APO/FPO system, a Diplomatic Pouch, or U.S. Mail, please confirm and affix the correct postage.</p>\r\n			</p>\r\n\r\n\r\n			<p margin-top="12px">\r\n				<b><i>Thank you for using YVO\'s voter services!</i></b>\r\n			</p>\r\n\r\n\r\n		</font>\r\n        </value>\r\n    </page>', '2011-12-20 14:29:10', 2),
	(28, 'RAVA', 32, '<page master="rava_third_page">\r\n        <date-printed>$!date_long</date-printed>\r\n        <first-name>$!ufFirstName</first-name>\r\n        <value>\r\n            <font size="11px" family="TrebuchetMS" line-height="5mm">\r\n<p margin-top="12px">Thank you for using the Bernalillo County Overseas and Military Voter Services website and our Voter Registration/Ballot Request form process. Please follow the 5 steps below to complete the application process.</p>\r\n<p margin-top="12px"><b>1. Check your documents:</b></p>\r\n<ul margin-left="10px">\r\n	<li margin-top="10px">Verify your information</li>\r\n\r\n	<li margin-top="10px">If corrections are needed, return to the Bernalillo County Overseas and Military Voter Services website, <a href="http://bernalillo.overseasvotefoundation.org">http://bernalillo.overseasvotefoundation.org</a> to correct and download new forms.</li>\r\n	</ul>\r\n<p margin-top="12px"><b>2. Print, sign and check the date on your forms:</b></p>\r\n	<ul margin-left="10px">\r\n	<li margin-top="10px">Sign your Voter Registration/Ballot Request form and addendum page. Your election official requires your ORIGINAL SIGNATURE on the forms.</li>\r\n	<li margin-top="10px"><b>Address your envelope to your local election office:</b><br/>\r\n	$!envelope_address\r\n	</li>\r\n</ul>	\r\n<p margin-top="12px"><b>3. Send in your Signed, Dated Original Form:</b></p>\r\n<ul margin-left="10px">\r\n	<li margin-top="10px">Bernalillo County accepts Postal Mail, FAX and Email transmission of your confidential election materials to your local election official.</li>\r\n	<li margin-top="10px">Postal Mail: please send from a post office instead of a mailbox and, if possible, get the envelope legibly postmarked with the date of mailing.</li>\r\n	<li margin-top="10px">Fax or Email + Post the original: You may to fax or email the form to speed processing; however, it must be followed by a posted hardcopy form with your original signature by mail in order to?be a valid application. In addition, electronic transmission is not considered a secure transmission for your confidential personal information. Consult the Bernalillo County Voter Information Directory for options for sending in your application.</li>\r\n</ul>\r\n<p margin-top="12px"><b>4. Confirm that you are on the voter rolls and will receive your ballots.</b></p>\r\n	<ul margin-left="10px">\r\n	<li margin-top="10px">We recommend that you contact your local election official after sending in your application to confirm that it has been received and approved, and that you will receive your ballots throughout the year.</li>\r\n	<li margin-top="10px">\r\n	 #if (!$leo.lovc.empty)\r\n	<b>Overseas Voting Contact:</b><br/>\r\n 	<p margin-bottom="2px">$!leo.lovc.firstName $!leo.lovc.lastName</p>\r\n	#if(!$leo.lovcPhone.equals(""))<p margin-bottom="2px">phone: $!leo.lovcPhone</p>#end\r\n	#if(!$leo.lovcFax.equals(""))<p margin-bottom="2px">fax: $!leo.lovcFax</p>#end\r\n    #if(!$leo.lovcEmail.equals(""))<p margin-bottom="2px">email: <a href="mailto:$!leo.lovcEmail">$!leo.lovcEmail</a></p>#end\r\n	#end\r\n	</li>\r\n	<li margin-top="10px">\r\n	#if (!$leo.leo.empty)\r\n    <b>Local Election Official:</b><br/>\r\n    <p margin-bottom="2px">$!leo.leo.firstName $!leo.leo.lastName</p>\r\n	#if(!$leo.leoPhone.equals(""))<p margin-bottom="2px">phone: $!leo.leoPhone</p>#end\r\n	#if(!$leo.leoFax.equals(""))<p margin-bottom="2px">fax: $!leo.leoFax</p>#end\r\n	#if(!$leo.leoEmail.equals(""))<p margin-bottom="2px">email: <a href="mailto:$!leo.leoEmail">$!leo.leoEmail</a></p>#end\r\n#end</li>\r\n	<li margin-top="10px">Never assume that your ballot will simply arrive for the next election. Contact your election official and avoid surprises.</li>\r\n	</ul>\r\n<p margin-top="12px"><b>5. Mark Your Calendar and Be Prepared to Use a Back-Up Ballot?</b></p>\r\n<ul margin-left="10px">\r\n<li margin-top="10px">Sometimes ballots arrive late. If you haven\'t received your official ballot 30 days before the election, return to the Bernalillo County Overseas and Military Voter Services website and use the Federal Write-In Absentee Ballot.</li>\r\n</ul>\r\n\r\n<p margin-top="12px">Thank you!</p>\r\n<p margin-top="12px">We wish you a positive voting experience in the coming election,<br /> \r\nFrom the team at the Bernalillo County Office of the County Clerk</p>\r\n\r\n</font>\r\n        </value>\r\n    </page>', '2012-09-19 15:44:10', 2),
	(29, 'RAVA', 6, '<page master="rava_third_page">\r\n        <date-printed>$!date_long</date-printed>\r\n        <first-name>$!ufFirstName</first-name>\r\n        <value>\r\n            <font size="11px" family="TrebuchetMS" line-height="5mm">\r\n<p margin-top="12px">Thank you for using the Ohio Voter Registration/Ballot Request form process. Please follow the 3 steps below to complete the application process:</p>\r\n\r\n<p margin-top="12px">1. Check your FPCA form and verify that the information is correct. If changes are needed, go back to the Ohio registration system, <a href="http://www.ohio.overseasvotefoundation.org">www.ohio.overseasvotefoundation.org</a> and update your information.</p>\r\n\r\n<p margin-top="12px">2. Sign and date your FPCA form (Box 7)</p>\r\n\r\n<p margin-top="12px">3. Send the completed FPCA form to your County Board of Elections <br/> \r\nOR to the Ohio Secretary of State\'s Office</p>\r\n\r\n#if (!$envelope_address.empty)\r\n	<p margin-top="12px"><b>By Mail:</b></p>\r\n	<p margin-bottom="5px" margin-left="50px"> $!envelope_address</p>\r\n#end\r\n	\r\n#if(!$leo.lovcEmail.equals(""))\r\n	<p margin-bottom="5px"><b>By Email:</b> <a href="mailto:$!leo.lovcEmail">$!leo.lovcEmail</a></p>\r\n#end\r\n#if(!$leo.lovcFax.equals(""))\r\n	<p margin-bottom="2px"><b>By Fax:</b> $!leo.lovcFax</p>\r\n#end\r\n\r\n<p margin-top="12px"><b>By Mail:</b></p>\r\n<p margin-bottom="0px" margin-left="50px">Secretary of State</p>\r\n<p margin-bottom="0px" margin-left="50px">P.O. Box 2828</p>\r\n<p margin-bottom="5px" margin-left="50px">Columbus, OH 43216-2828</p>\r\n<p margin-bottom="0px"><b>By Email:</b></p>\r\n<p margin-bottom="0px" margin-left="50px"><b>Military Voters:</b> <a href="mailto:OMV@OhioSecretaryofState.gov">OMV@OhioSecretaryofState.gov</a></p>\r\n<p margin-bottom="5px" margin-left="50px"><b>Overseas Voters:</b> <a href="OVP@OhioSecretaryofState.gov">OVP@OhioSecretaryofState.gov</a>\r\n</p>\r\n<p margin-bottom="2px"><b>By Fax:</b> (614) 485-7690</p>\r\n\r\n<p margin-top="12px"><b>What\'s Next?</b></p>\r\n<p margin-top="12px">It\'s a good idea to confirm that your form was received. The contact information for the Board of Elections is:</p> \r\n\r\n#if (!$leo.lovc.empty)\r\n	<p margin-bottom="5px" margin-top="10px"><b>Overseas Voting Contact:</b></p>\r\n 	<p margin-bottom="2px">$!leo.lovc.firstName $!leo.lovc.lastName</p>\r\n	#if(!$leo.lovcPhone.equals(""))<p margin-bottom="2px">phone: $!leo.lovcPhone</p>#end\r\n    #if(!$leo.lovcEmail.equals(""))<p margin-bottom="2px">email: <a href="mailto:$!leo.lovcEmail">$!leo.lovcEmail</a></p>#end\r\n#end\r\n\r\n#if (!$leo.leo.empty)\r\n    <p margin-bottom="5px" margin-top="10px"><b>Local Election Official:</b></p>\r\n    <p margin-bottom="2px">$!leo.leo.firstName $!leo.leo.lastName</p>\r\n	#if(!$leo.leoPhone.equals(""))<p margin-bottom="2px">phone: $!leo.leoPhone</p>#end\r\n	#if(!$leo.leoEmail.equals(""))<p margin-bottom="2px">email: <a href="mailto:$!leo.leoEmail">$!leo.leoEmail</a></p>#end\r\n#end\r\n\r\n<p margin-top="12px"><b>We\'re Here For You!</b></p>\r\n\r\n<p margin-top="12px">Connect with the Ohio Secretary of State for election info, email alerts and contacts and to learn more about the Ohio voting process.</p>\r\n\r\n<p margin-top="12px">\r\n<b>For Military Ohioans:</b> <a href="www.OhioMilitaryVotes.com">www.OhioMilitaryVotes.com</a><br />\r\n<b>For Overseas Ohioans:</b> <a href="http://www.OhioVoterPassport.com">www.OhioVoterPassport.com</a><br />\r\n<b>Phone:</b> 614.995.1697\r\n</p></font>\r\n        </value>\r\n    </page>', '2012-10-06 03:21:26', 2),
	(30, 'FWAB', 6, '<page master="rava_third_page">\r\n        <date-printed>$!date_long</date-printed>\r\n        <first-name>$!ufFirstName</first-name>\r\n        <value>\r\n            <font size="11px" family="TrebuchetMS" line-height="5mm">\r\n<p margin-top="12px"><b>IMPORTANT Instructions and Information</b></p>\r\n\r\n<p margin-top="12px">You have used the Ohio Vote-Print-Mail Ballot system to generate a Federal Write-In Absentee Ballot (FWAB). Please follow these instructions to complete the process and submit the ballot to your Ohio county board of elections office.</p>\r\n\r\n<p margin-top="12px"><b>The file you downloaded should contain the following documents:</b></p> \r\n\r\n<p margin-left="25px" margin-bottom="2px">1. IMPORTANT Instructions and Information - (first 2 pages) </p>\r\n\r\n<p margin-left="25px" margin-bottom="2px">2. The FWAB cover page which is titled: \'Voter\'s Declaration/Affirmation - Federal Write-In Absentee Ballot (FWAB). THIS IS PART OF YOUR BALLOT</p>\r\n\r\n<p margin-left="25px" margin-bottom="2px">3. Your BALLOT which is titled: \'Official Federal Write-In Absentee Ballot\' THIS IS PART OF YOUR BALLOT</p>\r\n\r\n<p margin-left="25px" margin-bottom="2px">4. The official Privacy Act Statement from the Federal Voting Assistance Program. </p>\r\n\r\n<p margin-top="12px"><b>Instructions:</b></p>\r\n\r\n<p margin-left="25px" margin-bottom="5px"><b>1.	Finish filling out the FWAB cover page</b></p>\r\n\r\n<p margin-left="50px" margin-bottom="2px">a.	Check your FPCA form and verify that the information is correct. If changes are needed, go back to the Ohio registration system, <a href="https://www.ohio.overseasvotefoundation.org">www.ohio.overseasvotefoundation.org</a> and update your information.</p>\r\n\r\n<p margin-left="50px" margin-bottom="2px">b. Be sure to sign and date!</p>\r\n\r\n<p margin-left="25px" margin-bottom="5px" margin-top="10px"><b>2.	Fill out your Ballot</b></p>\r\n\r\n<p margin-left="50px" margin-bottom="2px">a.	Make sure that your ballot was properly completed with candidate choices you intended to make. If changes are needed, go back to the Ohio registration system, www.ohio.overseasvotefoundation.org and update your form.</p>\r\n\r\n<p margin-left="50px" margin-bottom="2px">b.	The only candidate names printed on your ballot will be federal candidates. If you wish to vote on state and local candidates and issues, use the extra blank lines on the ballot page for this purpose.</p>\r\n\r\n<p margin-left="50px" margin-bottom="2px">c.	If you wish to see the local candidates and issues on your ballot, go to your <a href="http://www.sos.state.oh.us/SOS/elections/electionsofficials/boeDirectory.aspx">county board of elections office website</a></p>\r\n\r\n<p margin-left="50px" margin-bottom="2px">d.	Remember: You can start the FWAB process again. Your ballot is only valid and completed when submitted to your county board of elections office</p>\r\n\r\n<p margin-left="25px" margin-bottom="5px" margin-top="10px"><b>3.	Send Your Completed Ballot (you will need 2 envelopes)</b></p>\r\n\r\n<p margin-left="50px" margin-bottom="2px">a.	Put your completed ballot in the first envelope and write the words "Security Envelope" on the front. Seal the envelope and do NOT write your name or any other markings.</p>\r\n\r\n<p margin-left="50px" margin-bottom="2px">b.	Put the "Security Envelope" inside of the second envelope, along with your Voters Declaration/Affirmation. Seal the envelope.</p>\r\n\r\n#if (!$envelope_address.empty)\r\n	<p margin-left="50px" margin-bottom="2px">c.	Write this address on the front of your envelope.</p>\r\n	<p margin-bottom="5px" margin-left="50px"> $!envelope_address</p>\r\n#end\r\n\r\n<p margin-left="50px" margin-bottom="2px">d.	Remember to also write your return address on the outside of the envelope.</p>\r\n\r\n<p margin-left="50px" margin-bottom="2px">e.	Postage:</p>\r\n\r\n<p margin-left="100px" margin-bottom="2px">i.	<b>Uniformed Services:</b> If you are mailing your FWAB from within the APO/FPO system, a Diplomatic Pouch, or U.S. Mail, please confirm and affix the correct postage.</p>\r\n\r\n<p margin-left="100px" margin-bottom="2px">ii.<b>Overseas Citizens:</b> Take your FWAB to the local overseas post office to obtain the correct international airmail postage.</p>\r\n\r\n<p margin-top="12px"><b>What\'s Next?</b></p>\r\n<p margin-top="12px">It\'s a good idea to confirm that your form was received. The contact information for the Board of Elections is:</p> \r\n\r\n#if (!$leo.lovc.empty)\r\n	<p margin-bottom="5px" margin-top="10px"><b>Overseas Voting Contact:</b></p>\r\n 	<p margin-bottom="2px">$!leo.lovc.firstName $!leo.lovc.lastName</p>\r\n	#if(!$leo.lovcPhone.equals(""))<p margin-bottom="2px">phone: $!leo.lovcPhone</p>#end\r\n    #if(!$leo.lovcEmail.equals(""))<p margin-bottom="2px">email: <a href="mailto:$!leo.lovcEmail">$!leo.lovcEmail</a></p>#end\r\n#end\r\n\r\n#if (!$leo.leo.empty)\r\n    <p margin-bottom="5px" margin-top="10px"><b>Local Election Official:</b></p>\r\n    <p margin-bottom="2px">$!leo.leo.firstName $!leo.leo.lastName</p>\r\n	#if(!$leo.leoPhone.equals(""))<p margin-bottom="2px">phone: $!leo.leoPhone</p>#end\r\n	#if(!$leo.leoEmail.equals(""))<p margin-bottom="2px">email: <a href="mailto:$!leo.leoEmail">$!leo.leoEmail</a></p>#end\r\n#end\r\n\r\n<p margin-top="12px"><b>We\'re Here For You!</b></p>\r\n\r\n<p margin-top="12px">Connect with the Ohio Secretary of State for election info, email alerts and contacts and to learn more about the Ohio voting process.</p>\r\n\r\n<p margin-top="12px"><b>For Military Ohioans:</b> <a href="www.OhioMilitaryVotes.com">www.OhioMilitaryVotes.com</a></p>\r\n<p margin-top="12px"><b>For Overseas Ohioans:</b> <a href="http://www.OhioVoterPassport.com">www.OhioVoterPassport.com</a></p>\r\n<p margin-top="12px"><b>Phone:</b> 614.995.1697</p>\r\n\r\n</font>\r\n        </value>\r\n    </page>', '2012-10-06 04:22:46', 2);
