INSERT INTO `pdf_fillings` (`id`, `name`, `in_pdf_name`, `text`) VALUES
	(174, 'Notorization NOT Req\'ed', 'ufSigned', '<i>NOT REQUIRED</i>'),
	(175, 'Texas No ID Statement', 'ufAddendum', '<p> </p><p> </p><p>As voter identification, Texas requests a valid TX driver\'s license, a Personal ID Number, or the last 4 digits of your social security card.  If you have none of these identification numbers, you must state that fact here:</p>'),
	(180, 'Wasington DC (no ID)', 'ufDriverLicense', 'NONE'),
	(181, 'Opt out of all ID - No Reqs - WILL Assign', 'ufAddendum', '<p> </p><p> </p><p>The Federal Voting Assistance Guide indicates that $!ufVotingState does not require ID for voter registration and ballot request for overseas and military citizens, hence no ID has been provided.</p><p>_____________________________________________</p>'),
	(182, 'Opt out of all ID - SSN4/DL - WILL Assign', 'ufAddendum', '<p> </p><p> </p><p>I do not possess the requested ID. Please assign me an ID for voting purposes.</p><p>_____________________________________________</p>'),
	(183, 'Opt out of all ID - SSN9/DL - WILL Assign', 'ufAddendum', '<p> </p><p> </p><p>I do not possess the requested ID. Please assign me an ID for voting purposes.</p><p>_____________________________________________</p>'),
	(184, 'Opt out of all ID - SSN4/DL/StateID - WILL Assign', 'ufAddendum', '<p> </p><p> </p><p>I do not possess the requested ID. Please assign me an ID for voting purposes.</p><p>_____________________________________________</p>'),
	(185, 'Opt out of all ID - SSN9 - WILL Assign', 'ufAddendum', '<p> </p><p> </p><p>I do not possess the requested ID. Please assign me an ID for voting purposes.</p><p>_____________________________________________</p>'),
	(186, 'Vermont Voter\'s Oath', 'ufAddendum', '<p><b>Voter\'s Oath:</b> I solemnly swear (or affirm) that whenever I give my vote or suffrage, touching any matter that concerns the State of Vermont, I will do it so as in my conscience I shall judge will most conduce to the best good of the same, as established by the Constitution, without fear or favor of any person.</p>\r\n<p></p>\r\n<p>On the __ day of _______________, 20__, I swore or affirmed the Vermont voter\'s oath</p>\r\n<p>( Your signature is required below. Vermont does not require a Witness/Notary signature)</p>'),
	(187, 'Opt out of all ID - SSN4/DL - WILL NOT Assign', 'ufAddendum', '<p> </p><p> </p><p>The Federal Voting Assistance Guide indicates that $!ufVotingState requires a specific ID for voter registration and ballot request for overseas and military citizens.  I do not possess the required state ID, hence no ID has been provided.</p>\r\n<p>Thank you.</p><p>_____________________________________________</p>'),
	(188, 'OK - no ID', 'ufAddendum', '<p> </p><p> </p><p>The Federal Voting Assistance Guide indicates that $!ufVotingState requires a specific ID for voter registration and ballot request for overseas and military citizens.  I do not possess the required state ID, hence no ID has been provided.</p>\r\n<p>Thank you.</p><p>_____________________________________________</p>'),
	(189, 'Opt out of all ID - SSN4/DL/StateID - WILL NOT Assign', 'ufAddendum', '<p> </p><p> </p><p>The Federal Voting Assistance Guide indicates that $!ufVotingState requires a specific ID for voter registration and ballot request for overseas and military citizens.  I do not possess the required state ID, hence no ID has been provided.</p><p>_____________________________________________</p>'),
	(190, 'Opt out of all ID - SSN9 - WILL NOT Assign', 'ufAddendum', '<p> </p><p> </p><p>The Federal Voting Assistance Guide indicates that $!ufVotingState requires a specific ID for voter registration and ballot request for overseas and military citizens.  I do not possess the required state ID, hence no ID has been provided.</p>\r\n<p>Thank you.</p><p>_____________________________________________</p>'),
	(193, 'Vermont No Oath', 'ufAdditionalInfo', '<b>Voter\'s Oath:</b> I have previously been registered to vote in Vermont and thus have already taken the Voter\'s Oath.'),
	(194, ' Notorization NOT Req\'ed - VT', 'ufAddendum', '<p>I attest that I have taken the Vermont voter\'s oath</p>'),
	(195, 'TN - No SSN - write none', 'ufSSN', 'none'),
	(207, 'MN-Notice of ID requirements', 'ufAdditionalInstruction', '<p>If you have a US Passport Number, Minnesota Driver\'s License number, Minnesota ID card number                		or the last four digits of your Social Security number, you must provide one of them. Please                		verify that this information is accurate on your form in the Identification section, field 2f                		or 2g.  Please remember which number you provide, because you will need to provide the same                		number when you return your ballot.</p>               	<p margin-top="12px">					If you do not have any of the documents or ID numbers available to you, you may still submit 					your application.  It will be accepted as long as you attest to the truthfulness of the contents 					of this application under penalty of perjury.				</p>\r\n'),
	(208, 'Colorado-specific', 'ufAddendum', '<p> </p><p> </p><p>I am a $!CO_citizenship citizen.</p>\r\n<p>_____________________________________________</p>\r\n'),
	(210, 'AS Addendum Page', 'ufAddendum', '<p> </p><p> </p><p>1. I am currently $!ufAS_Age years old.</p>\r\n<p> </p>\r\n<p>2. My current place of employment is: $!ufEmployerName.</p>\r\n<p> </p>\r\n<p>3. I $!ufAS_Attest to the following statement:  My last American Samoa residence was acquired with the intent to make American Samoa my legal residence. </p>\r\n<p>_____________________________________________</p>'),
	(228, 'Addendum Page', 'ufAddendum', '#if( $ufVotingDescription && $ufVotingDescription != "" )\r\n<p> </p><p> </p><p>I do not remember my exact address, but I can describe it as follows:</p>\r\n<p>$!ufVotingDescription</p>\r\n<p>_____________________________________________</p>\r\n#end\r\n\r\n#if( $optional_ssn_will && $optional_ssn_will != "" )\r\n<p> </p><p> </p><p> </p><p> </p><p>I do not possess the requested ID. To aid in identification, I am providing the last four digits of my Social Security number: $!optional_ssn_will.</p>\r\n<p>_____________________________________________</p>\r\n#end\r\n\r\n#if( $ufOptionalPassportWill && $ufOptionalPassportWill != "" )\r\n<p> </p><p> </p><p> </p><p> </p><p>I do not possess the requested ID. To aid in identification, I am providing my U.S. Passport number which is: $!ufOptionalPassportWill. Please assign me an ID for voting purposes.</p><p>_____________________________________________</p>\r\n#end\r\n\r\n#if( $ufOptionalPassportWillNot && $ufOptionalPassportWillNot != "" )\r\n<p> </p><p> </p><p> </p><p> </p><p>I am unable to provide the requested ID information. I am providing my U.S. Passport number which is: $!ufOptionalPassportWillNot. Please contact me if this poses any problem and let me know how it can be resolved.</p>\r\n<p>Thank you.</p><p>_____________________________________________</p>\r\n#end\r\n\r\n#if( $ufOptionalMilitaryIdWill && $ufOptionalMilitaryIdWill != "" )\r\n<p> </p><p> </p><p> </p><p> </p><p>I do not possess the requested ID. To aid in identification, I am providing my U.S. Military ID number which is: $!ufOptionalMilitaryIdWill. Please assign me an ID for voting purposes.</p><p>_____________________________________________</p>\r\n#end\r\n\r\n#if( $ufOptionalMilitaryIdWillNot && $ufOptionalMilitaryIdWillNot != "" )\r\n<p> </p><p> </p><p> </p><p> </p><p>I am unable to provide the requested ID information. I am providing my U.S. Military ID number which is: $!ufOptionalMilitaryIdWillNot. Please contact me if this poses any problem and let me know how it can be resolved.</p>\r\n<p>Thank you.</p><p>_____________________________________________</p>\r\n#end\r\n\r\n#if( $ufNoReqSsnWill && $ufNoReqSsnWill != "" )\r\n<p> </p><p> </p><p> </p><p> </p><p>The Federal Voting Assistance Guide indicates that $!ufVotingState does not require ID for voter registration and ballot request for overseas and military citizens, however I am providing the last four digits of my Social Security Number to aid in verifying my identity: $!fufNoReqSsnWill.</p><p>_____________________________________________</p>\r\n#end\r\n\r\n#if( $ufNoReqPassportWill && $ufNoReqPassportWill != "" )\r\n<p> </p><p> </p><p> </p><p> </p><p>The Federal Voting Assistance Guide indicates that $!ufVotingState does not require ID for voter registration and ballot request for overseas and military citizens, however I am providing my Passport Number to aid in verifying my identity: $!ufNoReqPassportWill.</p><p>_____________________________________________</p>\r\n#end\r\n\r\n\r\n#if( $ufAdditionalNotes && $ufAdditionalNotes != "" )\r\n<p> </p><p> </p><p> </p><p> </p><p><strong>Additional Note to Local Election Official:</strong></p>\r\n<p>$!ufAdditionalNotes</p>\r\n<p>_____________________________________________</p>\r\n#end'),
	(234, 'Fax', 'ufForwardingFax', '#if ( $ufFaxForward && $ufFaxForward != "" )  $!ufFaxForward\r\n#end'),
	(236, 'For how long (forwarding duration)', 'ufAdditionalInfo', '#if($ufForHowLong and $ufForHowLong ne "")Please send ballots to me at the indicated address $!ufForHowLong\r\n#end'),
	(237, 'AZ Drivers', 'ufAddendum', '<p> </p><p> </p><p>To comply with the Arizona \'Proof of Citizenship\' requirement for overseas and uniformed services voters, I am providing my valid Arizona driver license number: $!ufAZ_Drivers.</p>\r\n<p>_____________________________________________</p>'),
	(238, 'AZ Non-Operators', 'ufAddendum', '<p> </p><p> </p><p>To comply with the Arizona \'Proof of Citizenship\' requirement for overseas and uniformed services voters, I am providing my non-operating identification license issued after October 1, 1996: $!ufAZ_Nonop.</p>\r\n<p>_____________________________________________</p>'),
	(239, 'AZ Indian', 'ufAddendum', '<p> </p><p> </p><p>To comply with the Arizona \'Proof of Citizenship\' requirement for overseas and uniformed services voters, I am providing my Bureau of Indian Affairs Card Number: $!ufAZ_Indian.</p>\r\n<p>_____________________________________________</p>'),
	(240, 'AZ Treaty card', 'ufAddendum', '<p> </p><p> </p><p>To comply with the Arizona \'Proof of Citizenship\' requirement for overseas and uniformed services voters, I am providing my Tribal Treaty Card Number: $!ufAZ_Treaty.</p>\r\n<p>_____________________________________________</p>'),
	(241, 'AZ Tribal', 'ufAddendum', '<p> </p><p> </p><p>To comply with the Arizona \'Proof of Citizenship\' requirement for overseas and uniformed services voters, I am providing my Tribal Enrollment Number: $!ufAZ_Tribal.</p>\r\n<p>_____________________________________________</p>'),
	(242, 'AZ Naturalization', 'ufAddendum', '<p> </p><p> </p><p>To comply with the Arizona \'Proof of Citizenship\' requirement for overseas and uniformed services voters, I am providing the number of my Certificate of Naturalization: $!ufAZ_Naturalization.</p>\r\n<p>_____________________________________________</p>'),
	(243, 'AZ Birth Certificate', 'ufAddendum', '<p> </p><p> </p><p>To comply with the Arizona \'Proof of Citizenship\' requirement for overseas and uniformed services voters, I am providing my birth certificate accompanied by any legal documents supporting any name change. A legible photocopy of this (these) document(s) is enclosed with this application.</p>\r\n<p>_____________________________________________</p>'),
	(244, 'AZ Passport Pages', 'ufAddendum', '<p> </p><p> </p><p>To comply with the Arizona \'Proof of Citizenship\' requirement for overseas and uniformed services voters, I am providing ID pages of my US Passport. A legible photocopy of this document is enclosed with this application.</p>\r\n<p>_____________________________________________</p>'),
	(245, 'AZ Naturalization Documents', 'ufAddendum', '<p> </p><p> </p><p>To comply with the Arizona \'Proof of Citizenship\' requirement for overseas and uniformed services voters, I am providing my U.S. Naturalization documents. A legible photocopy of this document is enclosed with this application.</p>\r\n<p>_____________________________________________</p>'),
	(246, 'AZ Tribal Certificate', 'ufAddendum', '<p> </p><p> </p><p>To comply with the Arizona \'Proof of Citizenship\' requirement for overseas and uniformed services voters, I am providing my Tribal Certificate of Indian Blood. A legible photocopy of this document is enclosed with this application.</p>\r\n<p>_____________________________________________</p>'),
	(247, 'AZ Affidavit of Birth', 'ufAddendum', '<p> </p><p> </p><p>To comply with the Arizona \'Proof of Citizenship\' requirement for overseas and uniformed services voters, I am providing my Tribal or Bureau of Indian Affairs Affidavit of birth. A legible photocopy of this document is enclosed with this application.</p>\r\n<p>_____________________________________________</p>'),
	(248, 'AZ Birth Certificate - Note in Letter', 'ufAdditionalInstruction', '<p><b>Important Documents to Include With Your Application</b>To comply with the Arizona \'Proof of Citizenship\' requirement for overseas and uniformed services voters, you must enclose a legible photocopy of your birth certificate accompanied by any legal documents supporting any name change.</p>'),
	(249, 'AZ Passport Pages - Note in Letter', 'ufAdditionalInstruction', '<p><b>Important Documents to Include With Your Application</b>To comply with the Arizona \'Proof of Citizenship\' requirement for overseas and uniformed services voters, you must enclose a legible photocopy of your US Passport.</p>'),
	(250, 'AZ Naturalization Documents - Note in Letter', 'ufAdditionalInstruction', '<p><b>Important Documents to Include With Your Application</b>To comply with the Arizona \'Proof of Citizenship\' requirement for overseas and uniformed services voters, you must enclose a legible photocopy of your U.S. Naturalization documents.</p>'),
	(251, 'AZ Tribal Certificate - Note in Letter', 'ufAdditionalInstruction', '<p><b>Important Documents to Include With Your Application</b>To comply with the Arizona \'Proof of Citizenship\' requirement for overseas and uniformed services voters, you must enclose a legible photocopy of your Tribal Certificate of Indian Blood.</p>'),
	(252, 'AZ Affidavit of Birth - Note in Letter', 'ufAdditionalInstruction', '<p><b>Important Documents to Include With Your Application</b>To comply with the Arizona \'Proof of Citizenship\' requirement for overseas and uniformed services voters, you must enclose a legible photocopy of your Tribal or Bureau of Indian Affairs Affidavit of birth.</p>'),
	(253, 'FL Previous Voter', 'ufAddendum', '<p> </p><p> </p><p>I last registered and voted on Election Day in $!ufPreviousCounty, $!ufPreviousState.</p>\r\n<p></p>\r\n<p></p>\r\n'),
	(254, 'State-specific - Never Voted', 'ufAddendum', '<p> </p><p> </p><p>I am a first time voter</p><p>_____________________________________________</p>'),
	(255, 'ID previous voter', 'ufAddendum', '<p> </p><p> </p><p>I have previously registered to vote or have voted in $!ufPreviousCounty, $!ufPreviousState.</p>\r\n<p>_____________________________________________</p>'),
	(256, 'ME previous voter', 'ufAddendum', '<p> </p><p> </p><p>I previously registered to vote or have voted before registering at the Maine address indicated on this application in the following state and municipality: $!ufPreviousState, $!ufPreviousCounty.</p>\r\n<p>_____________________________________________</p>'),
	(258, 'PR Notorization - note in Letter', 'ufAdditionalInstruction', '<p><b>Notarization Required:</b> Puerto Rico requires a notary signature.  Notarization can be obtained through a notary public, commissioned officer, consular officer or other authorized person.  Do not sign/date your form other than before the authorized notary.</p>'),
	(259, 'PR Parents names', 'ufAddendum', '<p> </p><p> </p><p>My mother\'s first name is: $!mothers_name.</p><p> </p><p>My father\'s first name is: $!fathers_name.</p>\r\n<p>_____________________________________________</p>'),
	(260, 'VA Home is available', 'ufAddendum', '<p> </p><p> </p><p>My Virginia home is still available to me.</p>\r\n<p>_____________________________________________</p>'),
	(261, 'VA Home is not available', 'ufAddendum', '<p> </p><p> </p><p>My Virginia home is not still available to me.</p>\r\n<p> </p><p>My last day of residency at my last Virginia voting residence address was $!ufVA_Date</p>\r\n<p>_____________________________________________</p>'),
	(262, 'VA previous voter', 'ufAddendum', '<p> </p><p> </p><p>I last registered and voted in $!ufPreviousCounty, $!ufPreviousState.</p>\r\n<p>_____________________________________________</p>'),
	(265, 'Virginia Fax Anytime', 'ufAddendum', 'TESTING'),
	(266, 'Virginia Civilian - Employer Information', 'ufAddendum', '<p>Name and address of employer:</p>\r\n<p><li>$!ufEmployerName</li>\r\n<li>$!ufEmployerAddress1, $!ufEmployerAddress2</li>\r\n<li>$!ufEmployerCity $!ufEmployerState</li>\r\n<li>$!ufEmployerPostalCode $!ufEmployerCountry</li></p>\r\n<p>_____________________________________________</p>'),
	(267, 'Virginia Fax Anytime', 'ufAddendum', '<p> </p><p> </p><p>I would like my ballot faxed to me.</p><p>I can receive faxes at any time.</p>\r\n<p>_____________________________________________</p>'),
	(268, 'Virginia Fax Limitations', 'ufAddendum', '<p> </p><p> </p><p>I would like my ballot faxed to me.</p><p>I can receive faxes between the following times: $!ufFaxFrom and $!ufFaxTill (hours are in Eastern Standard Time).</p>\r\n<p>_____________________________________________</p>'),
	(273, 'SSN', 'ufSSN', '#if( $ufSSN4 && $ufSSN4 != "" )\r\n$!ufSSN4\r\n#end\r\n\r\n#*\r\n#if( $optional_ssn_will && $optional_ssn_will != "" )\r\nLast four of SSN: $!optional_ssn_will\r\n#end\r\n*#\r\n\r\n#if( $ufNoReqSsnWill && $ufNoReqSsnWill != "" )\r\n$!ufNoReqSsnWill\r\n#end\r\n\r\n#if( $ufSSN9 && $ufSSN9 != "" )\r\n#*\r\n#if( $ufSSN9.length() == 9 )\r\n${fufSSN9.substring(0,3)}-${fufSSN9.substring(3,5)}-${fufSSN9.substring(5,9)}\r\n#else *#\r\n$!ufSSN9\r\n##end\r\n#end\r\n'),
	(274, 'ID Number', 'ufDriverLicense', '#if( $ufDriversLicense && $ufDriversLicense != "" )\r\n$!ufDriversLicense\r\n#end\r\n\r\n#if( $military_id && $military_id != "" )\r\n$!military_id\r\n#end\r\n\r\n#if( $ufOptionalMilitaryIdWill && $ufOptionalMilitaryIdWill != "" )\r\n$!ufOptionalMilitaryIdWill\r\n#end\r\n\r\n#if( $ufOptionalMilitaryIdWillNot && $ufOptionalMilitaryIdWillNot != "" )\r\n$!ufOptionalMilitaryIdWillNot\r\n#end\r\n\r\n#if( $ufPassportNumber && $ufPassportNumber != "" )\r\n$!ufPassportNumber\r\n#end\r\n\r\n#if( $ufOptionalPassportWill && $ufOptionalPassportWill != "" )\r\n$!ufOptionalPassportWill\r\n#end\r\n\r\n#if( $ufOptionalPassportWillNot && $ufOptionalPassportWillNot != "" )\r\nPassport Number: $!ufOptionalPassportWillNot\r\n#end\r\n\r\n#if( $ufNoReqPassportWill && $ufNoReqPassportWill != "" )\r\n$!ufNoReqPassportWill\r\n#end\r\n\r\n#if( $ufStateId && $ufStateId != "" )\r\n$!ufStateId\r\n#end'),
	(275, 'Brought to you by OVF', 'ufAdditionalInfo', '<p><b>Note:</b> This application was generated with online assistance provided by Overseas Vote Foundation www.overseasvotefoundation.org</p>'),
	(279, 'None. Please assign', 'ufDriverLicense', 'None. Please assign.'),
	(280, 'None. Please assign', 'ufDriverLicense', 'None. Please assign.'),
	(281, 'None. Please assign', 'ufDriverLicense', 'None. Please assign.'),
	(282, 'None. Please assign', 'ufDriverLicense', 'None. Please assign.'),
	(290, 'None - No Assign', 'ufDriverLicense', '(None)'),
	(291, 'None - No Assign', 'ufDriverLicense', '(None)'),
	(292, 'None - No Assign', 'ufDriverLicense', '(None)'),
	(293, 'None - No Assign', 'ufDriverLicense', '(None)'),
	(295, 'State Note - Alaska', 'ufAdditionalInstruction', '<p margin-left="10px">\r\n	<p margin-top="12px"><b>If you are temporarily overseas and intend to return to Alaska: </b></p>\r\n	<p margin-top="12px">When initially registering by mail from outside of Alaska "Proof of Alaska residency" is required. You must include a copy of a current driver\'s license, leave and earnings statement or any other type of documentation showing Alaska residency with your voter registration form. </p> \r\n	<p margin-top="12px">The state of Alaska Elections Division informs us that: If you are working overseas, even if it\'s indefinitely, you can still claim residency as your last known address as long as you have intent to return to Alaska. </p> \r\n	<p margin-top="12px">There is no time limit with regard to how long you can be out of state as long as you do not claim residency in another state outside of Alaska. </p> \r\n	<p margin-top="12px"><b>If you are indefinitely overseas and do not intend to return to Alaska: </b></p>\r\n	<p margin-top="12px">\r\n	Alternatively, if you are indefinitely overseas and do not intend to return to Alaska as a resident you may register as a <b>Federal Voter</b> and participate in only elections for Federal office (President, Vice President and Congressional offices). In addition to supplying your ID on the form, you must provide a copy of your valid passport, card of identity and registration, or other identification issued under the authority of the U.S. Secretary of State with this application. </p> \r\n	<p margin-top="12px">\r\n	If this is your case, makes sure that the following note is printed on the form in Block 6, or on the Addendum to your form: <i>I wish to register as a Federal voter and was last domiciled in Alaska prior to leaving the U.S.</i>\r\n	</p> \r\n</p>'),
	(297, 'State Note - American Samoa', 'ufAdditionalInstruction', '<p margin-top="12px">If you are registering to vote, versus being already registered and simply requesting a ballot, you must indicate:</p>\r\n\r\n<p margin-top="12px">\r\n      <ol margin-left="10px">\r\n        <li margin-top="10px">\r\n             Your age;\r\n           </li>\r\n               <li margin-top="10px">\r\n            Your current place of employment; \r\n                </li>           <li margin-top="10px">\r\n            A statement that your last American Samoa residence was "acquired with the intent to make American Samoa your legal residence." \r\n                </li>\r\n       </ol>\r\n</p>\r\n<p margin-top="12px">Please verify that the above information is accurately indicated on your Addendum Page.</p>\r\n\r\n\r\n<p margin-top="12px"><b>Notarization Required:</b> American Samoa requires a notary signature on your Voter Registration/Ballot Request form. Do not sign/date your form other than before the authorized notary.</p>\r\n\r\n<p margin-top="12px">Notarization can be obtained through a notary public, commissioned officer, consular officer or other authorized person. Many overseas voters go to the US Consulate or Embassy in their area to notarize their voting documents.</p>'),
	(298, 'State Note - Arizona', 'ufAdditionalInstruction', '<p margin-top="12px">Arizona requires you to provide "Proof of Citizenship" when voting from overseas.  You can meet this requirement if you provide one of the following:</p>\r\n\r\n<p margin-top="12px">\r\n        <ol margin-left="10px">\r\n         <li margin-top="10px">\r\n                    valid Arizona driver license number, or\r\n             </li>\r\n    <li margin-top="10px">\r\n                     non-operating identification license issued after October 1, 1996\r\n           </li>\r\n       </ol>\r\n</p>\r\n\r\n<p margin-top="12px"><b>OR</b>, any of the following numbers:</p>\r\n\r\n<p margin-top="12px">\r\n   <ol margin-left="10px">\r\n<li margin-top="10px">\r\n                     Bureau of Indian Affairs Card Number\r\n                </li>\r\n               <li margin-top="10px">\r\n                  Tribal Treaty Card Number\r\n           </li>\r\n               <li margin-top="10px">\r\n                    Tribal Enrollment Number\r\n          </li>\r\n               <li margin-top="10px">\r\n                    Number of Certificate of Naturalization\r\n          </li>\r\n        </ol>\r\n</p>\r\n\r\n<p margin-top="12px"><b>OR</b>, a legible photocopy of any of the following:</p>\r\n\r\n<p margin-top="12px">\r\n    <ol margin-left="10px">\r\n           <li margin-top="10px">\r\n                    Birth certificate accompanied by any legal documents supporting any name change (e.g. a marriage certificate)\r\n             </li>\r\n               <li margin-top="10px">\r\n                    ID pages of your US Passport;\r\n             </li>\r\n               <li margin-top="10px">\r\n                    U.S. Naturalization documents;\r\n   </li>\r\n                <li margin-top="10px">\r\n                    Tribal Certificate of Indian Blood\r\n          </li>\r\n               <li margin-top="10px">\r\n                  Tribal or Bureau of Indian Affairs Affidavit of birth\r\n               </li>\r\n       </ol>\r\n</p>\r\n\r\n<p margin-top="12px">Please verify that the "Proof of Citizenship" is either properly indicated on your indicated on your Addendum Page or enclose a legible photocopy as specified above.</p>'),
	(299, 'State Note - Colorado', 'ufAdditionalInstruction', '<p margin-top="12px">Colorado requires you to indicate whether you are a native born or naturalized citizen.  Please verify that this information is accurately indicated on your Addendum Page.</p>'),
	(300, 'State Note - Florida', 'ufAdditionalInstruction', '<p margin-top="12px">Florida requires that you provide complete information on where you last registered and voted on Election Day.  Please verify that this information is accurately included on your Addendum Page.</p>\r\n\r\n<p margin-top="12px">\r\n    <ol margin-left="10px">\r\n           <li margin-top="10px">\r\n                    County/State in which you last registered to vote; and\r\n            </li>\r\n               <li margin-top="10px">\r\n                    Any other relevant information about where you last registered and voted.\r\n         </li>\r\n       </ol>\r\n</p>'),
	(301, 'State Note - Idaho', 'ufAdditionalInstruction', '<p margin-top="12px">Idaho requires that you list any place where you have been previously registered to vote or have voted, or write "I have never voted."   Please verify that this information is accurately included on your Addendum Page.</p>'),
	(302, 'Florida Oath', 'ufAddendum', '<p> </p><p> </p><p>\r\nI do solemnly swear (or affirm) that I will protect and defend the Constitution of the United States and the Constitution of the State of Florida, that I am qualified to register as an elector under the Constitution and laws of the State of Florida, and that all information provided in this application is true.\r\n</p>\r\n<p>_____________________________________________</p>'),
	(303, 'State Note - Maine', 'ufAdditionalInstruction', '<p margin-top="12px">Maine requires that you provide the name of the municipality and state of any place where you have been previously registered to vote or have voted <i>before</i> registering at the Maine address you indicated on the Voter Registration/Ballot Request form.</p>\r\n\r\n<p margin-top="12px">Please verify that this information is accurately included on your Addendum Page.</p>'),
	(304, 'State Note - Minnesota', 'ufAdditionalInstruction', '<p margin-top="12px">Minnesota requires that you provide either a US Passport Number or a Military Identification Card Number on your Voter Registration/Ballot Request form.  Please verify that this information is accurately included on your form in the Identification section, field 2g.</p>\r\n\r\n<p margin-top="12px">Only if you cannot provide either a US Passport Number or a Military Identification Card Number are you then required to have your form notarized.</p>\r\n\r\n<p margin-top="12px">If this is your situation, do not sign/date your form other than before the authorized notary.</p>\r\n\r\n<p margin-top="12px">Notarization can be obtained through a notary public, commissioned officer, consular officer or other authorized person.  Many overseas voters go to the US Consulate or Embassy in their area to notarize their voting documents.</p>'),
	(306, 'State Note - Puerto Rico', 'ufAdditionalInstruction', '<p margin-top="12px">Puerto Rico requires that you provide your mother and father\'s first names. Please verify that this information is accurately included on your Addendum Page.</p>\r\n\r\n<p margin-top="12px"><b>Notarization Required:</b> Puerto Rico requires a notary signature on your Voter Registration/Ballot Request form. Do not sign/date your form other than before the authorized notary.</p>\r\n\r\n<p margin-top="12px">Notarization can be obtained through a notary public, commissioned officer, consular officer or other authorized person. Many overseas voters go to the US Consulate or Embassy in their area to notarize their voting documents.</p>'),
	(307, 'State Note - Vermont (Oath Only)', 'ufAdditionalInstruction', '<p margin-top="12px">If you are registering to vote for the first time in Vermont, you must take the Vermont "Voter\'s Oath" as part of your registration process. You must take this oath before a commissioned officer, notary, or other official authorized to administer oaths.</p>\r\n\r\n<p margin-top="12px">Do not sign/date your form other than before the authorized official.</p>\r\n\r\n<p margin-top="12px">Notarization can be obtained through a notary public, commissioned officer, consular officer or other authorized person.  Many overseas voters go to the US Consulate or Embassy in their area to notarize their voting documents.</p>\r\n\r\n<p margin-top="12px">If you indicated in the voter registration process that you are a first time Vermont voter, the oath and signing instructions will print on your Voter Registration/Ballot Request form on the addendum page.</p>\r\n\r\n<p margin-top="12px"><b>Vermont Voter\'s Oath:</b></p>\r\n\r\n<p margin-top="12px">"I solemnly swear (or affirm) that whenever I give my vote or suffrage, touching any matter that concerns the State of Vermont, I will do it so as in my conscience I shall judge will most conduce to the best good of the same, as established by the Constitution, without fear or favor of any person."</p>\r\n\r\n<p margin-top="12px"><i>-Vermont Constitution, Chapter II, Section 42</i></p>'),
	(308, 'State Note - Virginia', 'ufAdditionalInstruction', '<p margin-top="12px">Virginia has several state specific requirements.  Please verify that the information requested below is accurately included on your Addendum Page.</p>\r\n\r\n<p margin-top="12px">\r\n   <ol margin-left="10px">\r\n         <li margin-top="10px">\r\n                    An indication of whether your Virginia home is still available to you. \r\n  </li>\r\n                <li margin-top="10px">\r\n                    If your Virginia home is no longer available to you, you must indicate your last day of residency at your last Virginia voting residence address.\r\n         </li>\r\n               <li margin-top="10px">\r\n                 If you have voted before, you must indicate the name of the state and county where you last registered and voted.\r\n            </li>\r\n            <li margin-top="10px">\r\n                     If you have not voted before, indicate, "I have never voted." \r\n            </li>\r\n            <li margin-top="10px">\r\n                     Uniformed Service members, merchant marine members, and their spouses and dependents.  Virginia requires that you indicate you????re a) branch of service, and b) grade or rank of the military member.  \r\n           </li>\r\n               <li margin-top="10px">\r\n                        Citizens residing overseas for reason of employment and their accompanying spouse/dependents provide the name and address of their employer. \r\n             </li>\r\n               <li margin-top="10px">\r\n                    Virginia specifically requests that you inform them if you would like to have your ballot sent to you by email or FAX.  If FAX option is chosen you must provide hours of day that you can receive fax in Eastern Standard Time.\r\n                </li>\r\n       </ol>\r\n</p>'),
	(372, 'VT Notarization not required', 'ufSigned', '<i>NOT REQUIRED</i>'),
	(393, 'FL - No State ID', 'ufDriverLicense', 'NONE'),
	(394, 'FL - No SSN', 'ufSSN', 'NONE'),
	(395, 'FL - First time voter', 'ufAddendum', '<p> </p>\r\n<p> </p>\r\n<p>I have never voted before</p>'),
	(396, 'AK - Note to citizens', 'ufAddendum', '<p></p>\r\n<p>I  wish to register as a Federal voter and was last domiciled in Alaska prior to leaving the U.S.</p>'),
	(412, 'AK -Addtional ID', 'ufAddendum', '<p> </p><p>#if($!ufAdditionalIdPassport != "")My passport number is: $!ufAdditionalIdPassport\r\n#end\r\n#if($!ufAdditionalIdStateId != "")My State ID number is: $!ufAdditionalIdStateId\r\n#end\r\n</p>'),
	(417, 'AK - No ID', 'ufAddendum', '<p> </p><p> </p><p>I do not have a Social Security Number or Alaska Driver\'s License. Please assign me an ID for voting purposes.</p><p>_____________________________________________</p>'),
	(424, 'NV No ID', 'ufAdditionalInstruction', '<p margin-left="24px">If you cannot provide your valid Nevada Driver\'s License OR Nevada identification card number OR the last four digits of your Social Security number, contact your <b>Local Election Official</b>, listed below, to be assigned a unique identification number.</p>'),
	(429, 'NY - No ID', 'ufAdditionalInstruction', '<p margin-left="24px">If you do not possess a New York Driver\'s License or Social Security number, other acceptable forms of identification include a <b>photocopy</b> of: current photo ID (passport, school ID, company photo ID), government check, OR other government document. </p><p margin="24px">Please include the photocopy with this application.</p>'),
	(430, 'ND - no ID', 'ufAddendum', 'I do not possess either a valid North Dakota Driver\'s License or State ID, therefore I have left the ID field blank.'),
	(439, 'TX No ID', 'ufAdditionalInfo', '<p>I do not have any of the requested forms of ID</p>'),
	(440, 'VA No SSN', 'ufSSN', 'NONE'),
	(441, 'WI - overseas temp addendum', 'ufAddendum', '<p>If you are overseas temporarily and are not currently registered to vote in Wisconsin, you must enclose proof of Wisconsin residency (such as a copy of a current Wisconsin Driver\'s License, Wisconsin I.D. card, bank statement, or utility bill) with this application. Documents must contain your full name and complete voting address (your previous WI address).</p>'),
	(442, 'WI - overseas temp instrustions', 'ufAdditionalInstruction', '<p margin-left="24px">If you are overseas temporarily and are not currently registered to vote in Wisconsin, you must enclose proof of Wisconsin residency (such as a copy of a current Wisconsin Driver\'s License, Wisconsin I.D. card, bank statement, or utility bill) with this application. Documents must contain your full name and complete voting address (your previous WI address).</p>'),
	(446, 'Voter Intention', 'ufAddendum', '#if( ($ufRavaIntentNewReg and $ufRavaIntentNewReg == "true") || ($ufRavaIntentBallot and $ufRavaIntentBallot == "true") || ($ufRavaIntentNewParty and $ufRavaIntentNewParty == "true") || ($ufRavaIntentNewAddr and $ufRavaIntentNewAddr == "true"))\r\n<p></p>\r\n<p>My intention in filing this form is:</p>\r\n#if($ufRavaIntentNewReg and $ufRavaIntentNewReg == "true")<p>- New voter registration and ballot request</p>#end\r\n#if($ufRavaIntentBallot and $ufRavaIntentBallot == "true")<p>- Ballot request for registered voter</p>#end\r\n#if($ufRavaIntentNewParty and $ufRavaIntentNewParty == "true")<p>- Change of party affiliation</p>#end\r\n#if($ufRavaIntentNewAddr and $ufRavaIntentNewAddr == "true")<p>- Address updates</p>#end\r\n#end\r\n'),
	(2197, 'Sign up for a mailing list', 'ufAddendum', '#if($ny_mailing_list && $ny_mailing_list == \'true\')\r\n<p></p><p>Please add me to your Federal Overseas and Military Absentee Voter Mailing List. I would like to be kept informed by your office on important voting news.</p>\r\n#end'),
	(2198, 'Provided by Us Vote', 'ufAdditionalInfo', '<p><b>Note:</b> This application was generated with online assistance provided by U.S. Vote Foundation www.usvotefoundation.org</p>');
