	(283, 6, 156, 'Party Note', 1, 0, 0, 0, '', '', 'Kentucky has "closed party primary elections."  You must register as Democrat or Republican to vote in that party\'s primary election. If you register as "Other", you can vote in nonpartisan primaries only.<br /><br />If you are already registered to vote, but are changing your party on this form:  You must change your party affiliation by December 31st in order to vote in the upcoming primary election.\r\n<br />', '', ''),
