	(379, 6, 287, 'Florida Voter\'s Registration Oath', 1, 0, 0, 0, '', '', 'Please read the following oath before proceeding:<br /> <br /><strong>"I do solemnly swear (or affirm) that I will protect and defend the Constitution of the United States and the Constitution of the State of Florida, that I am qualified to register as an elector under the Constitution and laws of the State of Florida, and that all information provided in this application is true."</strong><br /> <br /><i>Any person who willfully swears or affirms falsely to any oath or affirmation commits a felony under s.104.011, Florida Statutes.</i><br /> <br />', '', ''),
