	(436, 6, 329, 'Note:', 1, 0, 0, 0, '', '', 'Overseas Vote Foundation (OVF), a nongovernmental, nonpartisan, charitable organization, is pleased to work with the Office of the Minnesota Secretary of State to bring this service to you.  OVF is interested in feedback regarding you and your experience with this service.  Answering the questions below is entirely <b>OPTIONAL</b>.', '', ''),
	(439, 6, 331, 'MN email signup link', 1, 0, 0, 0, '', '', 'If you would like to sign up for the Office of the Minnesota Secretary of State\'s e-newsletter, please <a href="http://www.sos.state.mn.us/home/index.asp?page=20" target="_blank" style="text-decoration: underline;">click here</a>.', '', ''),
	(441, 6, 335, 'temporary title', 1, 0, 0, 0, '', '', 'ExxonMobil\'s Citizen Action Team online voter information service is designed to pro-actively inform you of important, time-critical voter information.\r\n\r\nWe will never sell or give away your email address, for more information please refer to our <a href="http://www.exxonmobil.com/Global-All/Legal/TC_Global_English.asp" target="_blank">Privacy and Security Policy</a>.<br /><br />\r\n<h2>ExxonMobil Voter Alerts Email Opt-in</h2>', '', ''),
	(442, 15, 335, 'Yes, please add me to the list!', 2, 0, 0, 0, '', '', '', '', ''),
	(443, 6, 336, 'temporary title', 1, 0, 0, 0, '', '', '<p>This site is licensed to the Office of the Minnesota Secretary of State (OSS) by the Overseas Vote Foundation (OVF) a non-partisan, non-profit association helping Americans serving in the military or otherwise living abroad to participate in our democracy. This site is a partnership and all information provided is the shared responsibility of the OSS and OVF.  Any identification numbers that you provide are only retained long enough to be printed on the document at the end of the process.  Neither the OSS or the OVF have access to this data.</p>\r\n<p>Once you have submitted your document, the data that you supply is restricted to elections officials and to those who obtain the list for political, law enforcement and jury selection purposes.  The lists provided for these purposes <u>do not</u> include your driver\'s license, state ID, Social Security, or U.S. Passport numbers.  The last four digits of your Social Security Number, if you provide them, have special protection because they are classified as private data.  This partial number may be sent along with your name and date of birth to the Social Security Administration, via the Department of Public Safety, to verify your identity. </p>\r\n', '', ''),
	(448, 6, 338, 'note', 1, 0, 0, 0, '', '', 'Voter identification data is not stored in this system. It is deleted at the end of this data entry process.', '', ''),
