	(455, 6, 341, 'label', 1, 0, 0, 0, '', '', '<h2>Minnesota State ID Card Number</h2>', '', ''),
	(458, 6, 344, 'note for no ID', 1, 0, 0, 0, '', '', '<p>If you have access to any of these documents / ID numbers, you are required by Minnesota law to provide one of them.  Please be assured, your ID number is only retained long enough to be printed on the form at the end of the process.  Neither the OSS or OVF have access to this data.  Once you have downloaded this form at the end of this process, your ID number is deleted.</p>\r\n<p>\r\nIf you do not have access to any of these documents / ID numbers, your application will be accepted as long as you attest to the truthfulness of the contents of this application under penalty of perjury.</p>', '', ''),
	(460, 15, 345, 'Sign up for Overseas Vote Foundation Voter Alerts Mailing List', 1, 0, 0, 0, '', '', '', '', ''),
	(461, 6, 346, 'Party Note', 1, 0, 0, 0, '', '', '<p><b>Important:</b> To vote in West Virginia\'s primary elections, you must provide your party affiliation and the party whose ballot you wish to vote in order to send you the correct ballot. \r\n</p><p>\r\nIf you are only voting in the general (presidential) election, party affiliation is not required. \r\n</p><p>\r\nIn all cases, this is an optional input field.\r\nDeclaration of your party affiliation is optional in West Virginia, however, your declaration is recommended if you intend to vote in Primary elections. You may also choose to leave the selection blank.\r\n</p><p>\r\nIf you are requesting a primary election ballot and desire to vote a particular party\'s ballot, you must note your selection here.*\r\n</p>', '', ''),
	(462, 4, 346, 'Party Name or enter \'none\'', 2, 0, 0, 0, '', 'ufPoliticalParty', '', '', ''),
	(463, 6, 346, 'astrisk', 3, 0, 0, 0, '', '', '<p style="font-size: 75%; line-height: 1em; font-style: italic">\r\n*The West Virginia Democratic, Republican, and Mountain Parties have authorized those not registered in a major party, (i.e. independents, non-partisan, or Constitution Party) to vote their primary ballot.  If no selection is made, you will receive the ballot of you party affiliation noted above.</p>', '', ''),
