	(618, 6, 456, 'Important Note', 1, 0, 0, 0, '', '', '<strong>Important:</strong>\r\n<ul>\r\n<li>At the end of this process you must download and PRINT your completed form and instructions, or save them for later printing.\r\n</li>\r\n<li> Sign, date and mail, fax or email (as a scanned attachment) the form to the election office address provided to you in the instructions.\r\n</li>\r\n</ul>\r\n\r\n', '', ''),
	(622, 6, 459, 'default intro', 1, 0, 0, 0, '', '', '<strong>Important:</strong>\r\n<ul>\r\n<li>At the end of this process you must download and PRINT your completed document and instructions, or save them for later printing.\r\n</li>\r\n<li>Sign, date and submit the document to the election office address provided to you in the instructions.\r\n</li>\r\n<li>Note that even if you fax or email your form, you must send the signed, original, hard copy by mail in order to assure you meet the signature requirements.\r\n</li>\r\n</ul>\r\n\r\n', '', ''),
