	(5503, 6, 2137, 'Note', 3, 0, 0, 0, '', '', '<p class="hint">An eligible applicant who wants to non-publish the applicants residence address in voter lists must also provide an alternative post office box mailing address within Virginia to be used on the voter lists.</p>', '', ''),
	(5508, 6, 2142, 'MN FWAB Intro note', 1, 0, 0, 0, '', '', 'This is a Vote-Print-Mail Ballot System designed to facilitate your use of the Federal Write-in Absentee Ballot (FWAB).\r\n<br /><br />\r\n<b>Federal Races:</b> You will be guided through the required data entry and will be presented with a list of candidates for President of the United States, the U.S. Senate, and the U.S. House of Representatives based on your voting district.\r\n<br /><br />\r\n<b>State and Local Races:</b> Military and overseas voters (except for citizens residing outside of the U.S. permanently or indefinitely) may also vote in state and local races. You will be presented with candidates for state legislative races, local races, and judicial races, as well as two proposed constitutional amendments and local ballot questions, if applicable. To find links to additional information about the candidates and questions appearing on your ballot, go to <a target="_blank" href="http://myballotmn.sos.state.mn.us/Default.aspx">http://myballotmn.sos.state.mn.us/Default.aspx</a>.\r\n<br /><br />\r\nThis system produces paper ballots only. It is not connected to a real-time Internet-based voting system. You must PRINT your FWAB and send it into your election office. The address will be provided to you with the instructions.', '', ''),
	(5509, 6, 2143, 'FWAB Intro', 1, 0, 0, 0, '', '', 'This is a Vote-Print-Mail Ballot System designed to facilitate your use of the Federal Write-in Absentee Ballot (FWAB).\r\n<br /><br />\r\nYou will be guided through the required data entry and you will be presented with candidate lists based on your voting district. Read disclaimer: ', 'If you are not presented with a candidate list, please consult the nonpartisan <a href="http://www.vote-smart.org" target="_blank">www.vote-smart.org</a> or <a href="http://www.congress.org" target="_blank">www.congress.org</a> website to look up your candidates and write them onto the ballot. ', ''),
	(5510, 6, 2143, 'Note continue', 2, 0, 0, 0, '', '', 'If you are not presented with a candidate list, please consult the nonpartisan <a href="http://www.vote-smart.org" target="_blank">www.vote-smart.org</a> or <a href="http://www.congress.org" target="_blank">www.congress.org</a> website to look up your candidates and write them onto the ballot. ', '', ''),
