	(5520, 6, 2151, 'Please Note:', 1, 0, 0, 0, '', '', '<p>* If choosing the "Download Ballot Online" option, the link to download your absentee ballot will be sent to you after you send your form and it is approved by your election official.</p>', '', ''),
	(5521, 4, 2152, 'Confirm Fax Number', 1, 0, 0, 1, '', 'ufFaxForward', '', '', 'tel'),
	(5522, 6, 2152, 'temporary title', 2, 0, 0, 0, '', '', '', '', ''),
	(5523, 6, 2153, 'Party Affiliation', 1, 0, 0, 0, '', '', '<p><b>Florida is a closed primary state.</b>  Primary elections are nominating elections used by political parties to decide who will represent them in the General Election.  Only those who belong to the party holding the primary are eligible to vote.</p>\r\n\r\n<p><b>You always get to vote on who holds office.</b>  By State Constitutional amendment in 1998, Florida created the Universal Primary Contest.  If only people from one political party sign up to run for any particular office, then every voter gets a chance to vote in that race to decide who the winner will be?regardless of what political party you belong to.</p>', '', ''),
	(5524, 4, 2153, 'Please enter your party affiliation, if un-affiliated type "none"', 2, 0, 1, 0, '', 'ufPoliticalParty', '', '', ''),
	(5525, 6, 42, 'Label', 1, 0, 0, 0, '', '', '<p>In order to better understand the needs and profile of U.S. voters overseas, please tell us more about you. We appreciate your help!</p>', '', ''),
