	(5538, 6, 2163, 'Absentee Letter of Request Required', 1, 0, 0, 0, '', '', '<b>North Carolina State Law (163-230.2)\r\nrequires voters requesting an absentee ballot to compose their own requests independently.</b>\r\n<br/><br/>\r\nTo help voters comply with this law we are supplying a letter containing the guidelines set by North Carolina.', '', ''),
