	(5564, 5, 2183, 'Check here if this is your new legal residence.', 1, 0, 0, 0, '', 'ucResidence', '', '', ''),
	(5565, 3, 2183, ' If it is, did you change residences', 2, 0, 0, 0, '', 'ucResidence', '', '', ''),
	(5566, 6, 2183, 'Label', 3, 0, 0, 0, '', '', 'If your new legal residence is in Maryland, your voter registration record will be updated with your new address. Do not check here if you are away from your Maryland residence for school, work or travel.', '', ''),
	(5569, 6, 2185, 'requirements', 1, 0, 0, 0, '', '', '<ul>\r\n<li>I am a citizen of the United States of America.</li>\r\n<li>I will be 18 years of age or older on Election Day.</li>\r\n<li>I am a resident of California.</li>\r\n<li>Not in prison or in county jail (serving a state prison sentence or serving a term of more than one year in jail for a defined "low-level" felony), or on parole, post release community supervision, or post-sentencing probation for a felony conviction (for more information on the rights of people who have been incarcerated, please see the <a href="http://www.sos.ca.gov/elections/sharing-ideas/a-voting-guide-for-inmates.pdf"  target="_blank">Secretary of State\'s Voting Guide for Currently or Formerly Incarcerated Californians</a>)</li>\r\n<li>Not found by a court to be mentally incompetent.</li>\r\n</ul>', '', ''),
	(5570, 6, 2186, 'Label', 1, 0, 0, 0, '', '', '', '', ''),
	(5571, 4, 2186, 'If requesting a ballot for the presidential primary election please specify a political party', 2, 0, 0, 0, '', 'ufPRPartyBallotAll', '', '', 'text'),
	(5572, 6, 2187, 'Important Note', 1, 0, 0, 0, '', '', '<strong>Important:</strong>\r\n<ul>\r\n<li>At the end of this process you must download and PRINT your completed document and instructions, or save them for later printing. </li>\r\n<li>Sign, date and MAIL the document to the election office address provided to you in the instructions </li>\r\n</ul>\r\n\r\n', '', ''),
	(5575, 6, 2188, 'Note to User', 1, 0, 0, 0, '', '', '<p>New Hampshire only allows voter registration by mail under certain conditions.</p>\r\n\r\n<p>If you meet the states voter requirements and qualifications and are unable to register in person because of physical disability, religious beliefs, military service, or because of temporary absence, you may register by mail.</p> \r\n\r\n<p>You can download and submit the following form to be used as a request for an absentee voter registration affidavit and a New Hampshire voter registration form from your town or city clerk. The provided form cannot be used for voter registration in the state in New Hampshire and can only be used as a request for it.</p>\r\n', '', ''),
	(5576, 6, 2189, 'requirements', 1, 0, 0, 0, '', '', '<ul>\r\n<li>I am a citizen of the United States of America.</li>\r\n<li>I will be 18 years of age on or before election day.</li>\r\n<li>I am a resident of the state for which I am applying.</li>\r\n<li>I am not currently serving a sentence of incarceration or parole for a felony conviction.</li>\r\n</ul>', '', ''),
	(5577, 6, 2190, 'requirements', 1, 0, 0, 0, '', '', '<ul>\r\n<li>I am a citizen of the United States of America.</li>\r\n<li>I will be 18 years of age on or before election day.</li>\r\n<li>I am a resident of the state for which I am applying.</li>\r\n<li>I am not a convicted felon, or if I am, my rights relating to voting have been restored.</li>\r\n<li>I have not been judged to be mentally incapacitated with respect to voting or, if I have, my right to vote has been restored.</li>\r\n</ul>', '', ''),
	(5578, 5, 2191, 'I will need assistance with voting', 1, 0, 0, 0, '', 'ucVotingAssistTrue', '', '', ''),
	(5579, 5, 2192, 'I am interested in becoming a poll worker', 1, 0, 0, 0, '', 'ucElectionOfficalTrue', '', '', ''),
	(5580, 3, 2193, 'Are you affiliated with a political party', 1, 0, 0, 0, '', 'ucParty', '', '', ''),
	(5581, 4, 2193, 'Minor Party Name', 2, 0, 0, 0, '', 'ufThirdParty', '', '', 'text'),
	(5582, 6, 2194, 'Label', 1, 0, 0, 0, '', '', 'Please provide details about where you were born', '', ''),
