	(5584, 6, 2195, 'requirements', 1, 0, 0, 0, '', '', '<ul>\r\n<li>I am a citizen of the United States of America.</li>\r\n<li> I am resident of Massachusetts.</li>\r\n<li>I will be 18 years of age on or before election day.</li>\r\n<li>I have not been convicted of corrupt practices in respect to elections.</li>\r\n<li>I am not under guardianship with respect to voting.</li>\r\n<li>I am not currently incarcerated for a felony conviction.</li>\r\n</ul>', '', ''),
	(5585, 3, 2196, 'Are you affiliated with a political party?', 1, 0, 0, 1, '', 'ucParty', '', '', ''),
	(5586, 4, 2196, 'e) Political Designation (not a political party)', 2, 0, 0, 0, '', 'ufThirdParty', '', '', 'text'),
	(5587, 6, 2199, 'requirements', 1, 0, 0, 0, '', '', '<ul>\r\n<li>I am a citizen of the United States of America.</li>\r\n<li>I will be 18 years of age on or before election day.</li>\r\n<li>I am a resident of the state for which I am applying.</li>\r\n<li>I am not a convicted felon, or if I am, my rights relating to voting have been restored.</li>\r\n<li>I have not been judged to be mentally incompetent with respect to voting or, if I have, my right to vote has been restored.</li>\r\n<li>I have lived in MN for 20 days immediately preceding Election Day</li>\r\n</ul>', '', '');
